    t[192] = "SAM (Simple Anonymous Messaging) is a protocol which allows a client application written in any programming language to communicate over I2P, by using a socket-based interface to the I2P router. For more information, see the <a href=https://geti2p.net/en/docs/api/samv3 class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[193] = "A SAM (Egyszer\u0171 n\u00e9vtelen \u00fczenetk\u00fcld\u00e9s) egy olyan protokoll, amely lehet\u0151v\u00e9 teszi egy \u00fcgyf\u00e9lalkalmaz\u00e1snak, amely b\u00e1rmilyen programoz\u00e1si nyelven \u00edr\u00f3dott, hogy kommunik\u00e1ljon az I2P h\u00e1l\u00f3zaton kereszt\u00fcl, \u00e9s egy csatlakoz\u00f3 alap\u00fa fel\u00fcletet haszn\u00e1l az I2P routerhez. Tov\u00e1bbi inform\u00e1ci\u00f3\u00e9rt l\u00e1togasson el az <a href=https://geti2p.net/en/docs/api/samv3 class='sitelink external' target=_blank rel=noreferrer> online dokument\u00e1ci\u00f3ra</a>.";
