    t[236] = "Advanced Router Configuration";
    t[237] = "Speci\u00e1lis \u00datv\u00e1laszt\u00f3 Konfigur\u00e1ci\u00f3";
    t[238] = "Allocate number of processor threads for building tunnels. If your processor supports hyperthreading or simultaneous multithreading, you may multiply the number of processor cores by 2 to get the maximum number of threads to allocate, otherwise number of processor cores = maximum number of threads available. Note that you may wish to allocate less than the theoretical maximum to ensure you have headroom for other tasks.";
    t[239] = "Kiosztja a processzorsz\u00e1lonk\u00e9nti t\u00f6bb sz\u00e1l l\u00e9trehoz\u00e1s\u00e1hoz a processzormagok sz\u00e1m\u00e1t. Ha a processzor t\u00e1mogatja a hipersz\u00e1lh\u00faz\u00e1st vagy a p\u00e1rhuzamos t\u00f6bbsz\u00e1las\u00edt\u00e1st, akkor a processzormagok sz\u00e1m\u00e1t 2-vel kell szorozni, hogy megtudja a kioszthat\u00f3 sz\u00e1lak maxim\u00e1lis sz\u00e1m\u00e1t, egy\u00e9bk\u00e9nt a processzormagok sz\u00e1ma = a rendelkez\u00e9sre \u00e1ll\u00f3 sz\u00e1lak maxim\u00e1lis sz\u00e1ma. Vegye figyelembe, hogy kevesebbet szeretne kiosztani a teoretikus maxim\u00e1lis mennyis\u00e9gn\u00e9l, hogy biztos\u00edtson helyet m\u00e1s feladatoknak.";
