    t[364] = "When a new service tunnel is created, or a service is run for the first time (e.g. the default jetty webserver, plugins), a private encryption key is created which essentially controls the ownership of address. This is usually named <code>&hellip;privKey.dat</code>, or <code>eepPriv.dat</code>, though it's a good idea to change the name to indicate the service it belongs to and then respecify it in the Tunnel Manager server settings. This .dat file should be backed up safely; lose it and you will lose ownership and control of your hostname!";
    t[365] = "Amikor l\u00e9trehoz egy \u00faj szolg\u00e1ltat\u00e1si alagutat, vagy el\u0151sz\u00f6r futtat egy szolg\u00e1ltat\u00e1st (pl. az alap\u00e9rtelmezett jetty webszervert, b\u0151v\u00edtm\u00e9nyeket), l\u00e9trehoz\u00f3dik egy priv\u00e1t titkos\u00edt\u00e1si kulcs, amely l\u00e9nyeg\u00e9ben ir\u00e1ny\u00edtja a c\u00edm tulajdonjog\u00e1t. Ez \u00e1ltal\u00e1ban <code>&hellip;privKey.dat</code> n\u00e9ven van elmentve, vagy <code>eepPriv.dat</code>, b\u00e1r j\u00f3 \u00f6tlet megv\u00e1ltoztatni a nev\u00e9t, hogy jelezze, melyik szolg\u00e1ltat\u00e1shoz tartozik, majd \u00fajra meg kell hat\u00e1rozni a Tunal menedzser szerver be\u00e1ll\u00edt\u00e1saiban. Ez a .dat f\u00e1jl meg kell, hogy legyen biztons\u00e1gi ment\u00e9sben; ha elvesz\u00edted azt, elveszted a hosztn\u00e9v tulajdonjog\u00e1t \u00e9s ellen\u0151rz\u00e9s\u00e9t is!";
    t[368] = "This setting allows configuration of the maximum number of files per torrent I2PSnark will permit, when downloading or creating a torrent. Note that substantially increasing this value from the default of 2000 files may require additional configuration on the host system to increase the maximum number of open files the operating system will permit (e.g. <code>ulimit -n</code> on Linux). To change, add to I2PSnark's configuration file <code>i2psnark.config</code>. [Restart of I2PSnark or router required]";
    t[369] = "Ez a be\u00e1ll\u00edt\u00e1s lehet\u0151v\u00e9 teszi a torrentek let\u00f6lt\u00e9se vagy l\u00e9trehoz\u00e1sa sor\u00e1n az I2PSnark \u00e1ltal enged\u00e9lyezett f\u00e1jlok maxim\u00e1lis sz\u00e1m\u00e1nak be\u00e1ll\u00edt\u00e1s\u00e1t. Megjegyz\u00e9s: Ezen \u00e9rt\u00e9k jelent\u0151s n\u00f6vel\u00e9se az alap\u00e9rtelmezett 2000 f\u00e1jlt\u00f3l tov\u00e1bbi be\u00e1ll\u00edt\u00e1sokat ig\u00e9nyelhet a g\u00e9ph\u00e1z rendszeren a f\u00e1jlok maxim\u00e1lis sz\u00e1m\u00e1nak n\u00f6vel\u00e9s\u00e9hez, amit az oper\u00e1ci\u00f3s rendszer enged\u00e9lyez (pl. <code>ulimit -n</code> Linuxon). A m\u00f3dos\u00edt\u00e1shoz adja hozz\u00e1 az I2PSnark konfigur\u00e1ci\u00f3s f\u00e1jlhoz <code>i2psnark.config</code>. [Az I2PSnark vagy a router \u00fajraind\u00edt\u00e1sa sz\u00fcks\u00e9ges]";
    t[370] = "Configure router bandwidth allocation";
