    t[373] = "\u00cdme n\u00e9h\u00e1ny m\u00e1s k\u00f6nyvjelz\u0151 feliratkoz\u00e1si link. Lehet, hogy \u00e9rdemes hozz\u00e1adni egy-k\u00e9tet a <a href='/dns?subscriptions' target=_blank rel=noreferrer>susidns el\u0151fizet\u00e9si list\u00e1dhoz</a>. Abban az esetben, ha a c\u00edmek \u00fctk\u00f6znek az el\u0151fizet\u00e9sekben, az el\u0151fizet\u00e9sek fels\u0151 r\u00e9sz\u00e9n elhelyezett list\u00e1k els\u0151bbs\u00e9get \u00e9lveznek a tov\u00e1bbiakban elhelyezettekhez k\u00e9pest.";
