    t[554] = "Choose a name for your website (<i>hostname</i>.i2p), using lower-case. To verify that the hostname is available, check <a href=http://notbob.i2p/ target=_blank>notbob.i2p</a> or <a href=http://reg.i2p target=_blank>reg.i2p</a> before you decide. Enter the new name for your website on the <a href='/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a> where it says <i>Website name</i>, replacing the default <i>mysite.i2p</i> placeholder. If you want your website to be available when I2P starts, enable <i>Auto Start</i> and then click <i>Save</i>.";
    t[555] = "V\u00e1lasszon egy nevet a webhely\u00e9hez (<i>hosztnev</i>.i2p), kisbet\u0171ket haszn\u00e1lva. A hoszt n\u00e9v el\u00e9rhet\u0151s\u00e9g\u00e9nek ellen\u0151rz\u00e9s\u00e9hez ellen\u0151rizze a <a href=http://notbob.i2p/ target=_blank>notbob.i2p</a>-t vagy a <a href=http://reg.i2p target=_blank>reg.i2p</a>-t miel\u0151tt d\u00f6ntene. Adja meg az \u00faj nev\u00e9t a webhely\u00e9hez a <a href='/i2ptunnel/edit?tunnel=3'>\u00c1tj\u00e1r\u00f3 kezel\u0151 konfigur\u00e1ci\u00f3s oldalon</a> ahol az <i>Webhely neve</i> szerepel, az alap\u00e9rtelmezett <i>mysite.i2p</i> \u00e9rt\u00e9k cser\u00e9jek\u00e9nt. Ha azt szeretn\u00e9, hogy a webhelye el\u00e9rhet\u0151 legyen az I2P ind\u00edt\u00e1sakor, enged\u00e9lyezze az <i>Automatikus ind\u00edt\u00e1s</i>t, majd kattintson a <i>Ment\u00e9s</i> gombra.";
    t[556] = "When set to true, this enables gzip compression for the router console and default web applications. [Enabled by default]";
