    t[616] = "Bonuses may be positive or negative, and affect the peer's inclusion in Fast and High Capacity tiers. Fast peers are used for client tunnels, and High Capacity peers are used for some exploratory tunnels.";
    t[617] = "A b\u00f3nuszok lehetnek pozit\u00edvak vagy negat\u00edvak, \u00e9s befoly\u00e1solj\u00e1k a partnerek gyors \u00e9s nagy kapacit\u00e1s\u00fa szintekbe val\u00f3 felv\u00e9tel\u00e9t. Az \u00fcgyf\u00e9lalagutakhoz gyors, m\u00edg egyes felt\u00e1r\u00f3 alagutakhoz nagy kapacit\u00e1s\u00fa peereket haszn\u00e1lnak.";
    t[618] = "Yes";
    t[619] = "Igen";
    t[620] = "While I2P will work fine in this configuration, if you really have over 128KBps of bandwidth to share, it will be much more helpful to the network if you open your firewall.";
    t[621] = "Hab\u00e1r az I2P rendesen m\u0171k\u00f6dik ilyen be\u00e1ll\u00edt\u00e1ssal, ha val\u00f3ban t\u00f6bb mint 128KBps s\u00e1vsz\u00e9less\u00e9get tudsz megosztani, nagy seg\u00edts\u00e9g lesz a h\u00e1l\u00f3zat sz\u00e1m\u00e1ra, ha megnyitod a t\u0171zfalad.";
    t[622] = "A command-line application supplied with I2P that is used to request URL resources, similar to <a href=https://www.gnu.org/software/wget/ class='sitelink external' target=_blank rel=noreferrer>wget</a> or <a href=https://curl.haxx.se/ class='sitelink external' target=_blank rel=noreferrer>curl</a>. Eepget is also used internally by the router, for example to reseed from remote hosts. By default, eepget uses the HTTP proxy on <code>127.0.0.1:4444</code>.";
    t[623] = "Az I2P-vel egy\u00fctt sz\u00e1ll\u00edtott parancssori alkalmaz\u00e1s, amelyet URL er\u0151forr\u00e1sok k\u00e9r\u00e9s\u00e9hez haszn\u00e1lnak, hasonl\u00f3an a <a href=https://www.gnu.org/software/wget/ class='sitelink external' target=_blank rel=noreferrer>wget</a> vagy a <a href=https://curl.haxx.se/ class='sitelink external' target=_blank rel=noreferrer>curl</a> alkalmaz\u00e1shoz. Az eepget-t az \u00fatv\u00e1laszt\u00f3 is bels\u0151leg haszn\u00e1lja, p\u00e9ld\u00e1ul t\u00e1voli hosztok \u00fajratelep\u00edt\u00e9s\u00e9re. Az alap\u00e9rtelmez\u00e9s szerint az eepget a HTTP proxyt haszn\u00e1lja a <code>127.0.0.1:4444</code> c\u00edmen.";
