    t[722] = "Javadocs";
    t[723] = "Javadocs";
    t[724] = "An eepsite is a website that is hosted anonymously on the I2P network - you can access it by configuring your web browser to use I2P's HTTP proxy (see above) and browsing to the <code>.i2p</code> suffixed website (e.g. <a href=http://i2p-projekt.i2p/ target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p</a>). Also ensure your browser is configured to resolve DNS remotely when using the proxy to avoid DNS leaks.";
    t[725] = "Egy eepsite egy weboldal, amely n\u00e9vtelen\u00fcl van t\u00e1rolva az I2P h\u00e1l\u00f3zatban - hozz\u00e1f\u00e9rhet ehhez a weboldalhoz, amikor konfigur\u00e1lja b\u00f6ng\u00e9sz\u0151j\u00e9t az I2P HTTP proxy haszn\u00e1lat\u00e1ra (ld. fentebb) \u00e9s b\u00f6ng\u00e9szi a <code>.i2p</code> v\u00e9gz\u0151d\u00e9s\u0171 webhelyet (p\u00e9ld\u00e1ul: <a href=http://i2p-projekt.i2p/ target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p</a>). Biztos\u00edtson arr\u00f3l, hogy a b\u00f6ng\u00e9sz\u0151je be van \u00e1ll\u00edtva a t\u00e1voli DNS felold\u00e1sra a proxy haszn\u00e1lata k\u00f6zben a DNS-sziv\u00e1rg\u00e1s elker\u00fcl\u00e9se \u00e9rdek\u00e9ben.";
    t[730] = "Updating UDP port to {0}";
    t[731] = "UDP port friss\u00edt\u00e9se erre: {0}";
    t[732] = "Apache Web Server Security Guide";
    t[733] = "Apache webszerver biztons\u00e1gi \u00fatmutat\u00f3ja";
    t[736] = "Locate the configuration file: <code>00-net.i2p.router.web.RouterConsoleRunner-clients.config</code> in the <code>clients.config.d</code> folder in your I2P settings directory, and then edit accordingly:";
