    t[772] = "If you can't, I2P supports UPnP (Universal Plug and Play) and UDP hole punching with \"SSU introductions\" to relay traffic.";
    t[773] = "Ha ez nem lehets\u00e9ges, az I2P t\u00e1mogatja az UPnP-t (Universal Plug and Play) \u00e9s az UDP lyuk \u00fct\u00e9st az \"SSU bemutat\u00f3k\" \u00e1ltal, hogy forgalmat k\u00f6zvet\u00edtsen.";
