    t[836] = "The first number is the number of peers your router has sent or received a message from in the last few minutes. This may range from 8-10 to several hundred, depending on your total bandwidth, shared bandwidth, and locally-generated traffic. The second number is the number of peers seen in the last hour or so. Do not be concerned if these numbers vary widely. <a href='/configstats#router.activePeers'>[Enable graphing]</a>.";
    t[837] = "Az els\u0151 sz\u00e1m a routere \u00e1ltal k\u00fcld\u00f6tt \u00fczenetek sz\u00e1ma az ut\u00f3bbi p\u00e1r percben, vagy a routere \u00e1ltal kapott \u00fczenetek sz\u00e1ma az ut\u00f3bbi p\u00e1r percben. Ez 8-10-t\u0151l t\u00f6bb sz\u00e1zig terjedhet, att\u00f3l f\u00fcgg\u0151en, hogy teljes s\u00e1vsz\u00e9less\u00e9g\u00e9nek, megosztott s\u00e1vsz\u00e9less\u00e9g\u00e9nek \u00e9s helyben gener\u00e1lt forgalm\u00e1nak. A m\u00e1sodik sz\u00e1m az ut\u00f3bbi p\u00e1r \u00f3r\u00e1ban l\u00e1tott csom\u00f3pontok sz\u00e1ma. Nem kell agg\u00f3dnia, ha ezek a sz\u00e1mok nagyban v\u00e1ltoznak. <a href='/configstats#router.activePeers'>[Grafikonok enged\u00e9lyez\u00e9se]</a>.";
