    t[878] = "This setting permits disabling SSU tests to determine if your router is firewalled and can be enabled for routers that are definitely not firewalled but are experiencing intermittent firewalling issues. In the event that testing is disabled, both SSU and NTCP should report your current public ip address on <a href=/info>the router info page</a>. [Restart required]";
    t[879] = "Ez a be\u00e1ll\u00edt\u00e1s lehet\u0151v\u00e9 teszi az SSU tesztek letilt\u00e1s\u00e1t a router t\u0171zfal\u00e1llapot\u00e1nak meghat\u00e1roz\u00e1s\u00e1hoz, \u00e9s enged\u00e9lyezhet\u0151 azokon a routerekre, amelyek hat\u00e1rozottan nincsenek t\u0171zfalon k\u00edv\u00fcl, de id\u0151szakos t\u0171zfaloz\u00e1si probl\u00e9m\u00e1kkal k\u00fczdenek. Abban az esetben, ha a tesztel\u00e9s le van tiltva, mind az SSU, mind az NTCP jelentenie kell a jelenlegi nyilv\u00e1nos IP-c\u00edmet a <a href=/info>t\u0171zfal inform\u00e1ci\u00f3 oldal</a>on. [\u00dajraind\u00edt\u00e1s sz\u00fcks\u00e9ges]";
