    t[977] = "Kiv\u00fclr\u0151l el\u00e9rhet\u0151 hosztn\u00e9v vagy IP c\u00edm";
    t[980] = "Your webserver is running by default at <a href=http://127.0.0.1:7658/>http://127.0.0.1:7658</a>, but is not accessible by others until you start the <i>I2P Webserver</i> tunnel. After starting the tunnel, your site will be difficult for other people to find. You could just tell people the destination or the Base32 address, but thankfully I2P has an address book to store domain names, and various services where you can <a href=/help/hostnameregistration>register a new .i2p domain</a> for free.";
    t[981] = "A webszerver alap\u00e9rtelmez\u00e9s szerint fut a k\u00f6vetkez\u0151 c\u00edmen: <a href=http://127.0.0.1:7658/>http://127.0.0.1:7658</a>, azonban m\u00e1sok nem f\u00e9rhetnek hozz\u00e1, am\u00edg el nem ind\u00edtja az <i>I2P webszerver</i> \u00e1tj\u00e1ratot. Miut\u00e1n elind\u00edtotta az \u00e1tj\u00e1ratot, webhelye m\u00e1sok sz\u00e1m\u00e1ra nehezen megtal\u00e1lhat\u00f3 lesz. Egyszer\u0171en megadhatja az embereknek a c\u00e9l\u00e1llom\u00e1st vagy a Base32 c\u00edmet, de szerencs\u00e9re az I2P-nek van egy c\u00edmt\u00e1ra, ahol tartom\u00e1nyneveket lehet t\u00e1rolni, \u00e9s k\u00fcl\u00f6nb\u00f6z\u0151 szolg\u00e1ltat\u00e1sok, ahol ingyen <a href=/help/hostnameregistration>regisztr\u00e1lhat \u00faj .i2p tartom\u00e1nyt</a>.";
