    t[1171] = "H\u00edrek utolj\u00e1ra friss\u00edtve: {0} ";
    t[1174] = "Unless an outproxy has been set up for the service you want to connect to, this is not possible, with the exception of BitTorrent (see below). There are only three types of outproxies running right now: HTTP, HTTPS, and email. Note that there is currently no publicly listed SOCKS outproxy. If this type of service is required, try <a href=https://torproject.org/ target=_blank rel=noreferrer class='sitelink external'>Tor</a>.";
    t[1175] = "Hacsak nincs l\u00e9trehozva egy outproxy a kapcsol\u00f3dni k\u00edv\u00e1nt szolg\u00e1ltat\u00e1shoz, ez nem lehets\u00e9ges, a BitTorrent kiv\u00e9tel\u00e9vel (l\u00e1sd al\u00e1bb). Jelenleg csak h\u00e1romf\u00e9le outproxy m\u0171k\u00f6dik: HTTP, HTTPS \u00e9s e-mail. Vegye figyelembe, hogy jelenleg nincs nyilv\u00e1nosan nyilv\u00e1ntartott SOCKS outproxy. Ha ilyen t\u00edpus\u00fa szolg\u00e1ltat\u00e1sra van sz\u00fcks\u00e9g, pr\u00f3b\u00e1lja ki a <a href=https://torproject.org/ target=_blank rel=noreferrer class='sitelink external'>Tor</a> projektet.";
