    t[1212] = "The skew (offset) of your computer's clock relative to the network-synced time (if known). I2P requires your computer's time be accurate. If the skew is more than a few seconds, please correct the problem by adjusting your computer's time. If I2P cannot connect to the internet, a reading of 0ms may be indicated. Note: This is only displayed in the <i>Router Information (advanced)</i> section. You may add this section to your Sidebar on the <a href='/configsidebar'>Sidebar Configuration page</a>.";
    t[1213] = "A sz\u00e1m\u00edt\u00f3g\u00e9p \u00f3r\u00e1j\u00e1nak a h\u00e1l\u00f3zhonos idej\u00e9t\u0151l val\u00f3 elhajl\u00e1sa (amennyiben ismert). Az I2P \u00e9rv\u00e9nyes id\u0151t felt\u00e9telez a sz\u00e1m\u00edt\u00f3g\u00e9pen. Amennyiben az elhajl\u00e1s t\u00f6bb mint n\u00e9h\u00e1ny m\u00e1sodperc, k\u00e9rj\u00fck, \u00e1ll\u00edtsa be a helyes id\u0151t a sz\u00e1m\u00edt\u00f3g\u00e9pen. Ha az I2P nem tud kapcsol\u00f3dni az internethez, az 0ms \u00e9rt\u00e9ket jelezhet. Megjegyz\u00e9s: Ez csak megjelenik a <i>Kapcsolati adatok (halad\u00f3)</i> szakaszban. Ezt a r\u00e9szt hozz\u00e1adhatja az oldals\u00e1vj\u00e1hoz a <a href='/configsidebar'>Oldals\u00e1v be\u00e1ll\u00edt\u00e1s oldalon</a>.";
