    t[1462] = "How long an outbound message waits in the queue. This should generally be a few hundred milliseconds or less. If it is consistently higher than 1000ms, your computer is very slow, or you should adjust your bandwidth limits, or your (BitTorrent?) clients may be sending too much data and should have their transmit bandwidth limit reduced. <a href='/configstats#transport.sendProcessingTime'>[Enable graphing]</a> (transport.sendProcessingTime).";
    t[1463] = "Mennyi ideig v\u00e1rakozik az egyik k\u00fcld\u00f6tt \u00fczenet a v\u00e1r\u00f3list\u00e1ban. Ez \u00e1ltal\u00e1ban n\u00e9h\u00e1ny sz\u00e1z milliszekundum vagy ann\u00e1l kevesebbnek kell lennie. Ha k\u00f6vetkezetesen 1000 ms-n\u00e9l magasabb, akkor a sz\u00e1m\u00edt\u00f3g\u00e9p nagyon lass\u00fa, vagy be kell \u00e1ll\u00edtania a s\u00e1vsz\u00e9less\u00e9g korl\u00e1tait, vagy az \u00d6n (BitTorrent?) kliense t\u00fal sok adatot k\u00fcld \u00e9s cs\u00f6kkentenie kell a k\u00fcld\u00e9si s\u00e1vsz\u00e9less\u00e9g\u00e9t. <a href='/configstats#transport.sendProcessingTime'>[Grafikus \u00e1br\u00e1zol\u00e1s enged\u00e9lyez\u00e9se]</a> (transport.sendProcessingTime).";
