    t[1574] = "The core I2P software, which routes encrypted packets on the I2P network. All routers by default participate in the network except routers running in countries considered hostile (see <i>Strict Countries</i>), which both helps the network and provides cover traffic for any clients or servers connecting to the I2P network through the router.";
    t[1575] = "A k\u00f6zponti I2P-szoftver, amely titkos\u00edtott csomagokat \u00e1rut\u00e1l az I2P-h\u00e1l\u00f3zaton. Az alap\u00e9rtelmez\u00e9s szerint minden \u00fatv\u00e1laszt\u00f3 r\u00e9szt vesz a h\u00e1l\u00f3zatban, kiv\u00e9ve azokat az orsz\u00e1gokban m\u0171k\u00f6d\u0151 \u00fatv\u00e1laszt\u00f3kat, amelyeket ellens\u00e9gesnek tekintenek (l\u00e1sd: <i> szigor\u00fa orsz\u00e1gok </i>), amelyek mind a h\u00e1l\u00f3zatnak seg\u00edtnek, mind a kliensek vagy szerverek t\u00e1vir\u00e1ny\u00edt\u00e1s\u00e1t az I2P-h\u00e1l\u00f3zaton kereszt\u00fcl.";
