    t[1619] = "Ez a be\u00e1ll\u00edt\u00e1s lehet\u0151v\u00e9 teszi, hogy manu\u00e1lisan kiv\u00e1laszd a b\u00f6ng\u00e9sz\u0151t, amelyet az I2P ind\u00edt a rendszerind\u00edt\u00e1skor (ha a konzolon be van \u00e1ll\u00edtva, hogy ind\u00edtson egy b\u00f6ng\u00e9sz\u0151t a rendszerind\u00edt\u00e1skor), fel\u00fcl\u00edrva az oper\u00e1ci\u00f3s rendszer alap\u00e9rtelmezett b\u00f6ng\u00e9sz\u0151j\u00e9t. Tov\u00e1bbi inform\u00e1ci\u00f3\u00e9rt l\u00e1sd a fenti <a href=#alternative_browser>Gyakran Ism\u00e9telt K\u00e9rd\u00e9sek</a> bejegyz\u00e9st.";
