    t[1687] = "Ez a csom\u00f3pontok sz\u00e1ma, amelyek a h\u00e1l\u00f3zat teljes\u00edtm\u00e9ny\u00e9nek meghat\u00e1roz\u00e1s\u00e1hoz sz\u00fcks\u00e9ges kutat\u00f3 (exploratory) alagutak \u00e9p\u00edt\u00e9s\u00e9hez \u00e1llnak rendelkez\u00e9sre. \u00c1ltal\u00e1ban 8 \u00e9s 75 k\u00f6z\u00f6tt van. A gyors csom\u00f3pontok megtal\u00e1lhat\u00f3k a magas kapacit\u00e1s\u00fa v\u00e1lasz belsej\u00e9ben. A magas kapacit\u00e1s\u00fa csom\u00f3pontok megjelennek a <a href='/profiles'>Profilok oldal</a>. <a href='/configstats#router.highCapacityPeers'>[Grafikonok enged\u00e9lyez\u00e9se]</a>";
