    t[2188] = "The following threshold definition <i class=example>180/60</i> specifies that the same remote destination is allowed to make 179 connection attempts during a 60 second period. If it makes one more attempt within the same period, the threshold will be breached and further connection attempts will be rejected until the end of the period:";
    t[2189] = "Az <i class=example>180/60</i> k\u00f6vetkez\u0151 k\u00fcsz\u00f6b\u00e9rt\u00e9k meghat\u00e1roz\u00e1sa szerint ugyanaz a t\u00e1voli c\u00e9l\u00e1llom\u00e1s 60 m\u00e1sodperces id\u0151szak alatt 179 kapcsol\u00f3d\u00e1si k\u00eds\u00e9rletet tehet. Ha ugyanazon id\u0151szakon bel\u00fcl m\u00e9g egy k\u00eds\u00e9rletet tesz, akkor a k\u00fcsz\u00f6b\u00e9rt\u00e9k megs\u00e9rt\u00e9sre ker\u00fcl, \u00e9s tov\u00e1bbi kapcsol\u00f3d\u00e1si k\u00eds\u00e9rletek elutas\u00edt\u00e1sra ker\u00fclnek az id\u0151szak v\u00e9g\u00e9ig:";
