    t[2211] = "Az I2P v\u00e9letlenszer\u0171 portot v\u00e1laszt ki 9000 \u00e9s 31000 k\u00f6z\u00f6tt, hogy m\u00e1s routerekkel kommunik\u00e1ljon, amikor a program el\u0151sz\u00f6r fut, vagy amikor a k\u00fcls\u0151 IP-c\u00edmed megv\u00e1ltozik <a href=/confignet#ipchange>Laptop M\u00f3d</a> haszn\u00e1latakor. A <a href=/confignet#udpconfig>kiv\u00e1lasztott port</a> l\u00e1that\u00f3 a <a href=/confignet>h\u00e1l\u00f3zati konfigur\u00e1ci\u00f3s oldalon</a>.";
