    t[2215] = "Friss\u00edt\u00e9s vagy ellen\u0151rz\u00e9s m\u00e1r folyamatban van";
    t[2218] = "Log date format";
    t[2219] = "Napl\u00f3 d\u00e1tumform\u00e1tum";
    t[2226] = "Less than 256MB allocated to the JVM";
    t[2227] = "Kevesebb, mint 256MB JVM-nek kiosztott mem\u00f3ria";
    t[2230] = "Average closest floodfill distance";
    t[2231] = "\u00c1tlagos legk\u00f6zelebbi el\u00e1raszt\u00e1si t\u00e1vols\u00e1g";
    t[2232] = "It will take at least 10 minutes from your router starting for it to accept building participating tunnels in order to ensure your router is stable and successfully bootstrapped to the network.";
    t[2233] = "Minimum 10 percbe telik, miut\u00e1n az \u00fatv\u00e1laszt\u00f3ja elindul, hogy elfogadja a r\u00e9szt vev\u0151 alagutak \u00e9p\u00edt\u00e9s\u00e9t, annak \u00e9rdek\u00e9ben, hogy az \u00fatv\u00e1laszt\u00f3ja stabil legyen \u00e9s sikeresen csatlakozzon a h\u00e1l\u00f3zathoz.";
    t[2234] = "Last Heard From";
    t[2235] = "Legutolj\u00e1ra Hallott a K\u00f6vetkez\u0151t\u0151l:";
    t[2236] = "midnight";
    t[2237] = "\u00e9jf\u00e9l";
    t[2246] = "A gentle introduction to I2P";
    t[2247] = "Gyeng\u00e9d bevezet\u00e9s az I2P-be";
    t[2250] = "How long jobs are waiting before execution. The job queue is listed on the <a href='/jobs'>Jobs page</a>. Unfortunately, there are several other job queues in the router that may be congested, and their status is not available in the router console. The job lag should generally be zero. If it is consistently higher than 500ms, your computer is very slow, your network is experiencing connectivity issues, or the router has serious problems. <a href='/configstats#jobQueue.jobLag'>[Enable graphing]</a>.";
    t[2251] = "Mennyi ideig v\u00e1rakoznak a munk\u00e1k a v\u00e9grehajt\u00e1s el\u0151tt. A munka v\u00e1r\u00f3list\u00e1ja megtal\u00e1lhat\u00f3 a <a href='/jobs'>Munk\u00e1k oldalon</a>. Sajnos a routernak t\u00f6bb m\u00e1sik munka v\u00e1r\u00f3ja is lehet, amelyek t\u00falterheltek lehetnek, \u00e9s az \u00e1llapotuk nem \u00e9rhet\u0151 el a router konzolj\u00e1ban. Az elakad\u00e1snak \u00e1ltal\u00e1ban nulla kellene, hogy legyen. Ha k\u00f6vetkezetesen 500 ms-n\u00e9l magasabb, akkor a sz\u00e1m\u00edt\u00f3g\u00e9p nagyon lass\u00fa, h\u00e1l\u00f3zati probl\u00e9m\u00e1kkal k\u00fczd, vagy a router komoly probl\u00e9m\u00e1kkal n\u00e9z szembe. <a href='/configstats#jobQueue.jobLag'>[Grafikus \u00e1br\u00e1zol\u00e1s enged\u00e9lyez\u00e9se]</a>.";
    t[2252] = "Configure I2P Updates";
    t[2253] = "I2P friss\u00edt\u00e9sek konfigur\u00e1l\u00e1sa";
    t[2254] = "Before you tell the world about your new website, you should add some content. Go to the server's root directory <a href=#rootdir>listed above</a> and replace the <i>index.html</i> redirect page with your own content. If you need a template for a basic site, feel free to adapt <a href=http://127.0.0.1:7658/help/pagetemplate.html>this page</a>. If you're returned to this page after editing the content, try clearing your browser's web cache.";
    t[2255] = "Miel\u0151tt bejelenten\u00e9d az \u00faj weboldaladat a vil\u00e1gnak, \u00e9rdemes tartalmat hozz\u00e1adni. L\u00e9pj a szerver gy\u00f6k\u00e9rk\u00f6nyvt\u00e1r\u00e1ba <a href=#rootdir>itt felsorolt</a>, majd cser\u00e9ld ki a <i>index.html</i> \u00e1tir\u00e1ny\u00edt\u00f3 oldalt a saj\u00e1t tartalmaddal. Ha sz\u00fcks\u00e9ged van egy sablonra egy alap weboldalhoz, haszn\u00e1lhatod \u00e9s m\u00f3dos\u00edthatod <a href=http://127.0.0.1:7658/help/pagetemplate.html>ezen az oldalon</a>. Ha a tartalom szerkeszt\u00e9se ut\u00e1n visszat\u00e9rsz erre az oldalra, pr\u00f3b\u00e1ld t\u00f6r\u00f6lni a b\u00f6ng\u00e9sz\u0151 webgyors\u00edt\u00f3t\u00e1r\u00e1t.";
