    t[2293] = "Al\u00e1\u00edrva:";
    t[2294] = "The <i class=example>default</i> threshold applies to any remote destination not explicitly listed in the definition or in any of the referenced files. To set a default threshold use the keyword <i class=example>default</i>.";
    t[2295] = "Az <i class=example>alap\u00e9rtelmezett</i> k\u00fcsz\u00f6b\u00e9rt\u00e9k vonatkozik minden t\u00e1voli c\u00e9lhelyre, amelyet nem t\u0171ntetnek fel egy\u00e9rtelm\u0171en a meghat\u00e1roz\u00e1sban vagy a hivatkozott f\u00e1jlok b\u00e1rmelyik\u00e9ben. Az alap\u00e9rtelmezett k\u00fcsz\u00f6b\u00e9rt\u00e9k be\u00e1ll\u00edt\u00e1s\u00e1hoz haszn\u00e1lja a <i class=example>default</i> kulcssz\u00f3t.";
    t[2306] = "Estimated total leasesets";
    t[2307] = "Becs\u00fclt \u00f6sszes b\u00e9rleti szerz\u0151d\u00e9s";
    t[2308] = "Building tunnels";
    t[2309] = "Alagutak \u00e9p\u00edt\u00e9s alatt";
    t[2310] = "Send on";
    t[2311] = "K\u00fcld\u00e9s a k\u00f6vetkez\u0151n";
    t[2312] = "If your router has 10 or more active peers, everything is fine. The router should maintain connections to a few peers at all times. The best way to stay \"better-connected\" to the network is to <a href=/config>share more bandwidth</a>.";
    t[2313] = "Ha a routernek 10 vagy t\u00f6bb akt\u00edv t\u00e1rsa van, minden rendben van. A routernek \u00e1lland\u00f3an fennt kell tartania n\u00e9h\u00e1ny t\u00e1rs kapcsolat\u00e1t. A legjobb m\u00f3dja a \"jobb kapcsolattart\u00e1snak\" a h\u00e1l\u00f3zattal az, hogy <a href=/config>t\u00f6bb s\u00e1vsz\u00e9less\u00e9get oszt meg</a>.";
    t[2320] = "Not enough shared bandwidth to build transit tunnels.";
    t[2321] = "Nincs el\u00e9g megosztott s\u00e1vsz\u00e9less\u00e9g a tranzitalagutak \u00e9p\u00edt\u00e9s\u00e9hez.";
    t[2332] = "Congestion";
    t[2333] = "Torl\u00f3d\u00e1s";
