    t[2338] = "You must enter a key";
    t[2339] = "Kulcs megad\u00e1sa sz\u00fcks\u00e9ges";
    t[2342] = "SymmetricNAT";
    t[2343] = "Szimmetrikus NAT";
    t[2364] = "Some basic indications of router overload:";
    t[2365] = "N\u00e9h\u00e1ny alapvet\u0151 jel a router t\u00falterhel\u00e9s\u00e9re:";
    t[2370] = "Glossary";
    t[2371] = "Sz\u00f3jegyz\u00e9k";
    t[2376] = "To obtain your own hostname, I2P domain registrars such as <a href=http://stats.i2p/i2p/addkey.html target=_blank rel=noreferrer class=sitelink>stats.i2p</a> or <a href=http://reg.i2p/ target=_blank rel=noreferrer class=sitelink>reg.i2p</a> provide registration services that allow you to register and manage an .i2p hostname or sub-domain which will then be propagated across the network. Some registration sites will require the <i>B64 destination address</i> for the tunnel/service you wish to associate with a hostname, which you should copy from the <i>Local destination</i> section on the <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>.";
    t[2377] = "Saj\u00e1t hosztn\u00e9vhez jut\u00e1shoz az I2P dom\u00e9nregisztr\u00e1l\u00f3k, mint p\u00e9ld\u00e1ul a <a href=http://stats.i2p/i2p/addkey.html target=_blank rel=noreferrer class=sitelink>stats.i2p</a> vagy a <a href=http://reg.i2p/ target=_blank rel=noreferrer class=sitelink>reg.i2p</a>, regisztr\u00e1ci\u00f3s szolg\u00e1ltat\u00e1sokat ny\u00fajtanak, amelyek lehet\u0151v\u00e9 teszik, hogy regisztr\u00e1ljon \u00e9s kezeljen egy .i2p hosztnevet vagy alk\u00f6nyvt\u00e1rat, amelyet azt\u00e1n az eg\u00e9sz h\u00e1l\u00f3zaton terjesztenek. N\u00e9h\u00e1ny regisztr\u00e1ci\u00f3s oldalnak sz\u00fcks\u00e9ge lesz a hosztn\u00e9vhez kapcsolni k\u00edv\u00e1nt alag\u00fat / szolg\u00e1ltat\u00e1s <i>B64 c\u00e9l\u00e1llom\u00e1s c\u00edm\u00e9re</i>, amit a <i>Helyi c\u00e9l\u00e1llom\u00e1s</i> r\u00e9szb\u0151l m\u00e1solhat le a <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Alag\u00fatkezel\u0151 konfigur\u00e1ci\u00f3s oldalon</a>.";
