    t[2426] = "Do not publicly publish the reseed file or share these files with a friend of a friend!";
    t[2427] = "Ne publik\u00e1lja a \u00fajrasz\u00f3r\u00e1si f\u00e1jlt nyilv\u00e1nosan vagy ossza meg ezeket a f\u00e1jlokat egy bar\u00e1t bar\u00e1tj\u00e1val!";
