    t[2438] = "Select Stats";
    t[2439] = "Statisztika Kiv\u00e1laszt\u00e1sa";
    t[2440] = "i2pd";
    t[2441] = "i2pd";
    t[2448] = "Capacity";
    t[2449] = "Kapacit\u00e1s";
    t[2458] = "network database router map";
    t[2459] = "H\u00e1l\u00f3zati adatb\u00e1zis router t\u00e9rk\u00e9pe";
    t[2470] = "Manual Peer Controls";
    t[2471] = "T\u00e1rs K\u00e9zi Ir\u00e1ny\u00edt\u00e1s";
    t[2482] = "This indicates the amount of RAM I2P is using, and the total amount available, allocated by Java. If the usage is consistently high relative to the available RAM, this may indicate that you need to increase the ram allocated to the JVM. You can allocate more RAM by editing your <code>wrapper.config</code> file which is normally located in the I2P application directory. You will need to edit the <code>wrapper.java.maxmemory</code> parameter, which by default is set to 256(MB) for I2P, or 384 for I2P+. Note: if the memory bar is enabled, the memory entry in the router info section will be suppressed.";
    t[2483] = "Ez jelzi az I2p \u00e1ltal haszn\u00e1lt RAM mennyis\u00e9g\u00e9t \u00e9s a Java \u00e1ltal lek\u00fcld\u00f6tt teljes mennyis\u00e9get. Ha a haszn\u00e1lat \u00e1lland\u00f3an magas a rendelkez\u00e9sre \u00e1ll\u00f3 Ramhez k\u00e9pest, ez arra utalhat, hogy n\u00f6velnie kell a JVM sz\u00e1m\u00e1ra kiosztott RAM m\u00e9ret\u00e9t. T\u00f6bb RAM-ot rendelhet hozz\u00e1 a <code>wrapper.config</code> f\u00e1jl szerkeszt\u00e9s\u00e9vel, amely \u00e1ltal\u00e1ban az I2P alkalmaz\u00e1s k\u00f6nyvt\u00e1rban tal\u00e1lhat\u00f3. Szerkesztenie kell a <code>wrapper.java.maxmemory</code> param\u00e9tert, amelyet alap\u00e9rtelmez\u00e9s szerint 256 (MB)-ra \u00e1ll\u00edtanak be az I2P-hez, vagy 384-re az I2P+-hoz. Megjegyz\u00e9s: Ha az eml\u00e9kmegjelen\u00edt\u00e9s enged\u00e9lyezve van, az eml\u00e9kr\u00e9sz az \u00fatv\u00e1laszt\u00f3inform\u00e1ci\u00f3k r\u00e9szben el lesz nyomva.";
    t[2490] = "TaipeiTimes";
    t[2491] = "TaipeiTimes";
    t[2496] = "TCP Configuration";
    t[2497] = "TCP Be\u00e1ll\u00edt\u00e1sok";
