    t[2501] = "Bevezet\u00e9s az I2P-be";
    t[2502] = "Update available";
    t[2503] = "Friss\u00edt\u00e9s el\u00e9rhet\u0151";
    t[2504] = "Close to our destinations";
    t[2505] = "\u00dati c\u00e9ljainkhoz k\u00f6zel";
    t[2506] = "Restart required to activate family {0}.";
    t[2507] = "\u00dajraind\u00edt\u00e1s sz\u00fcks\u00e9ges a {0} csal\u00e1d aktiv\u00e1l\u00e1s\u00e1hoz.";
    t[2508] = "PERFORMANCE WARNING - Settings include very long tunnels.";
    t[2509] = "TELJES\u00cdTM\u00c9NY FIGYELMEZTET\u00c9S - A be\u00e1ll\u00edt\u00e1sok nagyon hossz\u00fa alagutakat eredm\u00e9nyeznek";
    t[2518] = "Network error";
    t[2519] = "H\u00e1l\u00f3zati hiba";
    t[2520] = "Advanced Configuration Help";
    t[2521] = "Speci\u00e1lis Konfigur\u00e1ci\u00f3s S\u00fag\u00f3";
    t[2530] = "In / Out";
    t[2531] = "Be/Ki";
    t[2536] = "Under <i>Configure Proxy Access to Internet</i> select the <i>Manual proxy configuration</i> option.";
    t[2537] = "<i>Konfigur\u00e1ld a proxy hozz\u00e1f\u00e9r\u00e9st az internethez</i> alatt v\u00e1laszd ki a <i>K\u00e9zi proxy konfigur\u00e1ci\u00f3</i> lehet\u0151s\u00e9get.";
    t[2538] = "To serve your own static content, you only need to edit or replace the files in the webserver's root directory, and the site will be available on the I2P network after you've followed the instructions below. Additionally, cgi and python scripts can be run from the <code>cgi-bin</code> directory immediately above <code>docroot</code> if you have <a href=https://www.perl.org/about.html target=_blank rel=noreferrer class='sitelink external'>perl</a> and <a href=https://www.python.org/ target=_blank rel=noreferrer class='sitelink external'>python</a> installed.";
    t[2539] = "Saj\u00e1t statikus tartalom szolg\u00e1ltat\u00e1s\u00e1hoz csak szerkeszteni vagy lecser\u00e9lni kell a f\u00e1jlokat a webszerver gy\u00f6k\u00e9rk\u00f6nyvt\u00e1r\u00e1ban, majd a webhely az \u00fatmutat\u00f3ban megadottak alapj\u00e1n meg lesz el\u00e9rhet\u0151 az I2P h\u00e1l\u00f3zaton. Azok az cgi \u00e9s python szkriptek, amelyekhez telep\u00edtve vannak a <a href=https://www.perl.org/about.html target=_blank rel=noreferrer class='sitelink external'>perl</a> \u00e9s <a href=https://www.python.org/ target=_blank rel=noreferrer class='sitelink external'>python</a> ford\u00edt\u00f3programok, a <code>cgi-bin</code> k\u00f6nyvt\u00e1rb\u00f3l ind\u00edthat\u00f3ak.";
    t[2542] = "transit";
    t[2543] = "Transit";
    t[2550] = "KBps In";
    t[2551] = "KB/mp Be";
    t[2556] = "We offered to introduce them";
    t[2557] = "Fejaj\u00e1nlottuk, hogy bemutatjuk \u0151ket";
    t[2562] = "Troubleshoot";
    t[2563] = "Hibaelh\u00e1r\u00edt\u00e1s";
    t[2566] = "How long we've been running for this session";
    t[2567] = "Mi\u00f3ta fut ez a munkaszakasz";
    t[2568] = "Jars";
    t[2569] = "\u00dcvegek";
    t[2572] = "Plugin will be installed on next restart.";
    t[2573] = "A kieg\u00e9sz\u00edt\u0151 a k\u00f6vetkez\u0151 \u00fajraind\u00edt\u00e1skor lesz telep\u00edt\u00e9sre.";
    t[2578] = "Many of the stats on the sidebar may be <a href='/configstats'>configured</a> to be <a href='/graphs'>graphed</a> for further analysis. You may also customize the sections that appear on the Sidebar and their positioning on the <a href='/configsidebar'>Sidebar Configuration page</a>.";
    t[2579] = "Az oldals\u00e1von tal\u00e1lhat\u00f3 statisztik\u00e1k t\u00f6bbs\u00e9g\u00e9t <a href='/configstats'>be lehet \u00e1ll\u00edtani</a> <a href='/graphs'>\u00e1br\u00e1zol\u00e1sra</a> a tov\u00e1bbi elemz\u00e9shez. Testre is szabhatja azokat a r\u00e9szeket, amelyek megjelennek az oldals\u00e1von, \u00e9s elhelyezked\u00e9s\u00fcket az <a href='/configsidebar'>Oldals\u00e1v konfigur\u00e1ci\u00f3s lapj\u00e1n</a>.";
    t[2582] = "This tunnel-specific setting allows you to enable or disable replies to pings sent to servers hosted by the router. To disable pings, you must add the line <code>i2p.streaming.answerPings=false</code> to the <i>Custom Options</i> section for the server's configuration in the Tunnel Manager.";
    t[2583] = "Ez a specifikus be\u00e1ll\u00edt\u00e1s lehet\u0151v\u00e9 teszi, hogy enged\u00e9lyezze vagy letiltsa a a routern\u00e9l hostolt szerverekre k\u00fcld\u00f6tt ping v\u00e1laszait. A pingek letilt\u00e1s\u00e1hoz hozz\u00e1 kell adnia a <code>i2p.streaming.answerPings=false</code> sorat a szerver konfigur\u00e1ci\u00f3ja <i>Egyedi be\u00e1ll\u00edt\u00e1sok</i> szakasz\u00e1hoz a Tunnel Managerben.";
    t[2592] = "Max";
    t[2593] = "Max";
    t[2598] = "If you wish to install unsigned (.zip) I2P updates, this should be added to your <code>router.config</code> file unless you have already configured <code>routerconsole.advanced=true</code>, in which case this option is already provisioned. Note: as of I2P+ 0.9.48+, installation of <a href=/configupdate#i2pupdates>unsigned updates</a> is enabled by default.";
    t[2599] = "Amennyiben telep\u00edteni k\u00edv\u00e1n honos\u00edtatlan (.zip) I2P friss\u00edt\u00e9seket, akkor hozz\u00e1 kell adni a <code>router.config</code> f\u00e1jlhoz, hacsak m\u00e1r nincs konfigur\u00e1lva <code>routerconsole.advanced=true</code>, mivel ebben az esetben ez a be\u00e1ll\u00edt\u00e1s m\u00e1r k\u00e9sz. Megjegyz\u00e9s: I2P+ 0.9.48+ verzi\u00f3t\u00f3l kezdve az <a href=/configupdate#i2pupdates>al\u00e1\u00edratlan friss\u00edt\u00e9sek</a> telep\u00edt\u00e9se az alap\u00e9rtelmez\u00e9s szerint enged\u00e9lyezett.";
    t[2600] = "Plugin {0} installed";
    t[2601] = "{0} kieg\u00e9sz\u00edt\u0151 telep\u00edtve";
    t[2604] = "I2P requires at least 12KBps to enable sharing. ";
    t[2605] = "A megoszt\u00e1s enged\u00e9lyez\u00e9s\u00e9hez az I2P-nek legal\u00e1bb 12 KB/mp-re van sz\u00fcks\u00e9ge.";
    t[2608] = "The current external IP address reported by UPnP is {0}";
    t[2609] = "Az UPnP \u00e1ltal visszajelzett jelenlegi k\u00fcls\u0151 IP C\u00edm a k\u00f6vetkez\u0151: {0}";
    t[2616] = "If you know and trust somebody that runs I2P, ask them to send you a reseed file generated using this page in their router console. Then, select the <i>Reseed from file</i> option on the {0} using the file you received.";
    t[2617] = "Ha ismer valakit, aki futtatja a I2P-t \u00e9s megb\u00edzik benne, k\u00e9rje meg hogy k\u00fcldj\u00f6n \u00f6nnek egy \u00fajraind\u00edt\u00e1si f\u00e1jlt, amit a I2P p\u00e1rnaf\u00e1jl gener\u00e1l\u00e1si oldalon az \u0151 \u00fatv\u00e1laszt\u00f3j\u00e1nak a konzolj\u00e1ban gener\u00e1ltak. Ezut\u00e1n a {0}-or v\u00e1lassza az \u00fajraind\u00edt\u00e1s a f\u00e1jlb\u00f3l lehet\u0151s\u00e9get \u00e9s haszn\u00e1lja a kapott f\u00e1jlt.";
    t[2620] = "To enable session-only changes to the client tunnels, activate the console's <a href=\"/help/advancedsettings\">Advanced mode</a>.";
    t[2621] = "A kliens alagutakhoz csak a munkamenet sor\u00e1n m\u00f3dos\u00edt\u00e1sokat tenni aktiv\u00e1lja a konzol <a href=\"/help/advancedsettings\">Speci\u00e1lis m\u00f3dj\u00e1t</a>.";
