    t[2670] = "Or to deny all unspecified destinations:";
    t[2671] = "Az \u00f6sszes meghat\u00e1rozatlan c\u00e9lhely megtagad\u00e1sa:";
    t[2672] = "Peers we've been talking to in the last minute / last hour";
    t[2673] = "Ut\u00f3bbi percek/\u00f3ra kapcsolatai";
    t[2676] = "Open console on startup";
    t[2677] = "Nyissa meg a konzolt ind\u00edt\u00e1skor";
    t[2680] = "Review possible sybils in network database";
    t[2681] = "Tekintse \u00e1t a lehets\u00e9ges sybileket a h\u00e1l\u00f3zati adatb\u00e1zisban";
    t[2682] = "WAN Ethernet Link Configuration";
    t[2683] = "WAN Ethernet";
    t[2696] = "This setting (in seconds) allows you to override the delay between runs of the Peer Exploration Job which attempts to locate new peers to add to the NetDb. The job will run every 80 seconds by default, or if the router is experiencing job or message lag, every 3 minutes. If the size of the NetDb reaches 4000 peers, the pause will increase to 15 minutes. You may wish to increase the delay if your NetDb is well-populated (over 2000 peers), or if you wish to reduce overall bandwidth usage. Note: For Floodfill routers, this job does not run.";
    t[2697] = "Ez a be\u00e1ll\u00edt\u00e1s (m\u00e1sodpercekben) lehet\u0151v\u00e9 teszi a Peer Exploration Job fut\u00e1sai k\u00f6z\u00f6tti k\u00e9sleltet\u00e9s fel\u00fcl\u00edr\u00e1s\u00e1t, amely megpr\u00f3b\u00e1lja megtal\u00e1lni az \u00faj megb\u00edzhat\u00f3 partnereket a NetDbhez val\u00f3 hozz\u00e1ad\u00e1shoz. A feladat alap\u00e9rtelmez\u00e9s szerint 80 m\u00e1sodpercenk\u00e9nt fut le, vagy ha a router munka- vagy \u00fczenetk\u00e9sleltet\u00e9ssel k\u00fczd, akkor 3 percenk\u00e9nt. Ha a NetDb m\u00e9rete el\u00e9ri a 4000 megb\u00edzhat\u00f3 partnert, akkor a feladat sz\u00fcnetel 15 percig. Ha a NetDb j\u00f3l megsz\u00e1llott (t\u00f6bb mint 2000 megb\u00edzhat\u00f3 partnerrel rendelkezik), vagy ha az \u00f6sszes s\u00e1vsz\u00e9less\u00e9g haszn\u00e1lat\u00e1t cs\u00f6kkenteni szeretn\u00e9, akkor n\u00f6velheti a k\u00e9sleltet\u00e9st. Megjegyz\u00e9s: A Floodfill routerekre ez a feladat nem fut.";
    t[2698] = "Current";
    t[2699] = "Jelenlegi";
    t[2720] = "A website hosted on the I2P network. By default, a <a href=https://www.eclipse.org/jetty/about.html class='sitelink external' target=_blank rel=noreferrer>Jetty webserver</a> is configured and running on <a href=http://127.0.0.1:7658/ target=_blank rel=noreferrer>http://127.0.0.1:7658/</a>.";
    t[2721] = "Egy weboldal, amit az I2P h\u00e1l\u00f3zaton hostolnak. Alap\u00e9rtelmezetten egy <a href=https://www.eclipse.org/jetty/about.html class='sitelink external' target=_blank rel=noreferrer>Jetty webszerver</a> van konfigur\u00e1lva \u00e9s fut a k\u00f6vetkez\u0151 c\u00edmen: <a href=http://127.0.0.1:7658/ target=_blank rel=noreferrer>http://127.0.0.1:7658/</a>.";
    t[2722] = "Can be disabled or changed in the <a href=/i2ptunnelmgr>Tunnel Manager</a>. Can also be configured to bind to a specific interface or all interfaces.";
    t[2723] = "Letilmezhet vagy m\u00f3dos\u00edthat\u00f3 az <a href=/i2ptunnelmgr>Tunnelmenadzserben</a>. Be\u00e1ll\u00edthat\u00f3 tov\u00e1bb\u00e1 egy adott interf\u00e9szre vagy az \u00f6sszes interf\u00e9szre.";
    t[2728] = "I2P+ Service now enabled on system start";
    t[2729] = "Az I2P+ szolg\u00e1ltat\u00e1s most enged\u00e9lyezve van a rendszer ind\u00edt\u00e1s\u00e1n\u00e1l";
    t[2748] = "Computer related news aggregation";
    t[2749] = "Sz\u00e1m\u00edt\u00f3g\u00e9ppel kapcsolatos h\u00edrek \u00f6sszes\u00edt\u00e9se";
    t[2752] = "Same IP as us";
    t[2753] = "Ugyanaz az IP, mint n\u00e1lunk";
    t[2754] = "You may create a new router family here. Once you have created the family, you may export the family key file and share with other routers in your nominated family.";
    t[2755] = "Itt l\u00e9trehozhat egy \u00faj \u00fatv\u00e1laszt\u00f3 csal\u00e1dot. Miut\u00e1n l\u00e9trehozta a csal\u00e1dot, export\u00e1lhatja a csal\u00e1di kulcsf\u00e1jlt, \u00e9s megoszthatja a kijel\u00f6lt csal\u00e1d t\u00f6bbi \u00fatv\u00e1laszt\u00f3j\u00e1val.";
    t[2756] = "Tunnels peer has agreed to participate in";
    t[2757] = "Az alagutak partnere beleegyezett a r\u00e9szv\u00e9telbe";
    t[2758] = "Advanced Lookup";
    t[2759] = "Speci\u00e1lis keres\u00e9s";
    t[2766] = "In order to access websites hosted on I2P, and optionally use the default outproxy to connect to websites on clearnet, you will need to configure your browser to use the I2P HTTP proxy, by default running on <code>127.0.0.1 port 4444</code>. Most browsers offer an option to configure your proxy; in this mini-tutorial we'll focus on Firefox.";
    t[2767] = "Az I2P-n hostolt webhelyek el\u00e9r\u00e9s\u00e9hez \u00e9s opcion\u00e1lisan a default outproxy haszn\u00e1lat\u00e1hoz az I2P HTTP proxy haszn\u00e1lat\u00e1ra kell konfigur\u00e1lnod a b\u00f6ng\u00e9sz\u0151det, amely alap\u00e9rtelmez\u00e9s szerint a <code>127.0.0.1 port 4444</code>-en fut. A legt\u00f6bb b\u00f6ng\u00e9sz\u0151 lehet\u0151s\u00e9get k\u00edn\u00e1l a proxy be\u00e1ll\u00edt\u00e1s\u00e1ra; ebben az \u00fatmutat\u00f3ban a Firefoxra fogunk \u00f6sszpontos\u00edtani.";
    t[2776] = "Close to us";
    t[2777] = "K\u00f6zel hozz\u00e1nk";
    t[2790] = "I2P+ Router Sitemap";
    t[2791] = "I2P router oldalt\u00e9rk\u00e9p";
    t[2794] = "Downloaded plugin version {0} is not newer than installed plugin";
    t[2795] = "A let\u00f6lt\u00f6tt kieg\u00e9sz\u00edt\u0151 verzi\u00f3 {0} nem \u00fajabb, mint a telep\u00edtett kieg\u00e9sz\u00edt\u0151";
    t[2796] = "Streaming radio service";
    t[2797] = "Streaming r\u00e1di\u00f3szolg\u00e1ltat\u00e1s";
    t[2798] = "I2P+ functions best when you can accurately reflect the speed of your network connection in the <a href=/config>bandwidth configuration section</a>. By default I2P+ is configured with some fairly conservative values that will not suit many use cases, so please take time to review these settings and correct where necessary. The more bandwidth you allocate, <i>specifically</i> upstream bandwidth, the more you will benefit from the network.";
    t[2799] = "Az I2P+ akkor m\u0171k\u00f6dik a legjobban, ha a h\u00e1l\u00f3zati kapcsolat sebess\u00e9g\u00e9t helyesen t\u00fckr\u00f6zi a <a href=/config>s\u00e1vsz\u00e9less\u00e9g-ar\u00e1nyos\u00edt\u00e1si szakasz</a>ban. Az alap\u00e9rtelmez\u00e9s szerint az I2P+ n\u00e9h\u00e1ny meglehet\u0151sen konzervat\u00edv \u00e9rt\u00e9kkel van konfigur\u00e1lva, ami nem felel meg sok felhaszn\u00e1l\u00e1si esetnek, ez\u00e9rt k\u00e9rem, hogy id\u0151t sz\u00e1njon ezeknek a be\u00e1ll\u00edt\u00e1soknak az \u00e1ttekint\u00e9s\u00e9re \u00e9s sz\u00fcks\u00e9g szerint jav\u00edtsa ki \u0151ket. Min\u00e9l t\u00f6bb s\u00e1vsz\u00e9less\u00e9get k\u00fcl\u00f6n\u00edt el, <i>k\u00fcl\u00f6n\u00f6sen</i> a fel\u00e1raml\u00e1si s\u00e1vsz\u00e9less\u00e9get, ann\u00e1l t\u00f6bbet fog nyerni a h\u00e1l\u00f3zatt\u00f3l.";
    t[2810] = "Transit by Peer";
    t[2811] = "Tranzit egyik k\u00f6zvet\u00edt\u0151n kereszt\u00fcl";
    t[2812] = "Hidden Mode";
    t[2813] = "Rejtett m\u00f3d";
    t[2814] = "Plugin requires Jetty version {0} or lower";
    t[2815] = "A kieg\u00e9sz\u00edt\u0151h\u00f6z a Jetty {0} vagy alacsonyabb verzi\u00f3ja sz\u00fcks\u00e9ges";
    t[2822] = "The proxy may be remotely hosted or a service running on your computer (localhost/127.0.0.1).";
    t[2823] = "A proxy t\u00e1voli helyen is lehet, vagy egy szolg\u00e1ltat\u00e1s, ami a sz\u00e1m\u00edt\u00f3g\u00e9p\u00e9n fut (localhost/127.0.0.1).";
    t[2824] = "Events in peak period";
    t[2825] = "Esem\u00e9nyek cs\u00facsid\u0151ben";
    t[2838] = "Router Console &amp; WebApps Display Language";
    t[2839] = "Az \u00fatv\u00e1laszt\u00f3 konzol \u00e9s a WebApps megjelen\u00edt\u00e9si nyelve";
    t[2844] = "What to do in the event I2P+ isn't working";
    t[2845] = "Mit tegyek, ha az I2P+ nem m\u0171k\u00f6dik";
    t[2856] = "ANONYMITY WARNING - Settings include 1-hop tunnels.";
    t[2857] = "ANONIMIT\u00c1SI FIGYELMEZTET\u00c9S - a be\u00e1ll\u00edt\u00e1sok 1-ugr\u00e1s\u00fa alagutat tartalmaznak.";
    t[2858] = "I2P IRC Network";
    t[2859] = "I2P IRC h\u00e1l\u00f3zat";
    t[2864] = "pixels wide";
    t[2865] = "pixel sz\u00e9les";
    t[2882] = "The I2P Network Protocol (I2NP) manages the routing and mixing of messages between routers, in addition to the transport selection (where more than one is supported) when communicating with a peer. For more information, see the <a href=https://geti2p.net/en/docs/protocol/i2np class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[2883] = "Az I2P-h\u00e1l\u00f3zati protokoll (I2NP) kezeli az \u00fczenetek \u00fatv\u00e1laszt\u00e1s\u00e1t \u00e9s \u00f6sszekever\u00e9s\u00e9t az \u00fatv\u00e1laszt\u00f3k k\u00f6z\u00f6tt, valamint a sz\u00e1ll\u00edt\u00e1si kiv\u00e1laszt\u00e1st (amikor t\u00f6bb mint egy t\u00e1mogatott) a t\u00f6bbi r\u00e9sz\u00e9vel val\u00f3 kommunik\u00e1ci\u00f3 sor\u00e1n. Tov\u00e1bbi inform\u00e1ci\u00f3\u00e9rt l\u00e1sd a(z) <a href=https://geti2p.net/en/docs/protocol/i2np class='sitelink external' target=_blank rel=noreferrer>online dokument\u00e1ci\u00f3t</a>.";
    t[2884] = "Expired {0} ago";
    t[2885] = "Lej\u00e1rt {0} ezel\u0151tt";
    t[2892] = "Your router's status on accepting or rejecting requests from other routers to build a participating tunnel through your router. Your router may accept all requests, accept or reject a percentage of requests, or reject all requests for a number of reasons, to control the bandwidth and CPU demands and maintain capacity for local clients. <b>Note";
    t[2893] = "Az \u00fatv\u00e1laszt\u00f3 \u00e1llapota a t\u00f6bbi \u00fatv\u00e1laszt\u00f3val val\u00f3 k\u00f6z\u00f6s alag\u00fat l\u00e9trehoz\u00e1s\u00e1ra ir\u00e1nyul\u00f3 k\u00e9relmek elfogad\u00e1s\u00e1r\u00f3l vagy elutas\u00edt\u00e1s\u00e1r\u00f3l. Az \u00fatv\u00e1laszt\u00f3ja elfogadhat minden k\u00e9relmet, elfogadhat vagy elutas\u00edthat egy k\u00e9relem sz\u00e1zal\u00e9k\u00e1t, vagy elutas\u00edthat minden k\u00e9relmet k\u00fcl\u00f6nb\u00f6z\u0151 okokb\u00f3l, hogy ir\u00e1ny\u00edtsa a s\u00e1vsz\u00e9less\u00e9get \u00e9s a CPU ig\u00e9nyeket, \u00e9s fenntartsa a helyi kliensek kapacit\u00e1s\u00e1t. <b>Megjegyz\u00e9s";
    t[2902] = "Please contact a known trustworthy friend who has a running I2P router, and ask them for help with reseeding your I2P router. Request that they send you a reseed file exported from their running I2P router. It is vital that the file is exchanged over a secure channel, e.g. encrypted to avoid external tampering (PGP Sign, Encrypt and Verified with a trusted public key). The file itself is unsigned, so please accept files only from known trusted friends. Never import a reseed file if you cannot verify its source.";
    t[2903] = "K\u00e9rj\u00fck, l\u00e9pjen kapcsolatba egy ismert megb\u00edzhat\u00f3 bar\u00e1ttal, aki \u00fczemben l\u00e9v\u0151 I2P \u00fatv\u00e1laszt\u00f3val rendelkezik, \u00e9s k\u00e9rje seg\u00edts\u00e9g\u00e9t az I2P \u00fatv\u00e1laszt\u00f3ja \u00fajb\u00f3li bet\u00f6lt\u00e9s\u00e9hez. K\u00e9rje t\u0151l\u00fck, hogy k\u00fcldjenek \u00d6nnek egy olyan reseed f\u00e1jlt, amelyet \u00fczemben l\u00e9v\u0151 I2P \u00fatv\u00e1laszt\u00f3jukb\u00f3l export\u00e1ltak. Fontos, hogy a f\u00e1jl egy biztons\u00e1gos csatorn\u00e1n kereszt\u00fcl cser\u00e9l\u0151dj\u00f6n ki, p\u00e9ld\u00e1ul titkos\u00edtva legyen, hogy megakad\u00e1lyozz\u00e1k a k\u00fcls\u0151 manipul\u00e1ci\u00f3t (PGP al\u00e1\u00edr\u00e1s, titkos\u00edt\u00e1s \u00e9s megb\u00edzhat\u00f3 nyilv\u00e1nos kulccsal t\u00f6rt\u00e9n\u0151 meger\u0151s\u00edt\u00e9s). A f\u00e1jl maga nem hiteles\u00edtett, ez\u00e9rt kiz\u00e1r\u00f3lag ismert megb\u00edzhat\u00f3 bar\u00e1tokt\u00f3l fogadjon el f\u00e1jlokat. Sose import\u00e1ljon egy reseed f\u00e1jlt, ha nem tudja ellen\u0151rizni annak forr\u00e1s\u00e1t.";
    t[2916] = "Last Good Send";
    t[2917] = "Legutols\u00f3 Helyes K\u00fcld\u00e9s";
    t[2918] = "Delete this value to disable";
    t[2919] = "A letilt\u00e1shoz t\u00f6r\u00f6lje ezt az \u00e9rt\u00e9ket";
    t[2920] = "You can use a recorder in one tunnel that writes to a file that another tunnel, or multiple tunnels, can use for throttling. These files can also be edited by hand.";
    t[2921] = "Egy r\u00f6gz\u00edt\u0151t haszn\u00e1lhat egyik alag\u00fatban, amely \u00edr egy f\u00e1jlba, amelyet egy m\u00e1sik alag\u00fat, vagy t\u00f6bb alag\u00fat is haszn\u00e1lhat a throttlingra. Ezek a f\u00e1jlok k\u00e9zzel is szerkeszthet\u0151k.";
    t[2924] = "Router running a non-native, software emulated version of the Java BigInteger library";
    t[2925] = "A router egy nem nat\u00edv, szoftver emul\u00e1lt Java BigInteger k\u00f6nyvt\u00e1rat futtat";
    t[2928] = "Country";
    t[2929] = "Orsz\u00e1g";
    t[2934] = "Peer's clockskew relative to our clock";
    t[2935] = "Peer \u00f3raferde a mi \u00f3r\u00e1nkhoz k\u00e9pest";
    t[2936] = "A threshold that if breached will cause the offending remote destination to be recorded in a specified file";
    t[2937] = "Egy k\u00fcsz\u00f6b\u00e9rt\u00e9k, amely ha megs\u00e9rt\u00e9sre ker\u00fcl, ez okozza a v\u00e9tkez\u0151 t\u00e1voli c\u00e9l\u00e1llom\u00e1s r\u00f6gz\u00edt\u00e9s\u00e9t egy meghat\u00e1rozott f\u00e1jlban";
    t[2938] = "This is usually due to a port 7654 conflict. Check the logs to verify.";
    t[2939] = "Ez rendszerint a 7654-es port \u00fctkz\u00f6z\u00e9s miatt van. Ellen\u0151rizd le a napl\u00f3ban.";
    t[2940] = "Disabling inbound TCP";
    t[2941] = "Bej\u00f6v\u0151 TCP letilt\u00e1sa";
    t[2944] = "Keyring";
    t[2945] = "Kulcst\u00e1r";
    t[2946] = "Verified family (signing certificate is installed and valid)";
    t[2947] = "Ellen\u0151rz\u00f6tt csal\u00e1d (al\u00e1\u00edr\u00f3 tan\u00fas\u00edtv\u00e1ny telep\u00edtve \u00e9s \u00e9rv\u00e9nyes)";
    t[2954] = "Router info not available";
    t[2955] = "A router inform\u00e1ci\u00f3i nem \u00e1llnak rendelkez\u00e9sre";
    t[2956] = "The Java web applications listed below are started by the webConsole client and run in the same JVM as the router. They are usually web applications accessible through the router console. They may be complete applications (e.g. i2psnark), front-ends to another client or application which must be separately enabled (e.g. susidns, i2ptunnel), or have no web interface at all (e.g. addressbook).";
    t[2957] = "Az al\u00e1bb felsorolt Java webalkalmaz\u00e1sokat a webConsole kliens ind\u00edtja el, \u00e9s ugyanabban a JVM-ben futnak, mint az \u00fatv\u00e1laszt\u00f3. \u00c1ltal\u00e1ban az \u00fatv\u00e1laszt\u00f3konzolon kereszt\u00fcl el\u00e9rhet\u0151 webalkalmaz\u00e1sok. Lehetnek komplett alkalmaz\u00e1sok (pl. i2psnark), egy m\u00e1sik kliens vagy alkalmaz\u00e1s el\u0151fel\u00fcletei, amelyeket k\u00fcl\u00f6n kell enged\u00e9lyezni (pl. susidns, i2ptunnel), vagy egy\u00e1ltal\u00e1n nem rendelkeznek webes fel\u00fclettel (pl. c\u00edmjegyz\u00e9k).";
    t[2960] = "WARNING - Inbound 0-hop tunnels not recommended for hidden routers.";
    t[2961] = "FIGYELMEZTET\u00c9S - A bej\u00f6v\u0151 0-hop alagutak nem aj\u00e1nlottak rejtett \u00fatv\u00e1laszt\u00f3khoz.";
    t[2972] = "HTTP Proxy";
    t[2973] = "HTTP Proxy";
    t[2978] = "This is the total number of peers that are known by your router. They are listed on the <a href='/netdb'>Network Database page</a>. This may range from under 100 to 1000 or more. This number is not the total size of the network; it may vary widely depending on your total bandwidth, shared bandwidth, and locally-generated traffic. I2P does not require a router to know every other router in the network.";
    t[2979] = "Ez az ismert csom\u00f3pontok sz\u00e1ma a routeredben. <a href='/netdb'>A H\u00e1l\u00f3zati adatb\u00e1zis oldalon</a> vannak felsorolva. Ez a sz\u00e1m tartom\u00e1nyban mozoghat 100 alatt \u00e9s 1000 f\u00f6l\u00f6tt is. Ez a sz\u00e1m nem a h\u00e1l\u00f3zat teljes m\u00e9rete; sz\u00e9les tartom\u00e1nyban v\u00e1ltozhat, att\u00f3l f\u00fcgg\u0151en, hogy a teljes s\u00e1vsz\u00e9less\u00e9ged, a megosztott s\u00e1vsz\u00e9less\u00e9ged \u00e9s a helyileg gener\u00e1lt forgalom. Az I2P nem k\u00f6veteli meg, hogy a routereknek ismerni\u00fck kelljen minden m\u00e1s rutert a h\u00e1l\u00f3zaton.";
