    t[3062] = "You can override the <a href=http://127.0.0.1:7658/help/images/>default appearance</a> of the directory listing by supplying an edited <a href=http://127.0.0.1:7658/.resources/jetty-dir.css>jetty-dir.css</a> file to set a global appearance. Note that this file will not be displayed in the webserver's directory listing. Files and directories prefixed with . and files named favicon.ico or files ending with ~ or .bak or .old will also be hidden from view (though still accessible). Note: To create hidden files with a . prefix on Windows, add a trailing . to the file or directory e.g. <code>.hidden.</code>; Windows explorer will then save the file with the correct name, removing the trailing dot in the process.";
    t[3063] = "A k\u00f6nyv mapp\u00e1k alap\u00e9rtelmezett kin\u00e9zet\u00e9t fel\u00fcl lehet b\u00edr\u00e1lni az\u00e1ltal, hogy egy szerkesztett jetty-dir.css f\u00e1jlt adunk meg a glob\u00e1lis kin\u00e9zethez. Megjegyz\u00e9s: Ez a f\u00e1jl nem jelenik meg a webszerver mappalista oldal\u00e1n. Pontban kezd\u0151d\u0151 f\u00e1jlok \u00e9s k\u00f6nyvt\u00e1rak, a favicon.ico nev\u0171 f\u00e1jlok \u00e9s a ~ v\u00e9gz\u0151d\u00e9s\u0171, vagy .bak, vagy .old f\u00e1jlok szint\u00e9n rejtve lesznek a n\u00e9zet el\u0151l (de m\u00e9g el\u00e9rhet\u0151ek). Megjegyz\u00e9s: Rejtett f\u00e1jlokat, amelyek a . el\u0151tagot viselik, a Windows rendszeren egy pontot adhatsz hozz\u00e1 a f\u00e1jl vagy a k\u00f6nyvt\u00e1r m\u00f6g\u00e9, pl. <code>.rejtett.</code>; A Windows f\u00e1jlszeml\u00e9l\u0151je ekkor a megfelel\u0151 n\u00e9vvel menti el a f\u00e1jlt, \u00e9s elt\u00e1vol\u00edtja a v\u00e9gz\u0151d\u0151 pontot a folyamat sor\u00e1n.";
