    t[3160] = "This is a shortened version of the official FAQ. For the full version, please visit <a href=https://geti2p.net/faq target=_blank rel=noreferrer class='sitelink external'>https://geti2p.net/faq</a> or <a href=http://i2p-projekt.i2p/faq target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p/faq</a>.";
    t[3161] = "Ez egy r\u00f6vid\u00edtett v\u00e1ltozata az hivatalos GYIK-nak. A teljes v\u00e1ltozat\u00e9rt k\u00e9rj\u00fck, l\u00e1togasson el a <a href=https://geti2p.net/faq target=_blank rel=noreferrer class='sitelink external'>https://geti2p.net/faq</a> vagy az <a href=http://i2p-projekt.i2p/faq target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p/faq</a> oldalra.";
    t[3166] = "Total number of tunnels in use";
    t[3167] = "A haszn\u00e1lt alagutak teljes sz\u00e1ma";
    t[3188] = "When set to true, additional functionality will be enabled in the console and the user will be able to edit settings directly on the <a href=/configadvanced>Advanced Configuration page</a>. Extra display options are provided in the <a href=/netdb>Network Database section</a>, including the <a href='/netdb?f=3'>Sybil Analysis tool</a>, and there are additional configuration options on the <a href=/configclients>Clients Configuration page</a>. This will also enable the installation of unsigned updates, manual configuration of the news URL, and additional sections on the sidebar.";
    t[3189] = "Ha igazra van \u00e1ll\u00edtva, tov\u00e1bbi funkci\u00f3k lesznek enged\u00e9lyezve a konzolon, \u00e9s a felhaszn\u00e1l\u00f3 szerkesztheti a be\u00e1ll\u00edt\u00e1sokat k\u00f6zvetlen\u00fcl az <a href=/configadvanced>Halad\u00f3 konfigur\u00e1ci\u00f3s oldalon</a>. Extra megjelen\u00edt\u00e9si lehet\u0151s\u00e9gek tal\u00e1lhat\u00f3ak a <a href=/netdb>H\u00e1l\u00f3zati adatb\u00e1zis szakaszban</a>, bele\u00e9rtve a <a href='/netdb?f=3'>Sybil elemz\u0151 eszk\u00f6zt</a>, \u00e9s tov\u00e1bbi konfigur\u00e1ci\u00f3s lehet\u0151s\u00e9gek vannak a <a href=/configclients>Clients konfigur\u00e1ci\u00f3s oldalon</a>. Ez lehet\u0151v\u00e9 teszi a nem al\u00e1\u00edrt friss\u00edt\u00e9sek telep\u00edt\u00e9s\u00e9t, a h\u00edrek URL c\u00edm\u00e9nek manu\u00e1lis konfigur\u00e1l\u00e1s\u00e1t \u00e9s tov\u00e1bbi szakaszokat az oldals\u00e1von.";
    t[3192] = "Most Recent";
