    t[3197] = "Minden alag\u00fatk\u00e9relem elutas\u00edt\u00e1sa";
    t[3198] = "Never disclose this to anyone, as it can reveal your real world IP.";
    t[3199] = "Soha ne fedje fel ezt senkinek, mivel ez felfedheti val\u00f3s szellemi tulajdon\u00e1t.";
    t[3200] = "Leave blank for DH, will be generated automatically";
