    t[3202] = "The following filter definition applies some throttling by default, no throttling for destinations in the file <i class=example>friends.txt</i>, forbids any connections from destinations in the file <i class=example>enemies.txt</i>, and logs any aggressive behavior in a file called <i class=example>suspicious.txt</i>:";
    t[3203] = "Az al\u00e1bbi sz\u0171r\u0151 meghat\u00e1roz\u00e1s alap\u00e9rtelmezetten alkalmaz n\u00e9mi throttlingot, nincs throttling a <i class=example>friends.txt</i> f\u00e1jlban l\u00e9v\u0151 c\u00e9lokra, megakad\u00e1lyozza a kapcsolat l\u00e9trej\u00f6tt\u00e9t a <i class=example>enemies.txt</i> f\u00e1jlban l\u00e9v\u0151 c\u00e9lokr\u00f3l \u00e9s regisztr\u00e1l minden agressz\u00edv viselked\u00e9st egy <i class=example>suspicious.txt</i> nev\u0171 f\u00e1jlba:";
