    t[3302] = "This is an experimental network database tool for debugging and analysis. Do not panic even if you see warnings indicated. Possible \"threats\" are summarized, however these are unlikely to be real threats. If you see anything you would like to discuss with the devs, contact us on IRC #i2p-dev.";
    t[3303] = "Ez egy k\u00eds\u00e9rleti h\u00e1l\u00f3zati adatb\u00e1zis-eszk\u00f6z hibakeres\u00e9shez \u00e9s elemz\u00e9shez. Ne essen p\u00e1nikba m\u00e9g akkor sem, ha figyelmeztet\u00e9seket l\u00e1t. A lehets\u00e9ges \"fenyeget\u00e9sek\" \u00f6sszefoglal\u00e1sra ker\u00fclt, de nem val\u00f3sz\u00edn\u0171, hogy val\u00f3di fenyeget\u00e9sek. Ha l\u00e1t valamit, amit meg szeretne besz\u00e9lni a fejleszt\u0151kkel, l\u00e9pjen kapcsolatba vel\u00fcnk az IRC #i2p-dev oldal\u00e1n.";
