    t[3319] = "ha nem vagyunk t\u0171zfalazva";
    t[3322] = "A <a href=https://en.wikipedia.org/wiki/Base32 class='sitelink external' target=_blank rel=noreferrer>Base32</a> link (which always ends with .b32.i2p) is a hash of a <a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external' target=_blank rel=noreferrer>Base64</a> destination. For services on the network, the Base64 hash is often mapped to an .i2p domain in the addressbook.";
    t[3323] = "A <a href=https://en.wikipedia.org/wiki/Base32 class='sitelink external' target=_blank rel=noreferrer>Base32</a> link (amely mindig .b32.i2p v\u00e9gz\u0151dik) az egy <a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external' target=_blank rel=noreferrer>Base64</a> c\u00e9l\u00e1llom\u00e1s hashe. A h\u00e1l\u00f3zaton el\u00e9rhet\u0151 szolg\u00e1ltat\u00e1sok eset\u00e9ben a Base64 hash gyakran egy .i2p tartom\u00e1nyhoz van hozz\u00e1rendelve a c\u00edmjegyz\u00e9kben.";
    t[3326] = "Please enable sharing (participating in tunnels) by configuring more bandwidth. ";
