    t[3396] = "A fork of the <a href=http://www.klomp.org/snark/ class='sitelink external' target=_blank rel=noreferrer>Snark BitTorrent client</a> refactored for use on the I2P network. Usually supplied as part of the default suite of applications with Java I2P, and also available as a <a href=http://skank.i2p/#download class=sitelink target=_blank rel=noreferrer>standalone Java application</a>.";
    t[3397] = "Az I2P h\u00e1l\u00f3zaton t\u00f6rt\u00e9n\u0151 haszn\u00e1latra \u00e1talak\u00edtott <a href=http://www.klomp.org/snark/ class='sitelink external' target=_blank rel=noreferrer>Snark BitTorrent kliens</a> forkja. \u00c1ltal\u00e1ban a Java I2P alap\u00e9rtelmezett alkalmaz\u00e1scsomagj\u00e1nak r\u00e9szek\u00e9nt sz\u00e1ll\u00edtj\u00e1k, valamint el\u00e9rhet\u0151 egy <a href=http://skank.i2p/#download class=sitelink target=_blank rel=noreferrer>\u00f6n\u00e1ll\u00f3 Java alkalmaz\u00e1sk\u00e9nt</a>.";
