    t[3416] = "If you are running the Tor Browser, you may use its Tor instance by configuring I2P to use: <i>Proxy type:</i> <code>SOCKS 5</code> <i>Host:</i> <code>127.0.0.1</code> <i>Port:</i> <code>9150</code>.";
    t[3417] = "Ha a Tor b\u00f6ng\u00e9sz\u0151t haszn\u00e1lja, haszn\u00e1lhatja a Tartalmi el\u00e9rhet\u0151s\u00e9gi h\u00e1l\u00f3zatot a I2P konfigur\u00e1l\u00e1s\u00e1val: <i>Proxy t\u00edpusa:</i> <code>SOCKS 5</code> <i>Szerver neve:</i> <code>127.0.0.1</code> <i>Port:</i> <code>9150</code>.";
    t[3428] = "Use IPv6 only (disable IPv4)";
