    t[3482] = "This setting determines whether stats about our router are sporadically published to the NetDb. [Default is false]";
    t[3483] = "Ez a be\u00e1ll\u00edt\u00e1s meghat\u00e1rozza, hogy a mi \u00datv\u00e1laszt\u00f3nk adatai k\u00f6zvetett m\u00f3don megjelennek-e a NetDb-ben. [Az alap\u00e9rt\u00e9k hamis]";
    t[3486] = "This is the number of peers your router has available for building client tunnels. It is generally in the range 8-30. Your fast peers are shown on the <a href='/profiles'>Profiles page</a>. <a href='/configstats#router.fastPeers'>[Enable graphing]</a>";
    t[3487] = "Ez a csom\u00f3pontok sz\u00e1ma, amelyek rendelkez\u00e9sre \u00e1llnak az \u00fcgyfl\u00e9s alag\u00fat \u00e9p\u00edt\u00e9s\u00e9hez. \u00c1ltal\u00e1ban 8 \u00e9s 30 k\u00f6z\u00f6tt van. A gyors csom\u00f3pontok megjelennek a <a href='/profiles'>Profilok oldal</a>. <a href='/configstats#router.fastPeers'>[Grafikonok enged\u00e9lyez\u00e9se]</a>";
    t[3488] = "Click the <i>Reseed from File</i> button";
    t[3489] = "Kattintson az <i>\u00dajrabet\u00f6lt\u00e9s a f\u00e1jlb\u00f3l</i> gombra";
    t[3490] = "A variant of onion routing that encrypts multiple messages together to make it more difficult for attackers to perform traffic analysis and to increase the speed of data transfer. For more information, see the <a href=https://geti2p.net/en/docs/how/garlic-routing class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[3491] = "Az egy hagym\u00e1s menetrend vari\u00e1ci\u00f3, amely t\u00f6bb \u00fczenetet titkos\u00edt egy\u00fctt, hogy az adatforgalmat elemz\u0151 t\u00e1mad\u00f3k sz\u00e1m\u00e1ra nehezebb legyen, \u00e9s n\u00f6veli az adat\u00e1tvitel sebess\u00e9g\u00e9t. Tov\u00e1bbi inform\u00e1ci\u00f3\u00e9rt l\u00e1sd a(z) <a href=https://geti2p.net/en/docs/how/garlic-routing class='sitelink external' target=_blank rel=noreferrer>online dokument\u00e1ci\u00f3t</a>.";
    t[3494] = "How to Harden Your WordPress Site";
    t[3495] = "Hogyan er\u0151s\u00edtsd meg WordPress-webhelyedet";
    t[3496] = "I2P Internals";
    t[3497] = "I2P Bels\u0151";
    t[3500] = "By default, I2P is supplied with a webserver to host your own anonymized website (traditionally referred to as an <i>eepsite</i>). Both the site and the I2P Router Console are running on a streamlined version of <a href='https://en.wikipedia.org/wiki/Jetty_(web_server)' target=_blank rel=noreferrer class='sitelink external'>Jetty</a>, customized for I2P.";
    t[3501] = "Alap\u00e9rtelmezettk\u00e9nt az I2P rendelkezik egy webszerverrel, amellyel saj\u00e1t n\u00e9vtelens\u00e9get biztos\u00edt\u00f3 webhelyet (hagyom\u00e1nyosan eepsite-nak nevezik) lehet l\u00e9trehozni. Mind a webhely, mind a I2P router konzol egy testre szabott verzi\u00f3j\u00e1t futtatja a <a href='https://en.wikipedia.org/wiki/Jetty_(web_server)' target=_blank rel=noreferrer class='sitelink external'>Jetty</a> webkiszolg\u00e1l\u00f3 szoftvernek.";
    t[3504] = "This setting allows you to exclude older routers from your NetDb. Routers older than the default or the value you set will be deleted from the NetDb and banned for the duration of the router session. By default, routers older than 0.9.20 are excluded. Note: starting with I2P+ version 0.9.46+, only routers running very recent versions are used for building local tunnels. [Restart required]";
    t[3505] = "Ez a be\u00e1ll\u00edt\u00e1s lehet\u0151v\u00e9 teszi a R\u00e9gi \u00fatv\u00e1laszt\u00f3k kiz\u00e1r\u00e1s\u00e1t a NetDb-d\u0151l. A k\u00f6zvet\u00edt\u0151kn\u00e9l r\u00e9gebbiek az alap\u00e9rt\u00e9kn\u00e9l vagy az \u00e1ltalad be\u00e1ll\u00edtott \u00e9rt\u00e9kn\u00e9l, a NetDb-b\u0151l t\u00f6rl\u0151dnek \u00e9s az \u00fatv\u00e1laszt\u00f3 m\u0171k\u00f6d\u00e9se sor\u00e1n kitilt\u00e1sra ker\u00fclnek. Alap\u00e9rtelmez\u00e9s szerint a 0.9.20-n\u00e1l r\u00e9gebbi \u00fatv\u00e1laszt\u00f3k vannak kiz\u00e1rva. Megjegyz\u00e9s: Az I2P+ 0.9.46+ verzi\u00f3t\u00f3l kezdve csak az \u00faj verzi\u00f3kat futtat\u00f3 k\u00f6zvet\u00edt\u0151k haszn\u00e1latosak helyi alagutak l\u00e9trehoz\u00e1s\u00e1hoz. [\u00dajraind\u00edt\u00e1s sz\u00fcks\u00e9ges]";
