    t[3546] = "This setting, in milliseconds, overrides the default message processing time limit (indicated as <i>Message Delay</i> in the Congestion sidebar section) before the router is determined to be congested and transit tunnel requests are rejected. [Default is 750ms or 1500ms if the router is flagged as slow]";
    t[3547] = "Ez a be\u00e1ll\u00edt\u00e1s milliszekundumban fel\u00fcl\u00edrja a router torl\u00f3d\u00e1s \u00e9szlel\u00e9s\u00e9t megel\u0151z\u0151 alap\u00e9rtelmezett \u00fczenetfeldolgoz\u00e1si id\u0151korl\u00e1tot (jel\u00f6lve mint <i>\u00dczenet K\u00e9sleltet\u00e9s</i> a Torl\u00f3d\u00e1s oldals\u00e1v szakasz\u00e1ban), miel\u0151tt a router t\u00f6m\u00f6ttnek \u00e9s \u00e1tmeneti alag\u00fatig\u00e9nyeket visszautas\u00edtan\u00e1. [Az alap\u00e9rtelmezett 750 ms, vagy 1500 ms, ha a router lass\u00fanak jel\u00f6lt.]";
