    t[3560] = "To update with unsigned I2P+ release builds: <code>http://skank.i2p/i2pupdate.zip</code> or for the latest unsigned development builds: <code>http://skank.i2p/dev/i2pupdate.zip</code>";
    t[3561] = "Al\u00e1\u00edratlan I2P-verzi\u00f3kkal t\u00f6rt\u00e9n\u0151 friss\u00edt\u00e9shez: <code>http://skank.i2p/i2pupdate.zip</code> vagy a leg\u00fajabb al\u00e1\u00edratlan fejleszt\u00e9si buildekhez: <code>http://skank.i2p/dev/i2pupdate </code>";
    t[3564] = "Invalid form submission, probably because you used the 'back' or 'reload' button on your browser. Please resubmit.";
    t[3565] = "\u00darlap k\u00fcld\u00e9se sikertelen, val\u00f3sz\u00edn\u0171leg a \"vissza\" vagy az \"\u00fajrat\u00f6lt\u00e9s\" gombokat haszn\u00e1ltad a b\u00f6ng\u00e9sz\u0151ben. K\u00e9rlek, hogy k\u00fcldd \u00fajra.";
