    t[3600] = "No password entered";
    t[3601] = "Nincs jelsz\u00f3 megadva";
    t[3604] = "Enabling this mode will prevent participating traffic";
    t[3605] = "Ennek a m\u00f3dnak az enged\u00e9lyez\u00e9se megakad\u00e1lyozza a r\u00e9sztvev\u0151 forgalmat";
    t[3618] = "ERR - Clock Skew";
    t[3619] = "HIBA - \u00d3ra pontatlans\u00e1g";
    t[3624] = "This setting determines whether or not the router should use the provided <i>blocklist.txt</i> file and any user configured blocklists to enable banning of routers by hash or ip address. Ranges and net masks are supported for IPv4 but not IPv6. See the <i>blocklist.txt</i> in your I2P+ application directory for more info. [Enabled by default, restart required]";
    t[3625] = "Ezt a be\u00e1ll\u00edt\u00e1st\u00f3l f\u00fcgg, haszn\u00e1lja-e a router a rendelkez\u00e9sre bocs\u00e1tott <i>blocklist.txt</i> f\u00e1jlt \u00e9s a felhaszn\u00e1l\u00f3 \u00e1ltal konfigur\u00e1lt tilalmi list\u00e1kat a routerek tilt\u00e1s\u00e1hoz hash vagy IP c\u00edm alapj\u00e1n. Az IPv4 eset\u00e9ben tartom\u00e1nyok \u00e9s h\u00e1l\u00f3zati maszkok t\u00e1mogatottak, de az IPv6 eset\u00e9ben nem. Tov\u00e1bbi inform\u00e1ci\u00f3k\u00e9rt tekintse meg az I2P+ alkalmaz\u00e1s k\u00f6nyvt\u00e1r\u00e1ban tal\u00e1lhat\u00f3 <i>blocklist.txt</i> f\u00e1jlt. [Els\u0151dlegesen enged\u00e9lyezve, \u00fajraind\u00edt\u00e1s sz\u00fcks\u00e9ges]";
    t[3626] = "Licensing and copyright notices";
    t[3627] = "Licencel\u00e9si \u00e9s szerz\u0151i jogi \u00e9rtes\u00edt\u00e9sek";
    t[3634] = "Official I2P Source Repository";
    t[3635] = "Hivatalos I2P forr\u00e1sadatb\u00e1zis";
    t[3638] = "Outbound UDP on port 123, allowing replies: this is necessary for I2P's internal time sync (via SNTP - querying a random SNTP host in <code>pool.ntp.org</code> or <a href=/help/advancedsettings#ntpserverconfig>another server you specify</a>).";
    t[3639] = "Kimen\u0151 UDP a 123-as porton, amely lehet\u0151v\u00e9 teszi a v\u00e1laszokat: ez sz\u00fcks\u00e9ges az I2P bels\u0151 id\u0151szinkroniz\u00e1l\u00e1s\u00e1hoz (SNTP-n kereszt\u00fcl - v\u00e9letlenszer\u0171 SNTP-gazda lek\u00e9rdez\u00e9se a <code>pool.ntp.org</code>-ban vagy <a href=/help/advancedsettings#ntpserverconfig >egy m\u00e1sik megadott szerver</a>).";
    t[3646] = "NetDb Search";
    t[3647] = "NetDb keres\u00e9s";
    t[3654] = "XChat-like client users can create a new network with the server <code>127.0.0.1/6668</code> (remember to tick <i>Bypass proxy server</i> if you have a proxy server configured), or you can connect with the command <code>/server 127.0.0.1 6668</code>. Different IRC clients may vary the syntax.";
    t[3655] = "Az XChat-szer\u0171 klienshaszn\u00e1l\u00f3k \u00faj h\u00e1l\u00f3zatot hozhatnak l\u00e9tre a <code>127.0.0.1/6668</code> szervert haszn\u00e1lva (ne felejtse el bepip\u00e1lni a <i>Proxy szerver kihagy\u00e1sa</i> lehet\u0151s\u00e9get, ha be\u00e1ll\u00edtott proxy szervere van), vagy csatlakozhat a <code>/server 127.0.0.1 6668</code> parancs haszn\u00e1lat\u00e1val. K\u00fcl\u00f6nb\u00f6z\u0151 IRC kliensek elt\u00e9r\u0151 szintaxist haszn\u00e1lhatnak.";
