    t[3704] = "The router configuration options listed below are not available in the user interface, usually because they are rarely used or provide access to advanced settings that most users will not need. This is not a comprehensive list. Some settings will require a restart of the router to take effect. Note that all settings are case sensitive. You will need to edit your <code>router.config</code> file to add options, or, once you have added <code>routerconsole.advanced=true</code> to the router.config file, you may edit settings within the console on the <a href=/configadvanced>Advanced Configuration page</a>.";
    t[3705] = "Az al\u00e1bb felsorolt \u200b\u200b\u00fatv\u00e1laszt\u00e1si konfigur\u00e1ci\u00f3s be\u00e1ll\u00edt\u00e1sok nem \u00e9rhet\u0151k el az felhaszn\u00e1l\u00f3i fel\u00fcleten, \u00e1ltal\u00e1ban az\u00e9rt, mert ritk\u00e1n haszn\u00e1latosak vagy a legt\u00f6bb felhaszn\u00e1l\u00f3 sz\u00e1m\u00e1ra nem sz\u00fcks\u00e9gesek. Ez nem teljes lista. N\u00e9h\u00e1ny be\u00e1ll\u00edt\u00e1snak \u00fajraind\u00edtania kell az \u00fatv\u00e1laszt\u00f3dat a hat\u00e1s \u00e9rdek\u00e9ben. Vegye figyelembe, hogy az \u00f6sszes be\u00e1ll\u00edt\u00e1s \u00e9rz\u00e9keny a kis- \u00e9s nagybet\u0171kre. Az opci\u00f3k hozz\u00e1ad\u00e1s\u00e1hoz szerkesztenie kell a <code>router.config</code> f\u00e1jlt, vagy ha m\u00e1r hozz\u00e1adta <code>routerconsole.advanced=true</code> a router.config f\u00e1jlhoz, szerkesztheti a be\u00e1ll\u00edt\u00e1sokat a vez\u00e9rl\u0151pulton az <a href=/configadvanced>Halad\u00f3 konfigur\u00e1ci\u00f3s oldalon</a>.";
