    t[3754] = "When set to true, your router will not be classified as slow, regardless of the specifications of your host system. Ordinarily, routers running on hosts with the following characteristics will be classified as slow, and various performance-related router options will be modified accordingly:";
    t[3755] = "Amikor enged\u00e9lyezve van, a router\u00e9t nem sorolj\u00e1k a lass\u00fa kateg\u00f3ri\u00e1ba a g\u00e9p\u00e9nek specifik\u00e1ci\u00f3ja f\u00fcggetlen\u00fcl. Rendes esetben a k\u00f6vetkez\u0151 jellegzetess\u00e9gekkel rendelkez\u0151 g\u00e9peken fut\u00f3 routerek lass\u00fanak tekintend\u0151k, \u00e9s ennek megfelel\u0151en m\u00f3dosulnak a k\u00fcl\u00f6nb\u00f6z\u0151 teljes\u00edtm\u00e9nyhez kapcsol\u00f3d\u00f3 router be\u00e1ll\u00edt\u00e1sok:";
