    t[3780] = "To preserve anonymity, make sure that the webserver is not publicly available outside of the I2P network, which is normally achieved by configuring the webserver to listen on localhost (127.0.0.1) rather than all interfaces (0.0.0.0).";
    t[3781] = "A n\u00e9vtelens\u00e9g meg\u0151rz\u00e9se \u00e9rdek\u00e9ben gy\u0151z\u0151dj meg r\u00f3la, hogy a webszerver nem hozz\u00e1f\u00e9rhet\u0151 nyilv\u00e1nosan az I2P h\u00e1l\u00f3zaton k\u00edv\u00fcl, amit \u00e1ltal\u00e1ban \u00fagy \u00e9rhet\u00fcnk el, hogy a webszervert be\u00e1ll\u00edtjuk \u00fagy, hogy a localhoston (127.0.0.1) figyeljen, \u00e9s ne az \u00f6sszes interf\u00e9szen (0.0.0.0).";
