    t[3830] = "Used by client apps. Can be changed to a different port on the <a href=/configclients>Client Configuration page</a> but this is not recommended. Can be bound to a different interface or all interfaces, or disabled, on the <a href=/configclients>Client Configuration page</a>.";
    t[3831] = "A kliens alkalmaz\u00e1sok \u00e1ltal haszn\u00e1lt. Megv\u00e1ltoztathat\u00f3 egy m\u00e1sik portra a <a href=/configclients>Kliens Konfigur\u00e1ci\u00f3s oldalon</a>, de ez nem javasolt. Egy m\u00e1sik interf\u00e9szre vagy minden interf\u00e9szre is k\u00f6thet\u0151, vagy letilthat\u00f3 a <a href=/configclients>Kliens Konfigur\u00e1ci\u00f3s oldalon</a>.";
