    t[3839] = "Tov\u00e1bbi r\u00e9szletes \u00fatmutat\u00f3t a k\u00fcl\u00f6nb\u00f6z\u0151 b\u00f6ng\u00e9sz\u0151k konfigur\u00e1ci\u00f3j\u00e1hoz a <a href=https://geti2p.net/en/about/browser-config target=_blank rel=noreferrer class='sitelink external'>b\u00f6ng\u00e9sz\u0151 konfigur\u00e1ci\u00f3s \u00fatmutat\u00f3ban</a> tal\u00e1lod.";
    t[3842] = "Periodically test tunnels to determine the average lag, and display the results in the Congestion sidepanel section. To enable, set this value to false. [Default is false]";
    t[3843] = "Az \u00e1tlagos k\u00e9sleltet\u00e9s meghat\u00e1roz\u00e1sa \u00e9rdek\u00e9ben id\u0151r\u0151l id\u0151re tesztelje az alagutakat \u00e9s jelen\u00edtse meg az eredm\u00e9nyeket a Torl\u00f3d\u00e1s oldals\u00e1vj\u00e1nak szakasz\u00e1ban. Enged\u00e9lyez\u00e9shez \u00e1ll\u00edtsa ezt az \u00e9rt\u00e9ket hamisra. [Az alap\u00e9rtelmezett hamis.]";
