    t[3929] = "Be\u00e1ll\u00edt\u00e1sok a kliensek \u00e9s webalkalmaz\u00e1sok (szolg\u00e1ltat\u00e1sok) ind\u00edt\u00e1s\u00e1ra vonatkoz\u00f3an; elfekv\u0151 szolg\u00e1ltat\u00e1sok k\u00e9zi ind\u00edt\u00e1sa";
