    t[3954] = "NTCP [IPv6] &amp; SSU";
    t[3955] = "NTCP [IPv6] &amp; SSU";
    t[3958] = "I2P requires your computer's time be accurate.";
    t[3959] = "I2P megk\u00f6veteli, hogy a sz\u00e1m\u00edt\u00f3g\u00e9p ideje pontos legyen.";
    t[3960] = "Just finished jobs";
    t[3961] = "A K\u00f6zelm\u00faltban Befejezett Munkahelyek";
    t[3962] = "Some IRC clients are configured to disconnect from the server if there's been no communication with the server for a period of time, which can sometimes be problematic for I2P IRC if the <i>ping timeout</i> value is set too low. Setting the ping timeout value in your client to a high value (e.g. 320 seconds) will often result in a more robust connection to the network. In hexchat you can configure the value by typing <code>/set net_ping_timeout 320</code>. This will write the value to your <code>hexchat.conf</code> file.";
    t[3963] = "N\u00e9h\u00e1ny IRC kliens \u00fagy van konfigur\u00e1lva, hogy lecsatlakozik a szerverr\u0151l, ha egy ideig nincs kommunik\u00e1ci\u00f3 a szerverrel, ez n\u00e9ha probl\u00e9m\u00e1t jelenthet az I2P IRC-n\u00e9l, ha az <i>ping timeout</i> \u00e9rt\u00e9ke t\u00fal alacsonyra van \u00e1ll\u00edtva. A ping timeout \u00e9rt\u00e9k be\u00e1ll\u00edt\u00e1sa a kliensben egy magas \u00e9rt\u00e9kre (pl. 320 m\u00e1sodperc) \u00e1ltal\u00e1ban er\u0151sebb kapcsolatot eredm\u00e9nyez a h\u00e1l\u00f3zattal. A hexchat-ben be\u00e1ll\u00edthatja az \u00e9rt\u00e9ket a <code>/set net_ping_timeout 320</code> parancsal. Ez az \u00e9rt\u00e9k\u00e9t fogja be\u00edrni a <code>hexchat.conf</code> f\u00e1jlba.";
    t[3964] = "Run at Startup?";
    t[3965] = "Fusson Ind\u00edt\u00e1skor?";
    t[3972] = "Never";
    t[3973] = "Soha";
    t[3978] = "An <a href=/confignet#ipchange>optional configuration</a> that automatically changes your <a href=/netdb?r=.>router identity</a> and <a href=/confignet#udpconfig>external port</a> when the public ip address your system is on changes. This can prevent an adversary from correlating your router identity and ip address in scenarios where your ip address may change frequently, for example when you're running I2P on a laptop from multiple locations.";
    t[3979] = "Egy <a href=/confignet#ipchange>opcion\u00e1lis konfigur\u00e1ci\u00f3</a>, amely automatikusan megv\u00e1ltoztatja a <a href=/netdb?r=.>router azonos\u00edt\u00f3j\u00e1t</a> \u00e9s az <a href=/confignet#udpconfig>k\u00fcls\u0151 portot</a>, amikor a rendszer nyilv\u00e1nos IP-c\u00edme megv\u00e1ltozik. Ez megakad\u00e1lyozhatja, hogy egy ellenf\u00e9l korrel\u00e1lja a router azonos\u00edt\u00f3j\u00e1t \u00e9s az IP-c\u00edm\u00e9t olyan helyzetekben, ahol az IP-c\u00edme gyakran v\u00e1ltozhat, p\u00e9ld\u00e1ul amikor t\u00f6bb helyr\u0151l futtatod az I2P-t egy laptopon.";
    t[3982] = "The router is not configured to publish its address, therefore it does not expect incoming connections.";
    t[3983] = "A router nincs be\u00e1ll\u00edtva, hogy k\u00f6zz\u00e9tegye c\u00edm\u00e9t, ez\u00e9rt nem v\u00e1r bej\u00f6v\u0151 kapcsolatokat.";
    t[3998] = "A command-line application supplied with I2P+ (Linux/MacOS) that is used to perform a <code>head</code> request on a specified http resource on the network, returning various response headers from the remote server. By default, eephead uses the HTTP proxy on <code>127.0.0.1:4444</code>.";
    t[3999] = "Az I2P+ (Linux/MacOS) alkalmaz\u00e1ssal sz\u00e1ll\u00edtott parancssori alkalmaz\u00e1s, amelyet egy meghat\u00e1rozott h\u00e1l\u00f3zati http er\u0151forr\u00e1sra val\u00f3 <code>head</code> k\u00e9r\u00e9sek v\u00e9grehajt\u00e1s\u00e1ra haszn\u00e1lnak, k\u00fcl\u00f6nb\u00f6z\u0151 v\u00e1laszfejeket visszaadva a t\u00e1voli kiszolg\u00e1l\u00f3t\u00f3l. Az alap\u00e9rtelmez\u00e9s szerint az eephead a HTTP proxyt haszn\u00e1lja a <code>127.0.0.1:4444</code> c\u00edmen.";
    t[4010] = "NTCP [IPv6] &amp; SSU with Introducers";
    t[4011] = "IPv6 NTCP, SSU, bevezet\u0151k";
    t[4016] = "Console language saved.";
    t[4017] = "Konzolnyelv mentve.";
