    t[4024] = "Known";
    t[4025] = "Ismert";
    t[4026] = "This setting permits a custom text prefix to be set for the page title on router console pages, potentially useful when you have multiple consoles open on browser tabs and want an easy method to differentiate between them.";
    t[4027] = "Ez a be\u00e1ll\u00edt\u00e1s lehet\u0151v\u00e9 teszi egy\u00e9ni sz\u00f6vegprefix be\u00e1ll\u00edt\u00e1s\u00e1t a router konzol lapjainak c\u00edm\u00e9hez, ami akkor hasznos lehet, ha t\u00f6bb konzolt is nyitott\u00e1l b\u00f6ng\u00e9sz\u0151f\u00fclekben, \u00e9s egyszer\u0171 m\u00f3dot szeretn\u00e9l tal\u00e1lni a k\u00fcl\u00f6nbs\u00e9gek jel\u00f6l\u00e9s\u00e9re.";
