    t[4053] = "\u00c1ll\u00e1sstatisztika (az egyszeri munk\u00e1k kiv\u00e9tel\u00e9vel)";
    t[4054] = "In order to access websites hosted on the I2P network, and optionally use the default outproxy to connect to websites on clearnet, you will need to configure your browser to use the I2P+ <b>HTTP</b> proxy, by default running on <code>127.0.0.1 port 4444</code>. For more help, see <a href=https://geti2p.net/htproxyports target=_blank rel=noreferrer>the configuration guide</a>, or <a href=/help/configuration#browserconfig>the mini-tutorial for Firefox</a>.";
    t[4055] = "Annak \u00e9rdek\u00e9ben, hogy hozz\u00e1f\u00e9rhess a weboldalakhoz az I2P h\u00e1l\u00f3zaton kereszt\u00fcl, \u00e9s opcion\u00e1lisan haszn\u00e1lhassanak egy alap\u00e9rtelmezett kimeneti proxyt a weboldalakhoz val\u00f3 kapcsol\u00f3d\u00e1shoz a tiszta interneten, be kell \u00e1ll\u00edtanod a b\u00f6ng\u00e9sz\u0151det, hogy haszn\u00e1lja az I2P+ <b>HTTP</b> proxyt, alap\u00e9rtelmezetten m\u0171k\u00f6dik a <code>127.0.0.1 port 4444</code> c\u00edmen. Tov\u00e1bbi inform\u00e1ci\u00f3\u00e9rt l\u00e1sd a <a href=https://geti2p.net/htproxyports target=_blank rel=noreferrer>konfigur\u00e1ci\u00f3s \u00fatmutat\u00f3t</a>, vagy <a href=/help/configuration#browserconfig>a mini-tanul\u00f3anyagot a Firefox sz\u00e1m\u00e1ra</a>.";
