    t[4142] = "An address containing an encrypted LeaseSet is informally referred to as a b33 address, an extension of a base32 address with the host's public key and signature type encoded into the address instead of a lookup hash. This address type is required for blinded Leasesets. More information: <a href=https://geti2p.net/spec/b32encrypted class='sitelink external' target=_blank rel=noreferrer>B33 Specification</a>";
    t[4143] = "Egy titkos\u00edtott LeaseSet-tel rendelkez\u0151 c\u00edmet inform\u00e1lisan b33 c\u00edmk\u00e9nt eml\u00edtenek, egy b\u00e1zis32 c\u00edm kiterjeszt\u00e9sek\u00e9nt, amelyben a g\u00e9p nyilv\u00e1nos kulcsa \u00e9s al\u00e1\u00edr\u00e1s t\u00edpusa van be\u00e1gyazva a helyett, hogy egy keres\u00e9si hash-t haszn\u00e1lna. Ez a c\u00edmt\u00edpus sz\u00fcks\u00e9ges a vak LeaseSet-ekhez. Tov\u00e1bbi inform\u00e1ci\u00f3: <a href=https://geti2p.net/spec/b32encrypted class='sitelink external' target=_blank rel=noreferrer>B33 specifik\u00e1ci\u00f3</a>";
