    t[4332] = "Note: The order of the declarations matters. The first threshold declaration for a given destination (whether explicit or listed in a referenced file) overrides any future thresholds for the same destination, whether explicit or listed in a file. Note: to apply a new filter file, the tunnel must be restarted after the location has been specified in the tunnel manager. Once configured, a definition file can be updated without requiring a restart of the target tunnel, although destinations that are blocked will persist until the tunnel is restarted.";
    t[4333] = "Megjegyz\u00e9s: A deklar\u00e1ci\u00f3k sorrendje fontos. Az els\u0151 k\u00fcsz\u00f6bdeklar\u00e1ci\u00f3 egy adott c\u00e9l\u00e1llom\u00e1sra (legyen az explicit vagy list\u00e1zva egy hivatkozott f\u00e1jlban) fel\u00fclb\u00edr\u00e1l b\u00e1rmilyen tov\u00e1bbi k\u00fcsz\u00f6bdeklar\u00e1ci\u00f3t ugyanarra a c\u00e9l\u00e1llom\u00e1sra, legyen az explicit vagy felsorolva egy f\u00e1jlban. Megjegyz\u00e9s: az \u00faj sz\u0171r\u0151f\u00e1jl alkalmaz\u00e1s\u00e1hoz a tunnelnak \u00fajra kell ind\u00edtania, miut\u00e1n megadta a helyet a tunnelkezel\u0151ben. Miut\u00e1n konfigur\u00e1lt\u00e1k, a defin\u00edci\u00f3s f\u00e1jl friss\u00edthet\u0151 an\u00e9lk\u00fcl, hogy \u00fajraind\u00edt\u00e1st ig\u00e9nyelne a c\u00e9ltunneln\u00e1l, b\u00e1r a blokkolt c\u00e9lpontok fennmaradnak, am\u00edg a tunnel \u00fajra nem indul el.";
