    t[4595] = "alagutak \u00f3r\u00e1nk\u00e9nt";
    t[4606] = "User Interface";
    t[4607] = "Felhaszn\u00e1l\u00f3i Fel\u00fclet";
    t[4610] = "A guide to reseeding your I2P router";
    t[4611] = "\u00datmutat\u00f3 az I2P \u00fatv\u00e1laszt\u00f3 \u00fajrat\u00f6lt\u00e9s\u00e9hez";
    t[4618] = "The higher the share bandwidth the more you improve your anonymity and help the network.";
    t[4619] = "Min\u00e9l magasabb a megoszt\u00e1si s\u00e1vsz\u00e9less\u00e9g, ann\u00e1l jobban el\u0151seg\u00edted anonimit\u00e1sod \u00e9s seg\u00edted a h\u00e1l\u00f3zatot is.";
    t[4624] = "<b>Note:</b> On some Apache installations, the <a href=https://httpd.apache.org/docs/2.4/mod/mod_status.html target=_blank class='sitelink external'>mod_status</a> and <a href=https://httpd.apache.org/docs/2.4/mod/mod_info.html target=_blank class='sitelink external'>mod_info</a> modules are enabled by default. It is important to disable these, or otherwise protect access to the urls, to avoid compromising the anonymity and security of your server.";
    t[4625] = "<b>Megjegyz\u00e9s:</b> N\u00e9h\u00e1ny Apache telep\u00edt\u00e9sen alap\u00e9rtelmezetten enged\u00e9lyezve van a <a href=https://httpd.apache.org/docs/2.4/mod/mod_status.html target=_blank class='sitelink external'>mod_status</a> \u00e9s <a href=https://httpd.apache.org/docs/2.4/mod/mod_info.html target=_blank class='sitelink external'>mod_info</a> modul. Fontos ezeket letiltani vagy a hozz\u00e1f\u00e9r\u00e9st ezekhez az URL-ekhez m\u00e1s m\u00f3don megv\u00e9deni ahhoz, hogy ne vesz\u00e9lyeztesse a szerver anonimit\u00e1s\u00e1t \u00e9s biztons\u00e1g\u00e1t.";
    t[4628] = "Unsigned update file from {0} is corrupt";
    t[4629] = "Az al\u00e1\u00edr\u00e1s n\u00e9lk\u00fcli friss\u00edt\u00e9si f\u00e1jl korrupt a k\u00f6vetkez\u0151t\u0151l: {0}";
    t[4634] = "Duration of connection to peer";
    t[4635] = "A t\u00e1rshoz val\u00f3 kapcsol\u00f3d\u00e1s id\u0151tartama";
    t[4644] = "The reseed status will be indicated on the sidebar. You can also check the {0} for the following message: <code>Reseed got 100 router infos from file with 0 errors</code>";
    t[4645] = "Az \u00fajramagvet\u00e9s \u00e1llapota az oldals\u00e1von lesz felt\u00fcntetve. Ellen\u0151rizheti a(z) {0} hely\u00e9t is az al\u00e1bbi \u00fczenet megjelen\u00edt\u00e9s\u00e9hez: <code>Az \u00fajramagvet\u00e9s 100 \u00fatvonal-inf\u00f3t kapott a f\u00e1jlb\u00f3l, 0 hib\u00e1val</code>";
    t[4648] = "RPC Service";
    t[4649] = "RPC szolg\u00e1ltat\u00e1s";
    t[4652] = "UDP Configuration";
    t[4653] = "UDP konfigur\u00e1ci\u00f3";
    t[4662] = "Sort by packets retransmitted";
    t[4663] = "Rendez\u00e9s \u00fajrak\u00f6zvet\u00edtett csomagok szerint";
    t[4666] = "I2P+ requires a web browser configured to use the resident HTTP proxy in order to browse websites on the I2P network.";
    t[4667] = "Az I2P+ olyan webb\u00f6ng\u00e9sz\u0151t ig\u00e9nyel, amely a rezidens HTTP-proxy haszn\u00e1lat\u00e1ra van konfigur\u00e1lva az I2P-h\u00e1l\u00f3zat webhelyeinek b\u00f6ng\u00e9sz\u00e9s\u00e9hez.";
    t[4670] = "The version of the I2P software you are running. If a new version is available, you will be notified in the Sidebar. It is recommended to keep your router up to date to ensure optimal performance and security. Router updates are usually made available on average every 2-3 months.";
    t[4671] = "Az \u00d6n \u00e1ltal futtatott I2P szoftver verzi\u00f3ja. Ha el\u00e9rhet\u0151 \u00faj verzi\u00f3, \u00e9rtes\u00edteni fogjuk az oldals\u00e1vban. Aj\u00e1nlott az \u00fatv\u00e1laszt\u00f3 friss\u00edt\u00e9se a optim\u00e1lis teljes\u00edtm\u00e9ny \u00e9s biztons\u00e1g \u00e9rdek\u00e9ben. Az \u00fatv\u00e1laszt\u00f3 friss\u00edt\u00e9sek \u00e1ltal\u00e1ban \u00e1tlagosan 2-3 h\u00f3naponk\u00e9nt el\u00e9rhet\u0151ek.";
    t[4684] = "Router Statistics";
    t[4685] = "Router statisztika";
    t[4686] = "Restart in {0}";
    t[4687] = "\u00dajraind\u00edt\u00e1s: {0}";
    t[4688] = "Add detected sybils to banlist";
    t[4689] = "\u00c9rz\u00e9kelt Sybils hozz\u00e1ad\u00e1sa a tilt\u00f3list\u00e1hoz";
    t[4696] = "Prefer IPv4 over IPv6";
    t[4697] = "Az IPv4 el\u0151nyben r\u00e9szes\u00edt\u00e9se az IPv6 helyett";
    t[4702] = "NTCP (NIO-based TCP) and NTCP2 are TCP-based network transports which use Java's NIO (New I/O) TCP implementation to deliver I2NP messages between routers on the network. NTCP2 improves the resistance of NTCP to various attacks and automated traffic identification methods. For more information, see the <a href=https://geti2p.net/en/docs/transport/ntcp class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[4703] = "Az NTCP (NIO alap\u00fa TCP) \u00e9s az NTCP2 olyan TCP alap\u00fa h\u00e1l\u00f3zati sz\u00e1ll\u00edt\u00e1si m\u00f3dok, amelyek a Java NIO (New I/O) TCP implement\u00e1ci\u00f3j\u00e1t haszn\u00e1lj\u00e1k az I2NP \u00fczenetek tov\u00e1bb\u00edt\u00e1s\u00e1ra a h\u00e1l\u00f3zaton bel\u00fcl m\u0171k\u00f6d\u0151 routerek k\u00f6z\u00f6tt. Az NTCP2 jav\u00edtja az NTCP ellen\u00e1ll\u00e1s\u00e1t a k\u00fcl\u00f6nb\u00f6z\u0151 t\u00e1mad\u00e1sokra \u00e9s az automatikus forgalomazonos\u00edt\u00e1si m\u00f3dszerekre. Tov\u00e1bbi inform\u00e1ci\u00f3\u00e9rt l\u00e1sd az <a href=https://geti2p.net/en/docs/transport/ntcp class='sitelink external' target=_blank rel=noreferrer>online dokument\u00e1ci\u00f3t</a>.";
    t[4708] = "You can use a recorder to log the destinations of aggressive clients to a specified file, and then use that same file to throttle them. The following snippet defines a filter that initially allows all connection requests, but if any single destination exceeds 180 requests in 60 seconds, it gets throttled down to 30 requests every 60 seconds:";
    t[4709] = "Haszn\u00e1lhat egy r\u00f6gz\u00edt\u0151t az agressz\u00edv kliensek c\u00e9l\u00e1llom\u00e1sainak napl\u00f3z\u00e1s\u00e1hoz egy meghat\u00e1rozott f\u00e1jlba, majd ugyanezt a f\u00e1jlt haszn\u00e1lhatja azoknak az eszk\u00f6z\u00f6knek a lass\u00edt\u00e1s\u00e1ra. A k\u00f6vetkez\u0151 r\u00e9szlet meghat\u00e1rozza a sz\u0171r\u0151t, amely kezdetben minden csatlakoz\u00e1si k\u00e9r\u00e9st enged\u00e9lyez, de ha b\u00e1rmely egyetlen c\u00e9l\u00e1llom\u00e1s meghaladja a 180 k\u00e9r\u00e9st 60 m\u00e1sodperc alatt, akkor 30 k\u00e9r\u00e9ssel lassul le minden 60 m\u00e1sodpercben:";
