    t[4821] = "A be\u00e9p\u00fcl\u0151 modul nincs telep\u00edtve \u2013 az al\u00e1\u00edr\u00f3 nem megb\u00edzhat\u00f3";
    t[4822] = "Be aware that a poorly configured webserver or web appplication can leak information such as your real IP address or server details that may reduce your anonymity or assist a hacker. If using an alternative platform, be sure to secure it before putting it online. If in doubt, consult online guides about web server and web application hardening, for example:";
    t[4823] = "Tudat\u00e1ban kell lenned annak, hogy egy rosszul be\u00e1ll\u00edtott webszerver vagy webalkalmaz\u00e1s inform\u00e1ci\u00f3kat sziv\u00e1roghat ki, mint p\u00e9ld\u00e1ul az igazi IP-c\u00edmed vagy a szerver r\u00e9szletei, amelyek cs\u00f6kkenthetik az anonimit\u00e1st vagy seg\u00edthetnek egy hackert. Ha alternat\u00edv platformot haszn\u00e1lsz, gy\u0151z\u0151dj meg r\u00f3la, hogy biztons\u00e1gosan van-e be\u00e1ll\u00edtva, miel\u0151tt online feltenn\u00e9d. Ha k\u00e9ts\u00e9ged van, konzult\u00e1lj online \u00fatmutat\u00f3kkal a webszerverek \u00e9s webalkalmaz\u00e1sok meger\u0151s\u00edt\u00e9s\u00e9r\u0151l, p\u00e9ld\u00e1ul:";
    t[4824] = "Please visit the {0}config clients page{1} to start it.";
    t[4825] = "K\u00e9rj\u00fck, l\u00e1togasson el a {0}konfig kliensek oldal\u00e1ra{1} az ind\u00edt\u00e1shoz.";
    t[4826] = "Technology news aggregator";
    t[4827] = "Technol\u00f3giai h\u00edrgy\u0171jt\u0151";
    t[4830] = "Requires hostname, destination, or blinded Base32";
    t[4831] = "Hosztn\u00e9v, c\u00e9lhely vagy letiltott Base32 sz\u00fcks\u00e9ges";
    t[4834] = "The ratio of tunnel hops we provide to tunnel hops we use - a value greater than 1.00 indicates a positive contribution to the network";
    t[4835] = "Az \u00e1ltalunk biztos\u00edtott alag\u00fat koml\u00f3 \u00e9s az \u00e1ltalunk haszn\u00e1lt alag\u00fat koml\u00f3 ar\u00e1nya - az 1,00 feletti \u00e9rt\u00e9k pozit\u00edv hozz\u00e1j\u00e1rul\u00e1st jelent a h\u00e1l\u00f3zathoz";
