    t[4854] = "Outbound UDP from the <a href=/confignet#udpconfig>random port</a> noted on the Network Configuration page to arbitrary remote UDP ports, allowing replies.";
    t[4855] = "Kimen\u0151 UDP a H\u00e1l\u00f3zati Konfigur\u00e1ci\u00f3s oldalra jegyzett <a href=/confignet#udpconfig>v\u00e9letlen portb\u00f3l</a> tetsz\u0151leges t\u00e1voli UDP portokra, v\u00e1laszok lehet\u0151v\u00e9 t\u00e9tele.";
    t[4856] = "No log messages";
    t[4857] = "Nincs napl\u00f3\u00fczenet";
    t[4860] = "Clearnet";
