    t[4862] = "UPnP SSDP UDP search response listener";
    t[4863] = "UPnP SSDP UDP keres\u00e9si v\u00e1laszfigyel\u0151";
    t[4864] = "A web application supplied with the router that permits creation and configuration of client and server tunnels. Also referred to as the <i>Hidden Services Manager</i>.";
    t[4865] = "A routert ell\u00e1t\u00f3 webalkalmaz\u00e1s, amely lehet\u0151v\u00e9 teszi \u00fcgyf\u00e9l- \u00e9s szerveralagutak l\u00e9trehoz\u00e1s\u00e1t \u00e9s konfigur\u00e1l\u00e1s\u00e1t. M\u00e1s n\u00e9ven a <i>Rejtett Szolg\u00e1ltat\u00e1sok Kezel\u0151je</i>.";
    t[4870] = "Cross-network micro-blogging &amp; forums &amp; wiki";
