    t[4891] = "Router kliensek elind\u00edt\u00e1sa vagy le\u00e1ll\u00edt\u00e1sa";
    t[4894] = "UPnP support is beta, and may not work for any number of reasons";
    t[4895] = "Az UPnP t\u00e1mogat\u00e1s b\u00e9ta f\u00e1zisban van, \u00e9s b\u00e1rmi okb\u00f3l kifoly\u00f3lag nem m\u0171k\u00f6dhet";
