    t[4927] = "Friss\u00edt\u00e9si link";
    t[4930] = "This setting, when configured with a path pointing at a valid blocklist file, enables an additional, user-configured blocklist to be loaded at router startup. [Disabled by default, restart required]";
    t[4931] = "Ennek a be\u00e1ll\u00edt\u00e1snak a bekapcsol\u00e1sa eset\u00e9n haszn\u00e1lhat\u00f3 egy tov\u00e1bbi, felhaszn\u00e1l\u00f3 \u00e1ltal konfigur\u00e1lhat\u00f3 blokklista a router ind\u00edt\u00e1sakor. [Alap\u00e9rtelmezett be\u00e1ll\u00edt\u00e1sban le van tiltva, \u00fajraind\u00edt\u00e1s sz\u00fcks\u00e9ges]";
    t[4932] = "I2P+ supports custom theme overrides for the console, the tunnel manager, I2PSnark, SusiDNS and Susimail, permitting changes to the themes which are persistent after upgrades. In order to activate an override, create a css file named <code>override.css</code> with your theme modifications and place it in the relevant theme directory of the theme you wish to change, or rename one of the example files, and then hard refresh the browser. Note that the tunnel manager and the console share the same override.css. To deactivate an override, delete or rename the <code>override.css</code> file and then hard refresh the browser (usually Control + Shift + R).";
    t[4933] = "Az I2P+ testreszabott t\u00e9ma fel\u00fcl\u00edr\u00e1sokat t\u00e1mogat a konzolhoz, az alag\u00fatkezel\u0151h\u00f6z, az I2PSnarkhoz, a SusiDNS-hez \u00e9s a Susimailhez, lehet\u0151v\u00e9 t\u00e9ve a t\u00e9m\u00e1k m\u00f3dos\u00edt\u00e1s\u00e1t, amelyek az friss\u00edt\u00e9sek ut\u00e1n is megmaradnak. Ahhoz, hogy aktiv\u00e1lja a fel\u00fcl\u00edr\u00e1st, hozzon l\u00e9tre egy css f\u00e1jlt <code>override.css</code> n\u00e9vvel a t\u00e9ma m\u00f3dos\u00edt\u00e1s\u00e1val, \u00e9s helyezze el a megfelel\u0151 t\u00e9ma k\u00f6nyvt\u00e1r\u00e1ban, amelyet meg szeretne v\u00e1ltoztatni, vagy nevezzen \u00e1t egy p\u00e9lda f\u00e1jlt, majd friss\u00edtse meg a b\u00f6ng\u00e9sz\u0151t. Vegye figyelembe, hogy az alag\u00fatkezel\u0151 \u00e9s a konzol ugyanazt a override.css-t haszn\u00e1lja. Az override visszavon\u00e1s\u00e1hoz t\u00f6r\u00f6lje vagy nevezze \u00e1t a <code>override.css</code> f\u00e1jlt, majd friss\u00edtse meg a b\u00f6ng\u00e9sz\u0151t (\u00e1ltal\u00e1ban Control + Shift + R).";
