    t[5042] = "When set to true, this setting enables reverse DNS lookups for peers, triggered when displaying the country flag of a peer or when the hostname or domain is explicitly displayed in the console, or when the peer's RouterInfo is written to disk. In order to avoid repeat lookups, it's recommended to configure a generous caching policy for DNS lookups of 10 minutes or more, and to configure a privacy respecting DNS server in your operating system. [Disabled by default, restart required]";
    t[5043] = "Amikor igazra van \u00e1ll\u00edtva, ez a be\u00e1ll\u00edt\u00e1s lehet\u0151v\u00e9 teszi a peers visszafel\u00e9 DNS n\u00e9zeteit, amelyek akkor aktiv\u00e1l\u00f3dnak, amikor egy peer orsz\u00e1g\u00e1nak z\u00e1szlaja jelenik meg, vagy amikor a g\u00e9pnevet vagy a domainnevet az eredm\u00e9nyf\u00fcgg\u00f6ny\u00f6n jelen\u00edti meg, vagy akkor is, amikor a peer RouterInfo-ja lemezre ker\u00fcl. Ahhoz, hogy elker\u00fclje a t\u00f6bbsz\u00f6r\u00f6s keres\u00e9st, javasolt, hogy \u00e1ll\u00edtsa be a DNS keres\u00e9sek b\u0151s\u00e9ges gyors\u00edt\u00f3t\u00e1raz\u00e1si politik\u00e1j\u00e1t 10 percn\u00e9l hosszabb id\u0151re, \u00e9s \u00e1ll\u00edtsa be a mag\u00e1nszf\u00e9r\u00e1t tiszteletben tart\u00f3 DNS kiszolg\u00e1l\u00f3 be\u00e1ll\u00edt\u00e1sait a m\u0171k\u00f6d\u00e9si rendszerben. [Els\u0151dlegesen kikapcsolt, \u00fajraind\u00edt\u00e1s sz\u00fcks\u00e9ges]";
