    t[5084] = "If you're running a dynamic site handling a large number of concurrent users, content caching can often improve the time taken to deliver pages. For content that rapidly changes, a <a href=https://blog.stackpath.com/glossary-micro-caching/ target=_blank class='sitelink external'>micro-caching strategy</a> may still yield some benefits. The <a href=https://www.nginx.com/ target=_blank class='sitelink external'>Nginx webserver</a> provides a competent caching sub-system, or for a more heavy-weight solution, have a look at <a href=https://varnish-cache.org/ target=_blank class='sitelink external'>Varnish</a>.";
    t[5085] = "Ha dinamikus oldalt futtat, ami sok egyidej\u0171 felhaszn\u00e1l\u00f3t kezel, a tartalom gyors\u00edt\u00f3t\u00e1raz\u00e1sa gyakran jav\u00edthatja az oldalak let\u00f6lt\u00e9si idej\u00e9t. Azokra a tartalmakra, amelyek gyorsan v\u00e1ltoznak, egy <a href=https://blog.stackpath.com/glossary-micro-caching/ target=_blank class='sitelink external'>mikro gyors\u00edt\u00f3t\u00e1raz\u00e1si strat\u00e9gia</a> m\u00e9g mindig n\u00e9mi el\u0151nyt ny\u00fajthat. Az <a href=https://www.nginx.com/ target=_blank class='sitelink external'>Nginx webszerver</a> rendelkezik egy hat\u00e9kony gyors\u00edt\u00f3t\u00e1raz\u00e1si alrendszerrel, vagy ha s\u00falyosabb megold\u00e1st szeretne, n\u00e9zze meg a <a href=https://varnish-cache.org/ target=_blank class='sitelink external'>Varnish</a>-t.";
