    t[5503] = "BOB";
    t[5514] = "If after a few minutes of uptime your router is indicating 0 Active Peers and 0 Known Peers, with a notification in the sidebar that you need to check your network connection, verify that you can access the internet. If your internet connection is functional, you may need to unblock Java in your firewall. Otherwise, you may need to reseed your I2P router. Visit the <a href=/configreseed#reseedconfig>Reseed Configuration page</a> and click the <i>Save Changes and Reseed Now</i> button. For more information, see the <a href=#reseedhelp>Reseed help section</a> above.";
    t[5515] = "Ha p\u00e1r perce m\u0171k\u00f6dik a k\u00f6zpontja \u00e9s 0 akt\u00edv vagy ismert kapcsolatot jelent, \u00e9s a oldals\u00e1von a h\u00e1l\u00f3zati kapcsolat megvizsg\u00e1l\u00e1sa \u00fczenet jelenik meg, ellen\u0151rizze, hogy el\u00e9rhet\u0151-e az internet. Ha az internetkapcsolat m\u0171k\u00f6dik, jelentkezhet, hogy feloldja a t\u0171zfalban a Jav\u00e1t. M\u00e1s esetben \u00fajra kell \u00fcltetni az I2P k\u00f6zpontj\u00e1t. L\u00e1togasson el a <a href=/configreseed#reseedconfig>Termeszt\u00e9si konfigur\u00e1ci\u00f3 oldalra</a> \u00e9s kattintson a <i>V\u00e1ltoztat\u00e1sok ment\u00e9se \u00e9s \u00fajrateljes\u00edt\u00e9s</i> gombra. Tov\u00e1bbi inform\u00e1ci\u00f3\u00e9rt l\u00e1sd az <a href=#reseedhelp>\u00dajra\u00fcltet\u00e9si seg\u00e9dlet</a> szakaszt.";
    t[5518] = "A higher level socket API for clients. Only opened when a SAM V3 client requests a UDP session. Can be enabled/disabled on the <a href=/configclients> Client Configuration page</a>. Can be changed in the <code>clients.config</code> file with the SAM command line option <code>sam.udp.port=nnnn</code>.";
    t[5519] = "Egy magasabb szint\u0171 kliens sz\u00e1m\u00e1ra k\u00e9sz\u00fclt socket API. Csak akkor ny\u00edlik meg, ha egy SAM V3 kliens egy UDP munkamenetet k\u00e9r. Enged\u00e9lyezhet\u0151 / tiltott lehet a <a href=/configclients>\u00dcgyf\u00e9l konfigur\u00e1ci\u00f3s oldalon</a>. A <code>clients.config</code> f\u00e1jlban megv\u00e1ltoztathat\u00f3 a SAM parancssor opci\u00f3val <code>sam.udp.port=nnnn</code>.";
    t[5526] = "If you want your site to feel responsive, image compression is essential when hosting large images. Using a service like <a href=https://tinypng.com/ target=_blank class='sitelink external'>tinypng.com</a> to compress your png and jpeg images will often result in much smaller files with minimal loss of quality. In some situations the webp format can best jpegs, generating smaller files with approximately the same or better visual fidelity, and has wide browser support. Also consider using svgs instead of bitmaps for icons and illustrations - they're often smaller than the equivalent bitmap file (run them through a service like <a href=https://vecta.io/nano target=_blank class='sitelink external'>Nano SVG Optimizer</a> to remove unneeded cruft), scale without loss of quality, and can be gzipped by your webserver.";
    t[5527] = "Ha azt szeretn\u00e9, hogy webhelye reag\u00e1l\u00f3 legyen, akkor a k\u00e9pek t\u00f6m\u00f6r\u00edt\u00e9se n\u00e9lk\u00fcl\u00f6zhetetlen, amikor nagy k\u00e9peket t\u00e1rol. A <a href=https://tinypng.com/ target=_blank class='sitelink external'>tinypng.com</a> haszn\u00e1lata p\u00e9ld\u00e1ul nagyban cs\u00f6kkentheti a png \u00e9s jpeg k\u00e9pek m\u00e9ret\u00e9t minim\u00e1lis min\u0151s\u00e9gveszt\u00e9ssel. Bizonyos esetekben a webp form\u00e1tum a legjobb a jpeg k\u00e9pekhez k\u00e9pest, kisebb f\u00e1jlokat hoz l\u00e9tre k\u00f6zel azonos vagy jobb k\u00e9pi h\u0171s\u00e9ggel, \u00e9s sz\u00e9les k\u00f6rben t\u00e1mogatott a b\u00f6ng\u00e9sz\u0151kben. Fontolja meg azt is, hogy ikonokhoz \u00e9s illusztr\u00e1ci\u00f3khoz vektorgrafikus (SVG) f\u00e1jlokat haszn\u00e1l, mivel ezek \u00e1ltal\u00e1ban kisebbek, mint a hasonl\u00f3 bitmap f\u00e1jlok (futassa \u00e1t \u0151ket olyan szolg\u00e1ltat\u00e1son, mint a <a href=https://vecta.io/nano target=_blank class='sitelink external'>Nano SVG Optimizer</a>, hogy elt\u00e1vol\u00edtsa a felesleges r\u00e9szeket), min\u0151s\u00e9groml\u00e1s n\u00e9lk\u00fcl sk\u00e1l\u00e1z\u00f3dnak, \u00e9s t\u00f6m\u00f6r\u00edthet\u0151k a webszerver \u00e1ltal.";
    t[5528] = "UPnP disabled on the device";
    t[5529] = "Az eszk\u00f6z\u00f6n az UPnP letiltva.";
    t[5536] = "By default, most of your client services (mail, http proxy, IRC) will share the same set of tunnels (for performance reasons) and be listed as <i>Shared Clients</i> and <i>Shared Clients(DSA)</i> in the sidebar under Service Tunnels and on the <a href=/tunnels>Tunnels page</a>.";
    t[5537] = "Alap\u00e9rtelmez\u00e9s szerint legt\u00f6bb kliens szolg\u00e1ltat\u00e1s (e-mail, HTTP proxy, IRC) ugyanazt az alag\u00fat\u00e1llom\u00e1nyt haszn\u00e1lja (teljes\u00edtm\u00e9ny okokb\u00f3l), \u00e9s <i>Shared Clients</i> \u00e9s <i>Shared Clients(DSA)</i> n\u00e9ven lesznek felt\u00fcntetve a Service Tunnels oldals\u00e1von, valamint a <a href=/tunnels>Tunnels oldalon</a>.";
