    t[5545] = "Ez a szakasz alap\u00e9rtelmez\u00e9s szerint nincs enged\u00e9lyezve, hacsak nem enged\u00e9lyezte az <a href='/help/configuration#advancedconsole'>Advanced Console m\u00f3dot</a>. Enged\u00e9lyezheti azt az <a href='/configsidebar'>Oldals\u00e1v konfigur\u00e1ci\u00f3s oldal\u00e1n</a>.";
    t[5546] = "Move up";
