    t[5554] = "Firewalls, Modems &amp; Routers";
    t[5555] = "T\u0171zfalak, Modemek \u00e9s \u00datv\u00e1laszt\u00f3k";
    t[5556] = "Also, some routers cannot correctly forward both TCP and UDP on a single port, or may have other limitations or bugs that prevent them from passing traffic through to I2P.";
    t[5557] = "Hozz\u00e1t\u00e9ve, hogy n\u00e9h\u00e1ny router nem tov\u00e1bb\u00edt megfelel\u0151en TCP-t \u00e9s UDP-t is egyetlen porton, vagy lehetnek m\u00e1s korl\u00e1toz\u00e1sok, esetleg hib\u00e1k, melyek megg\u00e1tolj\u00e1k az I2P-n kereszt\u00fcl \u00e1thalad\u00f3 forgalmat.";
