    t[5612] = "A <a href=https://geti2p.net/en/docs/tunnels/unidirectional class='sitelink external' target=_blank rel=noreferrer>unidirectional</a> encrypted communication pathway between a client or server on the I2P network. Similar to a circuit in Tor, except that Tor circuits are bidirectional.";
    t[5613] = "Egy <a href=https://geti2p.net/en/docs/tunnels/unidirectional class='sitelink external' target=_blank rel=noreferrer>egyir\u00e1ny\u00fa</a> titkos\u00edtott kommunik\u00e1ci\u00f3s \u00fatvonal egy \u00fcgyf\u00e9l vagy szerver k\u00f6z\u00f6tt az I2P h\u00e1l\u00f3zaton. Hasonl\u00f3 egy \u00e1ramk\u00f6rh\u00f6z a Torban, kiv\u00e9ve, hogy a Tor \u00e1ramk\u00f6r\u00f6k k\u00e9tir\u00e1ny\u00faak.";
    t[5616] = "Create and download torrents";
