    t[5638] = "When set to true, this enables plugin installation on the <a href=/configplugins>Plugin Configuration page</a>. [Enabled by default]";
    t[5639] = "Ha igazra van \u00e1ll\u00edtva, ez enged\u00e9lyezi a b\u0151v\u00edtm\u00e9nyek telep\u00edt\u00e9s\u00e9t a <a href=/configplugins>B\u0151v\u00edtm\u00e9ny Konfigur\u00e1ci\u00f3 oldalon</a>. [Alap\u00e9rtelmezetten enged\u00e9lyezve]";
    t[5644] = "Configure tunnels";
