    t[5665] = "Az \u00fatv\u00e1laszt\u00f3 napl\u00f3inak megtekint\u00e9se";
    t[5666] = "Help with configuring I2P to use a non-system default browser";
    t[5667] = "S\u00fag\u00f3 az I2P konfigur\u00e1l\u00e1s\u00e1hoz nem rendszer alap\u00e9rtelmezett b\u00f6ng\u00e9sz\u0151 haszn\u00e1lat\u00e1hoz";
    t[5674] = "classic";
    t[5675] = "klasszikus";
    t[5680] = "Configure I2P system service";
    t[5681] = "I2P rendszerszolg\u00e1ltat\u00e1s konfigur\u00e1l\u00e1sa";
    t[5684] = "Check to see if another program is using the configured port. If so, stop that program or configure I2P to use a different port.";
    t[5685] = "N\u00e9zz ut\u00e1na, hogy m\u00e1sik program haszn\u00e1lja a be\u00e1ll\u00edtott portot. Ha igen, \u00e1ll\u00edtsd le azt a programot vagy \u00e1ll\u00edtsd be az I2P-t egy m\u00e1sik port haszn\u00e1lat\u00e1ra.";
    t[5692] = "Manually edit peers and view banned peers and blocklist";
    t[5693] = "Manu\u00e1lisan szerkessze a t\u00e1rsakat, \u00e9s tekintse meg a kitiltott partnereket \u00e9s a blokklist\u00e1t";
    t[5712] = "Firewalled with Inbound TCP Enabled";
    t[5713] = "Bej\u00f6v\u0151 TCP-vel t\u0171zfalazva";
    t[5716] = "Open <a href=/confignet#udpconfig>I2P+'s port</a> on your modem, router and/or firewall(s) for better connectivity (ideally both UDP and TCP). More information on how to go about port forwarding can be found at <a href=http://portforward.com/ target=_blank rel=noreferrer class='sitelink external'>portforward.com</a>, in addition to our forums and IRC channels listed below. Note that I2P does not support connecting to the internet via an http or socks proxy [patches welcome!], though you can connect to proxies via I2P itself once connected to the network.";
    t[5717] = "A jobb kapcsolattart\u00e1s \u00e9rdek\u00e9ben nyissa meg az I2P portot a modem\u00e9n, a router\u00e9n \u00e9s/vagy a t\u0171zfal\u00e1n (esetleg mind a kett\u0151t: UDP \u00e9s TCP). Tov\u00e1bbi inform\u00e1ci\u00f3 tal\u00e1lhat\u00f3 a portforward.com webhelyen a port tov\u00e1bb\u00edt\u00e1s\u00e1val kapcsolatos megold\u00e1sokr\u00f3l, valamint a f\u00f3rumainkon \u00e9s az al\u00e1bb felsorolt IRC csatorn\u00e1inkban is. Jegyezze meg, hogy az I2P nem t\u00e1mogatja az internethez val\u00f3 csatlakoz\u00e1st http vagy socks proxy seg\u00edts\u00e9g\u00e9vel [v\u00e1rjuk a jav\u00edt\u00e1sokat!], b\u00e1r a h\u00e1l\u00f3zathoz val\u00f3 csatlakoz\u00e1s ut\u00e1n kapcsol\u00f3dhat proxykhoz az I2P-n kereszt\u00fcl.";
    t[5730] = "A tunnel filter can provide protection against denial of service attacks, without otherwise interrupting the service for genuine users, either in conjunction with the tunnel throttler or as an alternative strategy. It can also be used to log access to a hosted service to determine if the server is under attack, or simply to log all visitors by I2P destination. Additionally, a filter can function simultaneously as a whitelist and blacklist making it more flexible than the Tunnel Manager's access list controls. Note that multiple server tunnels can share a single filter file if you wish to implement a global filter.";
    t[5731] = "Egy alag\u00fat sz\u0171r\u0151 v\u00e9delmet ny\u00fajthat a szolg\u00e1ltat\u00e1sra \u00e9s lehet\u0151v\u00e9 teszi a leg\u00e1lis felhaszn\u00e1l\u00f3k haszn\u00e1lat\u00e1t, an\u00e9lk\u00fcl, hogy megszak\u00edtan\u00e1 azt, legyen az egy\u00fcttm\u0171k\u00f6d\u00e9s az alag\u00fatos\u00edt\u00e1si korl\u00e1toz\u00f3val vagy alternat\u00edv strat\u00e9gia. Haszn\u00e1lhat\u00f3 tov\u00e1bb\u00e1 napl\u00f3z\u00e1sra is, hogy meghat\u00e1rozhassuk, hogy a kiszolg\u00e1l\u00f3 t\u00e1mad\u00e1snak van-e kit\u00e9ve, vagy egyszer\u0171en csak az \u00f6sszes l\u00e1togat\u00f3t napl\u00f3zhatjuk az I2P-c\u00e9l\u00e1llom\u00e1s alapj\u00e1n. Egy tov\u00e1bbi lehet\u0151s\u00e9g, hogy egy sz\u0171r\u0151 egyszerre m\u0171k\u00f6dj\u00f6n feh\u00e9rlistak\u00e9nt \u00e9s feketelistak\u00e9nt, ez\u00e1ltal rugalmasabban m\u0171k\u00f6dik, mint a Tunnel Manager hozz\u00e1f\u00e9r\u00e9s lista vez\u00e9rl\u0151i. Felh\u00edvjuk a figyelmedet, hogy t\u00f6bb kiszolg\u00e1l\u00f3n alag\u00fat megoszthatja ugyanazt a sz\u0171r\u0151 f\u00e1jlt, ha glob\u00e1lis sz\u0171r\u0151t szeretn\u00e9l alkalmazni.";
