    t[6025] = "K\u00fcl\u00f6nf\u00e9le szolg\u00e1ltat\u00e1sok nyit\u00f3oldala";
    t[6026] = "This setting (in milliseconds) allows you to manually configure the delay between router refresh updates run by the Refresh Routers Job. By default the pause between refreshes is determined by the size of the NetDb, and introduces some randomness in the timing to mitigate traffic analysis. For values lower than 2000 milliseconds, increasing the value of <code>router.refreshTimeout</code> is recommended. Note that setting this value below 2000 milliseconds will increase your network traffic and may introduce job lag, and is not recommended for sustained use.";
    t[6027] = "Ez a be\u00e1ll\u00edt\u00e1s (milliszekundumban) lehet\u0151v\u00e9 teszi, hogy k\u00e9zzel \u00e1ll\u00edtsa be a Refresh Routers Job \u00e1ltal v\u00e9gzett router-friss\u00edt\u00e9sek k\u00f6z\u00f6tti k\u00e9sleltet\u00e9st. Az alap\u00e9rtelmezett be\u00e1ll\u00edt\u00e1s szerint a friss\u00edt\u00e9sek k\u00f6z\u00f6tti sz\u00fcnetet a NetDb m\u00e9rete hat\u00e1rozza meg, \u00e9s a v\u00e9letlenszer\u0171s\u00e9get bevezeti az id\u0151z\u00edt\u00e9sben a forgalom elemz\u00e9s\u00e9nek cs\u00f6kkent\u00e9se \u00e9rdek\u00e9ben. Az al\u00e1bbi 2000 milliszekundumn\u00e1l alacsonyabb \u00e9rt\u00e9kekhez javasolt a <code>router.refreshTimeout</code> \u00e9rt\u00e9k\u00e9nek n\u00f6vel\u00e9se. Fontos megjegyezni, hogy az 2000 milliszekundumn\u00e1l alacsonyabb \u00e9rt\u00e9k be\u00e1ll\u00edt\u00e1sa n\u00f6veli a h\u00e1l\u00f3zati forgalmat \u00e9s k\u00e9s\u00e9st okozhat a munkav\u00e9gz\u00e9sben, ez\u00e9rt nem aj\u00e1nlott folyamatos haszn\u00e1latra.";
    t[6030] = "Server tunnels, configurable in the <a href=/i2ptunnelmgr>Tunnel Manager</a>, provide a number of ways to limit access to the hosted service. Destination whitelisting, blacklisting, connection throttling, and tunnel filtering are methods provisioned to mitigate denial of service attacks, grant exclusive access to known I2P destinations, and manage traffic to the server.";
    t[6031] = "A szervertunnels, amelyek konfigur\u00e1lhat\u00f3k a Tunnel Managerben, a szolg\u00e1ltat\u00e1shoz val\u00f3 hozz\u00e1f\u00e9r\u00e9s korl\u00e1toz\u00e1s\u00e1ra szolg\u00e1lnak. A c\u00e9l\u00e1llom\u00e1s feh\u00e9r- \u00e9s feketelist\u00e1z\u00e1sa, a kapcsolat sebess\u00e9gkorl\u00e1toz\u00e1sa, valamint az \u00fattal\u00e1ncok sz\u0171r\u00e9se olyan m\u00f3dszerek, amelyeket arra haszn\u00e1lnak, hogy cs\u00f6kkents\u00e9k a kiszolg\u00e1l\u00e1sb\u00f3l val\u00f3 kitilt\u00e1s vesz\u00e9ly\u00e9t, kiz\u00e1r\u00f3lagos hozz\u00e1f\u00e9r\u00e9st biztos\u00edtsanak a ismert I2P c\u00e9l\u00e1llom\u00e1sokhoz, \u00e9s ir\u00e1ny\u00edts\u00e1k a forgalmat a szerverhez.";
