    t[6205] = "Egyes\u00edtett s\u00e1vsz\u00e9less\u00e9g-\u00e1bra";
    t[6214] = "Do not reveal this file to unknown users, as it contains sensitive data (100 RouterInfo files) from your own I2P router which potentially could be used by an adversary to decloak your identity. In order to protect your anonymity: you should wait for a few hours/days before sharing the file with your trusted friend. It is also advisable to use this procedure sparingly (no more than once a week).";
    t[6215] = "Ne fedje fel ezt a f\u00e1jlt ismeretlen felhaszn\u00e1l\u00f3knak, mivel \u00e9rz\u00e9keny adatokat tartalmaz (100 RouterInfo f\u00e1jlok) a saj\u00e1t I2P \u00fatv\u00e1laszt\u00f3j\u00e1b\u00f3l, amelyet egy ellenf\u00e9l haszn\u00e1lhat, hogy leleplezze azonoss\u00e1g\u00e1t. A n\u00e9vtelens\u00e9g v\u00e9delme \u00e9rdek\u00e9ben: v\u00e1rjon n\u00e9h\u00e1ny \u00f3r\u00e1val / nappal azel\u0151tt, hogy megosztja a f\u00e1jlt megb\u00edzhat\u00f3 bar\u00e1tj\u00e1val. Szint\u00e9n tan\u00e1csos \u00f3vatosan haszn\u00e1lni ezt a elj\u00e1r\u00e1st (hetente t\u00f6bbsz\u00f6r ne legyen).";
