    t[6225] = "A(z) {0} friss\u00edt\u00e9si kiszolg\u00e1l\u00f3 nem tal\u00e1lhat\u00f3 a c\u00edmjegyz\u00e9kben";
    t[6228] = "Web Hosting - I2P+";
    t[6229] = "Webt\u00e1rhely - I2P+";
    t[6232] = "Configure";
    t[6233] = "Be\u00e1ll\u00edt";
    t[6244] = "The act of contributing to the network by permitting other routers to build tunnels using your router in a tunnel chain. At least 12KB/s upstream bandwidth (network share) is required to be allocated in order to enable participation. Note that firewalled routers will be limited in how much they contribute to participation, and a router designated as Hidden will not participate at all.";
    t[6245] = "A h\u00e1l\u00f3zatba t\u00f6rt\u00e9n\u0151 hozz\u00e1j\u00e1rul\u00e1s tev\u00e9kenys\u00e9ge, amely m\u00e1s routereknek lehet\u0151v\u00e9 teszi, hogy alagutakat \u00e9p\u00edtsenek a te routeredet haszn\u00e1lva az alag\u00fat sorban. Ahhoz, hogy lehet\u0151v\u00e9 v\u00e1ljon a r\u00e9szv\u00e9tel, sz\u00fcks\u00e9ges legal\u00e1bb 12KB/s f\u00f6lfel\u00e9 ir\u00e1ny\u00fa s\u00e1vsz\u00e9less\u00e9get (h\u00e1l\u00f3zati r\u00e9szesed\u00e9st) hozz\u00e1rendelni. Tekintsd figyelembe, hogy a t\u0171zfalakkal v\u00e9dett routerek korl\u00e1tozva lesznek abban, hogy mennyit j\u00e1rulnak hozz\u00e1 a r\u00e9szv\u00e9telhez, \u00e9s egy Megjel\u00f6lt<br> router egy\u00e1ltal\u00e1n nem vesz r\u00e9szt.";
    t[6246] = "All Routers";
    t[6247] = "\u00d6sszes router";
