    t[6253] = "K\u00c9SLELTETETT";
    t[6258] = "For best participation as a floodfill router, you should open your firewall.";
    t[6259] = "A floodfill routerk\u00e9nt val\u00f3 legoptim\u00e1lisabb k\u00f6zrem\u0171k\u00f6d\u00e9s \u00e9rdek\u00e9ben aj\u00e1nlatos a t\u0171zfal megnyit\u00e1sa.";
    t[6270] = "Determines the maximum number of participating tunnels the router can build. To disable participation completely, set to 0. [Default is 8000, or 2000 if running on Arm or Android]";
    t[6271] = "Meghat\u00e1rozza, hogy a routernak legfeljebb h\u00e1ny r\u00e9sztvev\u0151 alag\u00fatat lehet \u00e9p\u00edteni. Teljes r\u00e9szv\u00e9teli tilalom eset\u00e9n \u00e1ll\u00edtsa 0-ra. [Az alap\u00e9rtelmezett \u00e9rt\u00e9k 8000, vagy ha Arm vagy Android fut, akkor 2000]";
    t[6272] = "Updating unsigned update URL to {0}";
    t[6273] = "Nem al\u00e1\u00edrt friss\u00edt\u0151 URL friss\u00edt\u00e9se a k\u00f6vetkez\u0151re: {0}";
