    t[6280] = "I2P will work best if you configure your rates to match the speed of your internet connection.";
    t[6281] = "Az I2P akkor m\u0171k\u00f6dik legjobban, ha a sebess\u00e9g \u00e9rt\u00e9keidet \u00fagy \u00e1ll\u00edtod be, hogy egyezzen az internetkapcsolatod sebess\u00e9g\u00e9vel.";
