    t[6322] = "Outbound to 32000 only, does not listen on this port. Starts at 31000 and will increment until 31999 looking for a free port. To change, see the <a href=https://wrapper.tanukisoftware.com/doc/english/prop-port.html target=_blank rel=noreferrer class='sitelink external'>wrapper documentation</a>.";
    t[6323] = "Csak kimen\u0151 32000-ig, nem hallgat\u00f3zik ezen a porton. 31000-t\u0151l kezd\u0151dik, \u00e9s eg\u00e9szen 31999-ig n\u00f6vekszik, szabad portot keresve. A v\u00e1ltoztat\u00e1shoz l\u00e1sd a <a href=https://wrapper.tanukisoftware.com/doc/english/prop-port.html target=_blank rel=noreferrer class='sitelink external'>wrapper dokument\u00e1ci\u00f3t</a>.";
