    t[6350] = "This setting determines the number of peers to explore in parallel when the Peer Exploration Job runs [default is 1 peer at a time when more than 3000 peers are known]. Note that increasing this value will increase the bandwidth requirements for the exploration, and setting this value too high may cause excessive message delay and interfere with other services, so use with caution!";
    t[6351] = "Ez a be\u00e1ll\u00edt\u00e1s meghat\u00e1rozza, hogy p\u00e1rhuzamosan h\u00e1ny peert vizsg\u00e1ljon meg a Peer Exploration Job fut\u00e1sakor [az alap\u00e9rtelmezett \u00e9rt\u00e9k az, hogy egyszerre 1 peer-t vizsg\u00e1l, amikor t\u00f6bb mint 3000 peer ismert]. Vegye figyelembe, hogy ez az \u00e9rt\u00e9k n\u00f6veli a s\u00e1vsz\u00e9less\u00e9gig\u00e9nyeket a felder\u00edt\u00e9shez, \u00e9s ha t\u00fal magasra \u00e1ll\u00edtja ezt az \u00e9rt\u00e9ket, ez t\u00falzott \u00fczenetk\u00e9sleltet\u00e9st okozhat \u00e9s akad\u00e1lyozhatja m\u00e1s szolg\u00e1ltat\u00e1sok m\u0171k\u00f6d\u00e9s\u00e9t, ez\u00e9rt legyen \u00f3vatos!";
