    t[6382] = "Note: To enhance your security when browsing .i2p sites, you may wish to consider installing an addon to prevent Javascript from running in the browser such as <a href=https://addons.mozilla.org/en-US/firefox/addon/noscript/ target=_blank rel=noreferrer class='sitelink external'>NoScript</a>, though it's recommended to whitelist the address I2P+ is running on to enable various router console enhancements. In addition, an addon that prevents requests to offsite resources is also recommended, for example <a href=https://addons.mozilla.org/en-US/firefox/addon/umatrix/ target=_blank rel=noreferrer class='sitelink external'>uMatrix</a>.";
    t[6383] = "Megjegyz\u00e9s: Annak \u00e9rdek\u00e9ben, hogy n\u00f6veld a biztons\u00e1got, amikor .i2p oldalakat b\u00f6ng\u00e9szel, \u00e9rdemes lehet egy kieg\u00e9sz\u00edt\u0151t telep\u00edteni, amely megakad\u00e1lyozza a Javascript fut\u00e1s\u00e1t a b\u00f6ng\u00e9sz\u0151ben, p\u00e9ld\u00e1ul az <a href=https://addons.mozilla.org/en-US/firefox/addon/noscript/ target=_blank rel=noreferrer class='sitelink external'>NoScript</a>. Ugyanakkor aj\u00e1nlott megadni az I2P+-t futtat\u00f3 c\u00edm feh\u00e9rlist\u00e1j\u00e1t annak \u00e9rdek\u00e9ben, hogy enged\u00e9lyezze a k\u00fcl\u00f6nb\u00f6z\u0151 router konzol b\u0151v\u00edtm\u00e9nyeket. Emellett aj\u00e1nlott egy olyan kieg\u00e9sz\u00edt\u0151 is, amely megakad\u00e1lyozza a k\u00e9r\u00e9seket a k\u00fcls\u0151 er\u0151forr\u00e1sok fel\u00e9, p\u00e9ld\u00e1ul az <a href=https://addons.mozilla.org/en-US/firefox/addon/umatrix/ target=_blank rel=noreferrer class='sitelink external'>uMatrix</a>.";
