    t[6661] = "Kikapcsol\u00e1s";
    t[6664] = "You will need to configure your browser to use the HTTP proxy server (by default on host: <code>127.0.0.1</code> port: <code>4444</code>). See the <a href=https://geti2p.net/en/about/browser-config target=_blank rel=noreferrer class='sitelink external'>Browser Proxy Configuration Guide</a> for a more detailed explanation.";
    t[6665] = "Be kell \u00e1ll\u00edtania a b\u00f6ng\u00e9sz\u0151j\u00e9t, hogy haszn\u00e1lja az HTTP proxy szervert (alap\u00e9rtelmez\u00e9s szerint az \u00e1llom\u00e1son tal\u00e1lhat\u00f3: <code>127.0.0.1</code> port: <code>4444</code>). Tov\u00e1bbi r\u00e9szletes magyar\u00e1zat\u00e9rt l\u00e1togassa meg a <a href=https://geti2p.net/en/about/browser-config target=_blank rel=noreferrer class='sitelink external'>B\u00f6ng\u00e9sz\u0151 proxy konfigur\u00e1ci\u00f3s \u00fatmutat\u00f3t</a>.";
    t[6666] = "Show all routers with this version in the NetDb";
