    t[6682] = "Local Web Server";
    t[6683] = "Helyi webszerver";
    t[6684] = "For convenience you can maintain a list of destinations in a file and define a threshold for all of them in bulk:";
    t[6685] = "A k\u00e9nyelem \u00e9rdek\u00e9ben fenntarthat egy c\u00e9lpontra vonatkoz\u00f3 list\u00e1t egy f\u00e1jlban, \u00e9s t\u00f6megesen meghat\u00e1rozhat nekik egy hat\u00e1rt:";
    t[6694] = "This setting, when set to true, will display a Peer Test Average readout in the Congestion section of the sidebar, calculated by adding the successful peer test average and the average excess time taken by failed tests. The average value may be used as a guide to determine the optimal <code>router.peerTestTimeout</code> value. [Default is false]";
    t[6695] = "Ez a be\u00e1ll\u00edt\u00e1s, ha igazra van \u00e1ll\u00edtva, megjelen\u00edt egy Peer Test \u00e1tlagot a Congesion r\u00e9szben az oldals\u00e1vban, amit \u00fagy \u00e1llap\u00edtanak meg, hogy a sikeres peer teszt \u00e1tlagot hozz\u00e1adj\u00e1k a sikertelen tesztek sor\u00e1n felhaszn\u00e1lt \u00e1tlagos t\u00fara\u00e1tl\u00e9p\u00e9si id\u0151h\u00f6z. Az \u00e1tlag \u00e9rt\u00e9ket \u00fatmutat\u00f3k\u00e9nt lehet haszn\u00e1lni a legjobb <code>router.peerTesztTimeout</code> \u00e9rt\u00e9k meghat\u00e1roz\u00e1s\u00e1hoz. [Az alap\u00e9rtelmez\u00e9s hamis]";
