    t[6762] = "I2P+ may be slow to integrate into network the first time you run it as it bootstraps into the network and learns of additional peers. The longer your I2P+ router is running, the better it will perform, so try and keep your router on as long as you can, 24/7 if possible! If, after 30 minutes, your <i>Active: [connected/recent]</i> count still has less than 10 peers, or your total number of <i>Integrated</i> peers is less than 5, there are several things you can do to check for problems:";
    t[6763] = "Az I2P+ eltart egy ideig, mire teljesen integr\u00e1l\u00f3dik a h\u00e1l\u00f3zatba az els\u0151 futtat\u00e1s sor\u00e1n, mivel ezalatt be\u00e1ll\u00edt\u00f3dik \u00e9s megtanulja az \u00faj kapcsol\u00f3d\u00e1si pontokat. Min\u00e9l hosszabb ideig fut az I2P+ \u00fatv\u00e1laszt\u00f3, ann\u00e1l jobb lesz a teljes\u00edtm\u00e9nye, ez\u00e9rt pr\u00f3b\u00e1lja tartani be a lehet\u0151s\u00e9gek szerint min\u00e9l hosszabb ideig a kapcsolatot, ak\u00e1r 24/7! Ha 30 perc eltelt\u00e9vel a <i>Akt\u00edv: [kapcsol\u00f3dott/\u00fajonnan]</i> sz\u00e1ml\u00e1l\u00f3ban m\u00e9g mindig kevesebb, mint 10 kapcsolatpont tal\u00e1lhat\u00f3, vagy az <i>Integr\u00e1lt</i> kapcsolatpontok \u00f6sszes sz\u00e1ma kevesebb, mint 5, akkor t\u00f6bb dologra kell ellen\u0151riznie a lehets\u00e9ges probl\u00e9m\u00e1k kiz\u00e1r\u00e1sa \u00e9rdek\u00e9ben:";
