    t[6925] = "\u00dagy \u00e1ll\u00edtottad, be az I2P-t, hogy t\u00f6bb, mint 128KBps s\u00e1vsz\u00e9less\u00e9get osszon meg, de t\u0171zfalazva vagy.";
    t[6928] = "Bugs in the device's UPnP implementation";
    t[6929] = "Hib\u00e1k az eszk\u00f6z UPnP implement\u00e1ci\u00f3j\u00e1ban";
    t[6942] = "High capacity";
    t[6943] = "Nagy kapacit\u00e1s\u00fa";
    t[6944] = "A java implementation of a Tor client, available as an I2P plugin. Can be used as the default <i>outproxy</i> if configured in the relevant SOCKS or HTTP client tunnel in the <i>Tunnel Manager</i>. Available from <a href=http://stats.i2p/i2p/plugins class=sitelink>http://stats.i2p/i2p/plugins</a>. Source code is available on <a href=https://github.com/i2p/i2p.plugins.orchid class='sitelink external' target=_blank rel=noreferrer>github</a>.";
    t[6945] = "Egy java implement\u00e1ci\u00f3ja a Tor kliensnek, el\u00e9rhet\u0151 I2P plugink\u00e9nt. Ha a megfelel\u0151 SOCKS vagy HTTP \u00fcgyf\u00e9l alag\u00fatban a <i>Tunnel Manager</i> lett be\u00e1ll\u00edtva az alap\u00e9rtelmezett <i>outproxy</i> -k\u00e9nt van haszn\u00e1lva. El\u00e9rhet\u0151 itt: <a href=http://stats.i2p/i2p/plugins class=sitelink>http://stats.i2p/i2p/plugins</a>. A forr\u00e1sk\u00f3d el\u00e9rhet\u0151 a  <a href=https://github.com/i2p/i2p.plugins.orchid class='sitelink external' target=_blank rel=noreferrer>Github</a> -on.";
    t[6952] = "IPv4 Addresses";
    t[6953] = "IPv4 c\u00edmek";
    t[6956] = "This section indicates your average bandwidth speeds and total usage for the session. All values are in bytes per second. You may change your bandwidth limits on the <a href='/config'>Bandwidth Configuration page</a>. The more bandwidth you make available, the more you help the network and improve your own anonymity, so please take the time to review the settings. If you are unsure of your network's speed, using a service such as <a href='http://speedtest.net/'>SpeedTest</a> or similar will give you a good indication of your bandwidth capability. Your upstream share amount (KBps Out) will determine your overall contribution to the network. Bandwidth is <a href='/graphs'>graphed</a> by default.";
    t[6957] = "A szakasz az \u00e1tlagos adatsebess\u00e9g\u00e9t \u00e9s az aktu\u00e1lis munkamenetben el\u00e9rt teljes adatforgalm\u00e1t jelzi. Az \u00f6sszes \u00e9rt\u00e9k m\u00e1sodpercenk\u00e9nti b\u00e1jtban \u00e9rtend\u0151. A s\u00e1vsz\u00e9less\u00e9gkorl\u00e1tokat megv\u00e1ltoztathatja a <a href='/config'>S\u00e1vsz\u00e9less\u00e9g be\u00e1ll\u00edt\u00e1sok oldalon</a>. Min\u00e9l t\u00f6bb s\u00e1vsz\u00e9less\u00e9get tesz el\u00e9rhet\u0151v\u00e9, ann\u00e1l jobban seg\u00edti a h\u00e1l\u00f3zatot \u00e9s jav\u00edtja az \u00f6n anonimit\u00e1s\u00e1t, ez\u00e9rt k\u00e9rj\u00fck, vegyen id\u0151t a be\u00e1ll\u00edt\u00e1sok \u00e1ttekint\u00e9s\u00e9re. Ha bizonytalan a h\u00e1l\u00f3zata sebess\u00e9g\u00e9t illet\u0151en, olyan szolg\u00e1ltat\u00e1sok haszn\u00e1lata, mint p\u00e9ld\u00e1ul a <a href='http://speedtest.net/'>SpeedTest</a> vagy hasonl\u00f3, j\u00f3 becsl\u00e9st adhatnak a s\u00e1vsz\u00e9less\u00e9g kapacit\u00e1s\u00e1r\u00f3l. A felt\u00f6lt\u00e9si s\u00e1vad mennyis\u00e9ge (Kib\u00e1jt m\u00e1sodpercenk\u00e9nt) hat\u00e1rozza meg az \u00e1ltal\u00e1nos hozz\u00e1j\u00e1rul\u00e1s\u00e1t a h\u00e1l\u00f3zathoz. A s\u00e1vsz\u00e9less\u00e9get <a href='/graphs'>alap\u00e9rtelmezetten grafikusan \u00e1br\u00e1zoljuk</a>.";
