    t[7004] = "This setting allows you to configure the minimum number of hosted participating tunnels before the router starts to reject tunnel requests based on anticipated bandwidth requirements. [Default is 100 if system is running Android, 800 if system is running on ARM and less than 4 cores available, 1200 if system is running on ARM and 4 or more cores available, otherwise 2500]";
    t[7005] = "Ezzel a be\u00e1ll\u00edt\u00e1ssal konfigur\u00e1lhatja a minim\u00e1lis t\u00e1rolt r\u00e9sztvev\u0151 alagutak sz\u00e1m\u00e1t, miel\u0151tt a router elutas\u00edtja az alagt\u00fara vonatkoz\u00f3 k\u00e9relmeket az el\u0151re v\u00e1rhat\u00f3 s\u00e1vsz\u00e9less\u00e9g alapj\u00e1n. [Alap\u00e9rtelmezett \u00e9rt\u00e9k: 100, ha az rendszer Androidot futtat, 800, ha az rendszer ARM-en fut \u00e9s kevesebb, mint 4 mag \u00e1ll rendelkez\u00e9sre, 1200, ha az rendszer ARM-en fut \u00e9s 4 vagy t\u00f6bb mag \u00e1ll rendelkez\u00e9sre, k\u00fcl\u00f6nben 2500]";
    t[7012] = "Delete key";
