    t[7022] = "This setting (in milliseconds) allows you to manually configure the queue delay target value for the CoDel queue management system. Default is 50ms. [Restart required]";
    t[7023] = "Ez a be\u00e1ll\u00edt\u00e1s (ezredm\u00e1sodpercben) lehet\u0151v\u00e9 teszi, hogy manu\u00e1lisan be\u00e1ll\u00edtsa a v\u00e1rakoz\u00e1si sor k\u00e9sleltet\u00e9s c\u00e9rt\u00e9ket a CoDel v\u00e1rakoz\u00e1si sorkezel\u0151 rendszer\u00e9hez. Az alap\u00e9rtelmezett \u00e9rt\u00e9k 50 ms. [\u00dajraind\u00edt\u00e1s sz\u00fcks\u00e9ges]";
    t[7030] = "In order to maintain anonymity, it is recommended to update using the I2P http proxy. If the news or I2P update is hosted on I2P, using the proxy will be necessary.";
    t[7031] = "Az anonimit\u00e1s meg\u0151rz\u00e9se \u00e9rdek\u00e9ben aj\u00e1nlatos az I2P http proxy haszn\u00e1lat\u00e1val friss\u00edteni. Ha a h\u00edrt vagy az I2P-friss\u00edt\u00e9st I2P-n t\u00e1rolj\u00e1k, a proxy haszn\u00e1lat\u00e1ra lesz sz\u00fcks\u00e9g.";
    t[7054] = "A threshold to apply to remote destinations listed in a file";
    t[7055] = "Egy k\u00fcsz\u00f6b\u00e9rt\u00e9k alkalmaz\u00e1sa egy f\u00e1jlban felsorolt t\u00e1voli c\u00e9l\u00e1llom\u00e1sra";
    t[7062] = "The su3 format is preferred, as it will be verified as signed by a trusted source.";
    t[7063] = "A su3 form\u00e1tumot r\u00e9szes\u00edtj\u00fck el\u0151nyben, mivel azt egy megb\u00edzhat\u00f3 forr\u00e1s al\u00e1\u00edrja-e.";
    t[7064] = "Specify hostname or IP address";
