    t[7076] = "However, if you experience a tunnel failure, all your services will go offline at the same time, so in some scenarios you may wish to configure client services to use their own set of tunnels.";
    t[7077] = "Azonban, ha alag\u00fathiba l\u00e9p fel, akkor minden szolg\u00e1ltat\u00e1s egyszerre kiesik az online \u00e1llapotb\u00f3l, ez\u00e9rt n\u00e9h\u00e1ny forgat\u00f3k\u00f6nyvben meg k\u00edv\u00e1nja adni, hogy a kliens szolg\u00e1ltat\u00e1sok a saj\u00e1t alag\u00fatk\u00e9szlet\u00fcket haszn\u00e1lj\u00e1k.";
