    t[7150] = "Critical error";
    t[7151] = "Kritikus hiba";
    t[7158] = "I2P does not work well behind this type of firewall. You will probably not be able to accept inbound connections, which will limit your participation in the network.";
    t[7159] = "Az I2P nem m\u0171k\u00f6dik ilyen t\u00edpus\u00fa t\u0171zfal m\u00f6g\u00fcl. Val\u00f3sz\u00edn\u0171leg nem lesz lehets\u00e9ges bej\u00f6v\u0151 kapcsolatok fogad\u00e1sa, mely korl\u00e1tozni fogja a h\u00e1l\u00f3zatban val\u00f3 r\u00e9szv\u00e9telt.";
    t[7166] = "The I2P Client Protocol (I2CP) enables external applications (clients) to communicate with I2P over single TCP socket, by default using port 7654. For more information, see the <a href=https://geti2p.net/en/docs/protocol/i2cp class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7167] = "Az I2P \u00fcgyf\u00e9lprotokoll (I2CP) lehet\u0151v\u00e9 teszi a k\u00fcls\u0151 alkalmaz\u00e1sok (kliensek) sz\u00e1m\u00e1ra az I2P-vel t\u00f6rt\u00e9n\u0151 kommunik\u00e1ci\u00f3t egyetlen TCP-socketen kereszt\u00fcl, alap\u00e9rtelmez\u00e9s szerint a 7654-es portot haszn\u00e1lva. Tov\u00e1bbi inform\u00e1ci\u00f3\u00e9rt l\u00e1sd a(z) <a href=https://geti2p.net/en/docs/protocol/i2cp class='sitelink external' target=_blank rel=noreferrer>online dokument\u00e1ci\u00f3t</a>.";
    t[7168] = "Queue Totals";
    t[7169] = "V\u00e1r\u00f3lista \u00f6sszesen";
    t[7170] = "This setting determines which transport takes priority when communicating with peers. By default, NTCP is favored over UDP (SSU). By setting the value to true, UDP will be favored unless a pre-existing NTCP connection exists; when set to always, UDP will always be used regardless of any pre-existing NTCP connection. [Default is false]";
    t[7171] = "Ez a be\u00e1ll\u00edt\u00e1s meghat\u00e1rozza, hogy melyik \u00e1tviteli m\u00f3d kap el\u0151nyt a t\u00f6bbi r\u00e9sztvev\u0151vel val\u00f3 kommunik\u00e1ci\u00f3 sor\u00e1n. Alap\u00e9rtelmez\u00e9s szerint az NTCP kedvez a UDP (SSU) el\u0151tt. Az \u00e9rt\u00e9k true-ra \u00e1ll\u00edt\u00e1s\u00e1val az UDP lesz az els\u0151dleges, hacsak nem l\u00e9tezik el\u0151re meghat\u00e1rozott NTCP kapcsolat; ha mindigre van \u00e1ll\u00edtva, mindig az UDP-t haszn\u00e1lja, f\u00fcggetlen\u00fcl az el\u0151re meghat\u00e1rozott NTCP kapcsolatt\u00f3l. [Az alap\u00e9rt\u00e9k false]";
    t[7174] = "Translation Status";
    t[7175] = "Ford\u00edt\u00e1si \u00e1llapot";
    t[7184] = "I2P Version and Running Environment";
    t[7185] = "I2P Verzi\u00f3 \u00e9s Futtat\u00e1si K\u00f6rnyezet";
    t[7188] = "Tunnel Filters";
    t[7189] = "Alag\u00fatsz\u0171r\u0151k";
    t[7194] = "You have not configured inbound TCP with a hostname and port on the Network Configuration page, however you have disabled UDP.";
    t[7195] = "Nem konfigur\u00e1lta a bej\u00f6v\u0151 TCP-t gazdag\u00e9pn\u00e9vvel \u00e9s porttal a H\u00e1l\u00f3zati konfigur\u00e1ci\u00f3 oldalon, de letiltotta az UDP-t.";
    t[7200] = "Certificates are used to authenticate encrypted services running on the network, provision optional SSL for hosted services and the router console, or provide proof of ownership of a router family.";
    t[7201] = "A tan\u00fas\u00edtv\u00e1nyokat a h\u00e1l\u00f3zaton fut\u00f3 titkos\u00edtott szolg\u00e1ltat\u00e1sok hiteles\u00edt\u00e9s\u00e9re, opcion\u00e1lis SSL biztos\u00edt\u00e1s\u00e1ra haszn\u00e1lj\u00e1k a hosztolt szolg\u00e1ltat\u00e1sokhoz \u00e9s az \u00fatv\u00e1laszt\u00f3konzolhoz, vagy igazolj\u00e1k az \u00fatv\u00e1laszt\u00f3 csal\u00e1d tulajdonjog\u00e1t.";
