    t[7285] = "Az \u00f6sszegy\u0171jt\u00f6tt adat 1 perces id\u0151tartamra van korl\u00e1tozva, ez\u00e9rt becsl\u00e9sk\u00e9nt haszn\u00e1land\u00f3.";
    t[7292] = "When set to true, I2P runs without network connectivity, which is helpful if you are constantly restarting the router to test code updates as this prevents network disruption.";
    t[7293] = "Ha az \u00e9rt\u00e9k igaz-ra van \u00e1ll\u00edtva, az I2P h\u00e1l\u00f3zati kapcsolat n\u00e9lk\u00fcl fut, ami hasznos lehet, ha folyamatosan \u00fajraind\u00edtja a routert a k\u00f3dfriss\u00edt\u00e9sek tesztel\u00e9s\u00e9hez, mivel ez megakad\u00e1lyozza a h\u00e1l\u00f3zat megszakad\u00e1s\u00e1t.";
    t[7302] = "Updating IP address";
    t[7303] = "IP c\u00edm friss\u00edt\u00e9se";
    t[7308] = "SSU [IPv6 Only] with Introducers";
    t[7309] = "Csak IPv6 SSU, bevezet\u0151k";
    t[7312] = "SSU (Secure Semi-reliable UDP) is an I2P network transport providing encrypted, connection-oriented, point-to-point connections, in addition to IP address detection and NAT traversal services. For more information, see the <a href=https://geti2p.net/en/docs/transport/ssu class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7313] = "Az SSU (Biztons\u00e1gos F\u00e9lmegb\u00edzhat\u00f3 UDP) egy I2P h\u00e1l\u00f3zat \u00e1tviteli r\u00e9teg, amely titkos\u00edtott, kapcsolatalap\u00fa, pont-pont kapcsolatokat biztos\u00edt, tov\u00e1bb\u00e1 IP-c\u00edm-\u00e9rz\u00e9kel\u00e9st \u00e9s NAT-\u00e1tereszt\u00e9si szolg\u00e1ltat\u00e1sokat. Tov\u00e1bbi inform\u00e1ci\u00f3\u00e9rt l\u00e1sd a <a href=https://geti2p.net/en/docs/transport/ssu class='sitelink external' target=_blank rel=noreferrer>online dokument\u00e1ci\u00f3t</a>.";
    t[7314] = "Congestion window";
    t[7315] = "Torl\u00f3d\u00e1s ablak";
    t[7326] = "Use Proxy to Reseed";
    t[7327] = "Haszn\u00e1lja a Proxyt az \u00fajrat\u00f6lt\u00e9shez";
    t[7328] = "Until the advent of I2P integration in <a href=http://www.vuze.com/ target=_blank rel=noreferrer class='sitelink external'>Vuze</a>, it wasn't possible to download torrents that weren't hosted on the I2P network. However, now that Vuze (and latterly <a href=https://www.biglybt.com/ target=_blank rel=noreferrer class='sitelink external'>Bigly</a>) allow users to share non-I2P torrents on I2P, non-I2P torrents can be downloaded over I2P if Vuze/Bigly users have chosen to make content available to the I2P network. Popular torrents with a large number of peers are more likely to be accessible via I2P; to determine if the content is available, add the torrent link, magnet or infohash to your I2P-enabled BitTorrent client.";
    t[7329] = "Az I2P integr\u00e1ci\u00f3 el\u00f5tt <a href=http://www.vuze.com/ target=_blank rel=noreferrer class='sitelink external'>Vuze</a>-ban nem lehetett let\u00f6lteni a I2P h\u00e1l\u00f3zaton k\u00edv\u00fcl helyezett torrenteket. Viszont most m\u00e1r Vuze (n\u00e9h\u00e1ny esetben <a href=https://www.biglybt.com/ target=_blank rel=noreferrer class='sitelink external'>Bigly</a>) lehet\u00f5v\u00e9 teszi a felhaszn\u00e1l\u00f3knak, hogy I2P-n k\u00edv\u00fcli torrenteket osszanak meg az I2P-n kereszt\u00fcl, \u00edgy nem-I2P torrentek let\u00f6lthet\u0151ek az I2P-n kereszt\u00fcl, ha a Vuze/Bigly felhaszn\u00e1l\u00f3k \u00fagy d\u00f6ntenek, hogy a tartalmat el\u00e9rhet\u0151v\u00e9 teszik az I2P h\u00e1l\u00f3zaton. N\u00e9pszer\u0171 torrentek, amik sok peer-rel rendelkeznek, nagyobb val\u00f3sz\u00edn\u0171s\u00e9ggel \u00e9rhet\u0151k el az I2P-n kereszt\u00fcl; hogy meg\u00e1llap\u00edtsd, hogy a tartalom el\u00e9rhet\u0151-e, add hozz\u00e1 a torrent linket, magnett vagy az infohash-t az I2P-vel \u00f6sszekapcsolhat\u00f3 BitTorrent kliensedhez.";
