    t[7428] = "This setting (in hours) determines how old a RouterInfo in the NetDb is (its last known publication date) before it's classified as stale and deleted. [Default is 28 hours unless the router is a Floodfill, in which case the default is 8 hours]";
    t[7429] = "Ez a be\u00e1ll\u00edt\u00e1s (\u00f3r\u00e1kat) meghat\u00e1rozza, hogy mennyi id\u0151s egy RouterInfo az NetDb-ban (utols\u00f3 ismert k\u00f6zz\u00e9t\u00e9teli d\u00e1tuma) miel\u0151tt elavultnak \u00e9s t\u00f6rlend\u0151nek min\u0151s\u00fcl. [Az alap\u00e9rtelmezett \u00e9rt\u00e9k 28 \u00f3ra, hacsak a router nem Floodfill, ebben az esetben az alap\u00e9rtelmezett \u00e9rt\u00e9k 8 \u00f3ra]";
