    t[7439] = "A kieg\u00e9sz\u00edt\u0151 friss\u00edt\u00e9s let\u00f6lt\u00e9se m\u00e1r folyamatban van.";
    t[7440] = "Log file";
    t[7441] = "Napl\u00f3f\u00e1jl";
    t[7442] = "Router Help and FAQ";
    t[7443] = "Router S\u00fag\u00f3 \u00e9s GYIK";
    t[7444] = "If a <i>Registration Authentication</i> string is requested, you can find it on the <a href='http://127.0.0.1:7657/i2ptunnel/register?tunnel=3'>Registration Authentication page</a> linked from the <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>. Registration authentication ensures only the owner is able to register or otherwise manage the hostname, and is required on stats.i2p and reg.i2p.";
    t[7445] = "Ha a <i>Regisztr\u00e1ci\u00f3s hiteles\u00edt\u00e9si</i> karaktersorozatra van sz\u00fcks\u00e9g, megtal\u00e1lja a <a href='http://127.0.0.1:7657/i2ptunnel/register?tunnel=3'>Regisztr\u00e1ci\u00f3s hiteles\u00edt\u00e9si oldalon</a>, amely a <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnel Manager konfigur\u00e1ci\u00f3s oldalr\u00f3l van hivatkozva. A regisztr\u00e1ci\u00f3s hiteles\u00edt\u00e9s biztos\u00edtja, hogy csak az tulajdonosa tudja regisztr\u00e1lni vagy m\u00e1s m\u00f3don kezelni a hosztn\u00e9vet, \u00e9s sz\u00fcks\u00e9ges a stats.i2p \u00e9s reg.i2p oldalakon.";
    t[7448] = "News &amp; Updates";
    t[7449] = "H\u00edrek &amp; Friss\u00edt\u00e9sek";
    t[7452] = "[Linux/Unix/Solaris] If you can't start the router with <code>i2p/i2prouter start</code> try the <code>runplain.sh</code> script in the same directory. Root privileges are never required to run I2P+. If you need to compile the <a href=http://i2p-projekt.i2p/jbigi.html target=_blank rel=noreferrer>jBigi library</a> (which is necessary in rare cases), consult the documentation, visit the forums, or visit <a href=irc://127.0.0.1:6668/saltR class=chatlink>the I2P+ channel</a> or <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink>IRC developer channel</a>.";
    t[7453] = "[Linux/Unix/Solaris] Ha nem tudod elind\u00edtani a routert a <code>i2p/i2prouter start</code> paranccsal, pr\u00f3b\u00e1ld ki a <code>runplain.sh</code> szkriptet ugyanabban a k\u00f6nyvt\u00e1rban. A root jogosults\u00e1g soha nem sz\u00fcks\u00e9ges az I2P+ futtat\u00e1s\u00e1hoz. Ha sz\u00fcks\u00e9ged van a <a href=http://i2p-projekt.i2p/jbigi.html target=_blank rel=noreferrer>jBigi k\u00f6nyvt\u00e1r</a> ford\u00edt\u00e1s\u00e1ra (ritka esetekben sz\u00fcks\u00e9ges), n\u00e9zd \u00e1t az dokument\u00e1ci\u00f3t, l\u00e1togasd meg a f\u00f3rumokat, vagy ugorj be <a href=irc://127.0.0.1:6668/saltR class=chatlink>az I2P+ csatorn\u00e1ra</a> vagy a <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink>fejleszt\u0151i IRC csatorn\u00e1ra</a>.";
    t[7454] = "Top 50 peers by transit tunnel requests";
    t[7455] = "Az 50 legn\u00e9pszer\u0171bb partner a tranzit alag\u00fat k\u00e9relmek szerint";
    t[7458] = "Information defining the unique identity of a router on the network which includes its IP address (or the IP addresses of intermediate introducers) and listening port, public signing and encryption keys. Router identities correlate to peers in the NetDB. Also referred to as a <i>RouterInfo</i>.";
    t[7459] = "Inform\u00e1ci\u00f3, amely meghat\u00e1rozza a routert azonos\u00edt\u00f3 jelleg\u00e9t a h\u00e1l\u00f3zaton, bele\u00e9rtve az IP-c\u00edm\u00e9t (vagy k\u00f6zvet\u00edt\u0151 bevezet\u0151k IP-c\u00edmeit) \u00e9s az akt\u00edv portj\u00e1t, valamint a nyilv\u00e1nos al\u00e1\u00edr\u00e1st \u00e9s az titkos\u00edt\u00e1si kulcsait. A router azonos\u00edt\u00f3k kapcsolatban vannak az I2P h\u00e1l\u00f3zatban tal\u00e1lhat\u00f3 t\u00e1rsakkal. Egyben <i>RouterInfo</i> -k\u00e9nt is ismert.";
