    t[7682] = "Destination";
    t[7683] = "C\u00e9l\u00e1llom\u00e1s";
    t[7690] = "A distributed database containing router contact information (RouterInfos) and destination contact information (LeaseSets). A single router maintains its own (partial) database for communicating with other routers on the network; no single router will maintain a list of all routers. The RouterInfos are stored on disk and read into memory when the router starts, or when new RouterInfos are acquired. Also referred to as the <i>NetDb</i>. For more information, see the <a href=https://geti2p.net/en/docs/how/network-database class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7691] = "Egy k\u00f6zpontos\u00edtott adatb\u00e1zis, amely tartalmazza a router kapcsolat adatait (RouterInfos) \u00e9s a c\u00e9ladatkapcsolat adatait (LeaseSets). Egy router saj\u00e1t (r\u00e9szleges) adatb\u00e1zist tart fenn m\u00e1s routerekkel val\u00f3 kommunik\u00e1ci\u00f3hoz a h\u00e1l\u00f3zaton; egyetlen router sem fogja fenntartani az \u00f6sszes router list\u00e1j\u00e1t. A RouterInfos lemezen t\u00e1rol\u00f3dnak, \u00e9s a router ind\u00edt\u00e1sakor, vagy \u00faj RouterInfos szerz\u00e9sekor beolvass\u00e1k a mem\u00f3ri\u00e1ba. Ismert is mint a <i>NetDb</i>. Tov\u00e1bbi inform\u00e1ci\u00f3\u00e9rt l\u00e1sd az <a href=https://geti2p.net/en/docs/how/network-database class='sitelink external' target=_blank rel=noreferrer>online dokument\u00e1ci\u00f3t</a>.";
    t[7692] = "Address";
    t[7693] = "C\u00edm";
    t[7694] = "A threshold is defined by the number of connection attempts a remote destination is permitted to perform over a specified number of seconds before a \"breach\" occurs.";
    t[7695] = "A mennyis\u00e9gi k\u00fcsz\u00f6b\u00f6t a t\u00e1voli c\u00e9l\u00e1llom\u00e1ssal v\u00e9gzett kapcsol\u00f3d\u00e1si k\u00eds\u00e9rletek sz\u00e1ma hat\u00e1rozza meg, amelyeket enged\u00e9lyeznek egy meghat\u00e1rozott m\u00e1sodperces id\u0151tartamon bel\u00fcl, miel\u0151tt egy \u201et\u00fall\u00e9p\u00e9s\u201d bek\u00f6vetkezik.";
    t[7704] = "Clearnet normally refers to the publicly accessible internet, the opposite of the darknet that typically describes the encrypted, anonymous services built on I2P, Tor etc. For more information, see the <a href=https://en.wikipedia.org/wiki/Clearnet_(networking) class='sitelink external' target=_blank rel=noreferrer>Wikipedia article</a>.";
    t[7705] = "A Clearnet \u00e1ltal\u00e1ban a nyilv\u00e1nosan el\u00e9rhet\u0151 internetre utal, a s\u00f6t\u00e9th\u00e1l\u00f3 ellenkez\u0151je, amely tipikusan az I2P, Tor, stb. titkos\u00edtott, anonim szolg\u00e1ltat\u00e1sait mutatja be. Tov\u00e1bbi inform\u00e1ci\u00f3\u00e9rt l\u00e1sd a <a href=https://en.wikipedia.org/wiki/Clearnet_(networking) class='sitelink external' target=_blank rel=noreferrer>Wikipedia cikket</a>.";
    t[7712] = "Restore minimal default";
