    t[7818] = "Defines the maximum number of parallel <a href=/jobs>jobs</a> that can be run. The default value is determined by the amount of memory allocated to the JVM via <code>wrapper.config</code>, and is set at 3 for less than 64MB, 4 for less than 256M, or 5 for more than 256MB. Note: A change to this setting requires a restart of the router.";
    t[7819] = "Meghat\u00e1rozza a futtathat\u00f3 p\u00e1rhuzamos <a href=/jobs>munkafolyamatok</a> maxim\u00e1lis sz\u00e1m\u00e1t. Az alap\u00e9rt\u00e9k a JVM-nek a <code>wrapper.config</code> seg\u00edts\u00e9g\u00e9vel rendelt mem\u00f3riamennyis\u00e9gt\u0151l f\u00fcgg: 3, ha kevesebb, mint 64MB, 4, ha kevesebb, mint 256MB, vagy 5, ha 256MB-n\u00e1l t\u00f6bb. Megjegyz\u00e9s: A be\u00e1ll\u00edt\u00e1s megv\u00e1ltoztat\u00e1sa a router \u00fajraind\u00edt\u00e1s\u00e1t ig\u00e9nyli.";
