    t[7990] = "A router on the network tasked with providing and receiving information about other routers and services on the network. The current minimum share bandwidth for a router to be considered as capable of performing floodfill duties is 128 KBytes/sec, though it's possible to override this requirement and force a router to be a floodfill on the <a href=/configadvanced>Advanced Configuration page</a>. For more information, see the <a href=https://geti2p.net/en/docs/how/network-database#floodfill class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7991] = "Egy k\u00f6zvet\u00edt\u0151 a h\u00e1l\u00f3zaton, amelynek feladata m\u00e1s k\u00f6zvet\u00edt\u0151kkel \u00e9s szolg\u00e1ltat\u00e1sokkal kapcsolatos inform\u00e1ci\u00f3k megad\u00e1sa \u00e9s fogad\u00e1sa a h\u00e1l\u00f3zaton. Az aktu\u00e1lis minim\u00e1lis osztozott s\u00e1vsz\u00e9less\u00e9g a k\u00f6zvet\u00edt\u0151 sz\u00e1m\u00e1ra ahhoz, hogy k\u00e9pesnek tekinthet\u0151 legyen a tulajdon\u00e1ban l\u00e9v\u0151 floodfill feladatok elv\u00e9gz\u00e9s\u00e9re, 128 KByte/sec, b\u00e1r lehets\u00e9ges fel\u00fclb\u00edr\u00e1lni ezt az elv\u00e1r\u00e1st \u00e9s k\u00e9nyszer\u00edteni a k\u00f6zvet\u00edt\u0151t a floodfill funkci\u00f3ra a <a href=/configadvanced>Speci\u00e1lis Konfigur\u00e1ci\u00f3s oldalon</a>. Tov\u00e1bbi inform\u00e1ci\u00f3\u00e9rt l\u00e1sd az <a href=https://geti2p.net/en/docs/how/network-database#floodfill class='sitelink external' target=_blank rel=noreferrer>online dokument\u00e1ci\u00f3t</a>.";
