    t[8207] = "Elindult";
    t[8208] = "Wherever possible, assets that are used repeatedly on your site should be loaded from an external file and not inlined. If you're using the same CSS on several pages, create a separate css file and load that in the <code>&lt;head&gt;</code> section of your pages. This will make styling updates to your site easier to manage, and will also allow the file to be cached in the visitor's browser, resulting in less bandwidth demands on your webserver and faster page loads for your visitors.";
    t[8209] = "Ahol lehets\u00e9ges, az oldal\u00e1n ism\u00e9tl\u0151d\u0151en haszn\u00e1lt er\u0151forr\u00e1sokat k\u00fcls\u0151 file-b\u00f3l kell bet\u00f6lteni, ne legyenek be\u00e1gyazva. Ha t\u00f6bb oldalon is ugyanaz a CSS haszn\u00e1latos, akkor k\u00e9sz\u00edtsen k\u00fcl\u00f6n css file-t \u00e9s ezt t\u00f6ltse be az oldala <code>&lt;head&gt;</code> szekci\u00f3j\u00e1ba. Ez megk\u00f6nny\u00edti az oldal kin\u00e9zet\u00e9nek friss\u00edt\u00e9s\u00e9t, \u00e9s lehet\u0151v\u00e9 teszi a file gyors\u00edt\u00f3t\u00e1rban t\u00e1rol\u00e1s\u00e1t a l\u00e1togat\u00f3 b\u00f6ng\u00e9sz\u0151j\u00e9ben, ez\u00e1ltal kevesebb s\u00e1vsz\u00e9less\u00e9get ig\u00e9nyel az \u00f6n webszerver\u00e9t\u0151l \u00e9s gyorsabb bet\u00f6lt\u00e9st eredm\u00e9nyez a l\u00e1togat\u00f3k sz\u00e1m\u00e1ra.";
