    t[8252] = "Help Section";
    t[8253] = "S\u00fag\u00f3 szekci\u00f3";
    t[8256] = "Configuring I2P+: Network, Firefox, Tunnel Manager";
    t[8257] = "Az I2P+ konfigur\u00e1l\u00e1sa: H\u00e1l\u00f3zat, Firefox, Tunnelszerkezt\u0151";
    t[8258] = "If you think you have opened up your firewall and I2P still thinks you are firewalled, remember that you may have multiple firewalls, for example both software packages and external hardware routers.";
    t[8259] = "Ha szerinted m\u00e1r megnyitottad a t\u0171zfalad \u00e9s az I2P m\u00e9g mindig \u00fagy l\u00e1tja, hogy t\u0171zfalazva vagy, k\u00e9rlek, tartsd szem el\u0151tt, hogy lehet t\u00f6bb t\u0171zfal is, p\u00e9ld\u00e1ul szoftveres \u00e9s k\u00fcls\u0151 hardver routerek.";
    t[8270] = "The keyword <i class=example>deny</i>. This threshold is always breached, i.e. no connection attempts will be allowed.";
    t[8271] = "A kulcssz\u00f3 <i class=example>deny</i> haszn\u00e1lata. Ez a k\u00fcsz\u00f6b mindig meghaladhat\u00f3, vagyis nincs kapcsol\u00f3d\u00e1si k\u00eds\u00e9rlet enged\u00e9lyezve.";
    t[8282] = "log visitors making 90 or more connections a minute";
    t[8283] = "napl\u00f3zza azon l\u00e1togat\u00f3kat, akik percenk\u00e9nt 90 vagy t\u00f6bb kapcsolatot hoznak l\u00e9tre";
    t[8286] = "You have configured inbound TCP, however your UDP port is firewalled, and therefore it is likely that your TCP port is firewalled as well.";
    t[8287] = "Be\u00e1ll\u00edtottad a bej\u00f6v\u0151 TCP-t, azonban az UDP portod t\u0171zfalazva van \u00e9s ez\u00e9rt val\u00f3sz\u00edn\u0171, hogy a TCP portod is t\u0171zfalazva van.";
    t[8296] = "This is the number of peers your router will use for network database inquiries. These are usually the <i>floodfill</i> routers which are responsible for maintaining network integrity. Your well integrated peers are shown on the bottom of the <a href='/profiles'>Profiles page</a>.";
    t[8297] = "Ez azon csom\u00f3pontok sz\u00e1ma amiket a routered haszn\u00e1l a h\u00e1l\u00f3zat adatb\u00e1zisk\u00e9rd\u00e9sek lefuttat\u00e1s\u00e1hoz. \u00c1ltal\u00e1ban ezek az <i>floodfill</i> routerek, amelyek felel\u0151sek a h\u00e1l\u00f3zati integrit\u00e1s fenntart\u00e1s\u00e1\u00e9rt. A j\u00f3l integr\u00e1lt csom\u00f3pontjaidat az <a href='/profiles'>Profilok oldalon</a> tal\u00e1lod.";
    t[8298] = "Manage Router webapps";
    t[8299] = "Router webalkalmaz\u00e1sok kezel\u00e9se";
    t[8302] = "Outbound TCP from random high ports to arbitrary remote TCP ports.";
    t[8303] = "Kimen\u0151 TCP v\u00e9letlenszer\u0171 magas portokb\u00f3l tetsz\u0151leges t\u00e1voli TCP portokra.";
    t[8310] = "When you start I2P, it may take a few minutes to bootstrap (integrate) your router into the network and find additional peers, so please be patient.";
    t[8311] = "Amikor elind\u00edtja az I2P-t, eltarthat n\u00e9h\u00e1ny percig, am\u00edg az \u00fatv\u00e1laszt\u00f3t beind\u00edtja (integr\u00e1lja) a h\u00e1l\u00f3zatba, \u00e9s tov\u00e1bbi t\u00e1rsakat tal\u00e1l, ez\u00e9rt k\u00e9rj\u00fck, legyen t\u00fcrelemmel.";
    t[8318] = "No file specified. Please select a valid .zip or .su3 file to reseed from.";
    t[8319] = "Nincs f\u00e1jl megadva. ";
    t[8320] = "Enable Universal Plug and Play (UPnP)";
    t[8321] = "Enged\u00e9lyezze a Universal Plug and Play (UPnP) lehet\u0151s\u00e9g\u00e9t";
    t[8322] = "Unknown Wizard page";
    t[8323] = "Ismeretlen var\u00e1zsl\u00f3 oldal";
    t[8326] = "NTCP &amp; SSU with Introducers [IPv6 Only]";
    t[8327] = "IPv6 Csak NTCP, SSU, bevezet\u0151k";
    t[8332] = "Messages sent to peer";
    t[8333] = "Peer-nek k\u00fcld\u00f6tt \u00fczenetek";
    t[8334] = "Function";
    t[8335] = "Funkci\u00f3";
    t[8336] = "On the I2P network, remotely hosted services can be accessed using a <a href=https://en.wikipedia.org/wiki/Base32 target=_blank rel=noreferrer class='sitelink external'>Base32</a> address ending in \".b32.i2p\", a <i>destination</i> represented as a long <a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external'>Base64</a> string, or more usually by using an .i2p domain. A destination is I2P's equivalent to an IP address, and is shown on the <a href='/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>. You can share your b32.i2p address to allow others to access to your website until you've registered your own .i2p domain.";
    t[8337] = "Az I2P h\u00e1l\u00f3zaton t\u00e1voli szolg\u00e1ltat\u00e1sokhoz hozz\u00e1f\u00e9rhet\u00fcnk egy \".b32.i2p\" v\u00e9gz\u0151d\u00e9s\u0171 <a href=https://hu.wikipedia.org/wiki/Base32 target=_blank rel=noreferrer class='sitelink external'>Base32</a> c\u00edmmel, egy hossz\u00fa <a href=https://hu.wikipedia.org/wiki/Base64 class='sitelink external'>Base64</a> karakterl\u00e1ncban reprezent\u00e1lt <i>destination</i> tartom\u00e1nnyal vagy m\u00e9g gyakrabban egy .i2p tartom\u00e1ny haszn\u00e1lat\u00e1val. A tartom\u00e1ny az I2P kifejez\u00e9se az IP-c\u00edmnek, \u00e9s a <a href='/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration</a> oldalon jelenik meg. Megoszthatja b32.i2p c\u00edm\u00e9t, hogy m\u00e1sok hozz\u00e1f\u00e9rhessenek webhely\u00e9hez, am\u00edg saj\u00e1t .i2p tartom\u00e1nyt nem regisztr\u00e1lt.";
    t[8340] = "Computing-related tutorials";
