    t[8342] = "Error {0}";
    t[8343] = "Hiba {0}";
    t[8350] = "Enter the name and paste the destination into your <a href='/dns?book=router&amp;filter=none'>address book</a>. Click <i>Add</i> to save the new entry.";
    t[8351] = "Adja meg a nevet \u00e9s illessze be a c\u00e9l\u00e1llom\u00e1st az <a href='/dns?book=router&amp;filter=none'>c\u00edmjegyz\u00e9kbe</a>. Kattintson a <i>Hozz\u00e1ad\u00e1s</i> gombra a \u00faj bejegyz\u00e9s ment\u00e9s\u00e9hez.";
    t[8358] = "Stats";
    t[8359] = "Statisztika";
    t[8360] = "Maximum number of concurrent messages to send";
    t[8361] = "Az egyidej\u0171leg elk\u00fcldhet\u0151 \u00fczenetek maxim\u00e1lis sz\u00e1ma";
    t[8364] = "Recorders keep track of connection attempts made by a remote destination, and if that breaches the defined threshold, the destination gets logged in the specified file. Multiple recorders can be specified:";
    t[8365] = "A r\u00f6gz\u00edt\u0151k nyomon k\u00f6vetik a t\u00e1voli c\u00e9l\u00e1llom\u00e1sokhoz kapcsol\u00f3d\u00f3 kapcsolatf\u00f6ltev\u00e9nyeket, \u00e9s ha a meghat\u00e1rozott k\u00fcsz\u00f6b\u00e9rt\u00e9ket megs\u00e9rtik, a c\u00e9l\u00e1llom\u00e1s bejegyz\u00e9st kap a megadott f\u00e1jlba. T\u00f6bb r\u00f6gz\u00edt\u0151 is megadhat\u00f3:";
    t[8368] = "(the symbol '@' will be replaced during log rotation)";
    t[8369] = "(a '@' karakter a napl\u00f3 v\u00e1lt\u00e1sa alatt cser\u00e9lve lesz)";
