    t[8409] = "Sybil blokklist\u00e1j\u00e1nak t\u00f6rl\u00e9se";
    t[8410] = "To disable directory listings, find the entry for <code>org.eclipse.jetty.servlet.Default.dirAllowed</code> in the <code>base-context.xml</code> file, located in the <code>eepsite/contexts</code> folder (just above docroot folder), and change 'true' to 'false' immediately underneath. To apply the change immediately, stop and restart the <i>I2P Webserver</i> client on the <a href=/configclients>Client Configuration page</a>. You can also drop an empty <code>index.html</code> file in any exposed directory to suppress directory listings for that location.";
    t[8411] = "A mappalista letilt\u00e1s\u00e1hoz keresd meg az <code>org.eclipse.jetty.servlet.Default.dirAllowed</code> bejegyz\u00e9st a <code>base-context.xml</code> f\u00e1jlban, ami a <code>eepsite/contexts</code> mapp\u00e1ban tal\u00e1lhat\u00f3 (a docroot mappa feletti helyen), \u00e9s az alatta l\u00e9v\u0151 'true' \u00e9rt\u00e9ket v\u00e1ltoztasd meg 'false' \u00e9rt\u00e9kre. Azonnali hat\u00e1lyba l\u00e9p\u00e9s \u00e9rdek\u00e9ben \u00e1ll\u00edtsd le \u00e9s ind\u00edtsd \u00fajra az <i>I2P Webszerver</i> klienset a <a href=/configclients>Kliens konfigur\u00e1ci\u00f3s oldal</a> seg\u00edts\u00e9g\u00e9vel. A mappalista elnyom\u00e1s\u00e1hoz dobhatsz egy \u00fcres <code>index.html</code> f\u00e1jlt b\u00e1rmelyik el\u00e9rhet\u0151 mapp\u00e1ba.";
