    t[8460] = "by default there are no limits";
    t[8461] = "alap\u00e9rtelmez\u00e9s szerint nincsenek korl\u00e1tok";
    t[8462] = "System Tray Integration";
    t[8463] = "Rendszert\u00e1lca integr\u00e1ci\u00f3";
    t[8466] = "Can be disabled in the <code>clients.config</code> file. Can also be configured to bind to a specific interface or all interfaces. If you make the Router Console available over the network, you might wish to <a href=/configui#passwordheading>enforce an access password</a> to prevent unauthorized access.";
    t[8467] = "Letilthat\u00f3 a <code>clients.config</code> f\u00e1jlban. Ak\u00e1r egy specifikus fel\u00fcletre ak\u00e1r az \u00f6sszes fel\u00fcletre is k\u00f6thet\u0151. Ha a Router konzolt h\u00e1l\u00f3zat utj\u00e1n el\u00e9rhet\u0151v\u00e9 teszi, tal\u00e1n szeretne egy <a href=/configui#passwordheading>hozz\u00e1f\u00e9r\u00e9s jelsz\u00f3t bevezetni</a> jogosulatlan hozz\u00e1f\u00e9r\u00e9s megakad\u00e1lyoz\u00e1sa v\u00e9gett.";
    t[8470] = "Show Legend";
    t[8471] = "Legend\u00e1t mutat";
    t[8474] = "Profile";
    t[8475] = "Profil";
    t[8490] = "A group of tunnel entry points (leases) for a <i>destination</i>. Note: A 0-hop server tunnel will only have one lease, regardless of the number of tunnels configured.";
    t[8491] = "Egy alag\u00fat bel\u00e9p\u00e9si pontjainak (befogad\u00f3i jogok) csoportja egy <i>c\u00e9lpontra</i>. Megjegyz\u00e9s: Egy 0-kit\u00e9tel\u0171 szerveralag\u00fatnak csak egy b\u00e9rlete lesz, f\u00fcggetlen\u00fcl a be\u00e1ll\u00edtott alagutak sz\u00e1m\u00e1t\u00f3l.";
    t[8494] = "Tunnels";
    t[8495] = "Alag\u00fat";
    t[8504] = "This router is not currently a floodfill participant.";
    t[8505] = "Ez a router jelenleg nem \u00e1rv\u00edzv\u00e9delmi r\u00e9sztvev\u0151.";
    t[8508] = "Restart immediately";
    t[8509] = "Azonnali \u00dajraind\u00edt\u00e1s";
    t[8516] = "Configure the status of the I2P service at system startup. If disabled, the service can be launched manually.";
    t[8517] = "Konfigur\u00e1lja az I2P szolg\u00e1ltat\u00e1s \u00e1llapot\u00e1t a rendszer ind\u00edt\u00e1sakor. ";
    t[8524] = "torrents";
    t[8525] = "torrentek";
    t[8536] = "Job Queue";
    t[8537] = "Feladatsor";
    t[8554] = "If you're not using IE, it's likely that your browser is pretending to be IE; please configure your browser (or proxy) to use a different User Agent string if you'd like to access the console themes.";
    t[8555] = "Amennyiben nem Internet Explorert haszn\u00e1lsz, val\u00f3sz\u00edn\u0171, hogy a b\u00f6ng\u00e9sz\u0151d \u00fagy tesz, mintha Internet Explorer lenne; k\u00e9rlek \u00e1ll\u00edtsd be a b\u00f6ng\u00e9sz\u0151d (vagy proxyd), hogy m\u00e1s felhaszn\u00e1l\u00f3i k\u00f6zeg-sort haszn\u00e1ljon, hogy a konzol t\u00e9m\u00e1k el\u00e9rhet\u0151k legyenek.";
    t[8564] = "Privacy-focused Clearnet Search Engine";
    t[8565] = "Adatv\u00e9delemre \u00f6sszpontos\u00edt\u00f3 Clearnet keres\u0151motor";
    t[8572] = "<a href=/logs>Logs</a> may help resolve a problem. You may wish to paste excerpts in a <a href=http://i2pforum.i2p/ target=_blank rel=noreferrer>forum</a> for help, or perhaps <a href=http://cake.i2p/pastebin/ target=_blank rel=noreferrer class='sitelink external'>paste</a> it instead and reference the link on IRC for help.";
    t[8573] = "<a href=/logs>Napl\u00f3k</a> seg\u00edthetnek a probl\u00e9ma megold\u00e1s\u00e1ban. Seg\u00edts\u00e9get k\u00e9rhet a r\u00e9szletek <a href=http://i2pforum.i2p/ target=_blank rel=noreferrer>f\u00f3rum\u00e1n</a>, vagy esetleg ink\u00e1bb <a href=http://cake.i2p/pastebin/ target=_blank rel=noreferrer class='sitelink external'>besz\u00farja</a> \u00e9s hivatkozik a hivatkoz\u00e1sra az IRC-n seg\u00edts\u00e9g\u00e9rt.";
    t[8574] = "Plugins signed with the cryptographic key of the developer are the recommended format, but if you wish to install unsigned plugins (.zip) you can set this to true. Note that you may still encounter issues attempting to install an unsigned plugin if the developer has included additional checks in the plugin build process.";
    t[8575] = "A fejleszt\u0151 kriptogr\u00e1fiai kulcs\u00e1val al\u00e1\u00edrt b\u0151v\u00edtm\u00e9nyek aj\u00e1nlott form\u00e1tumot haszn\u00e1lnak, de ha telep\u00edteni k\u00edv\u00e1nsz al\u00e1\u00edratlan b\u0151v\u00edtm\u00e9nyeket (.zip), ezt be\u00e1ll\u00edthatod igazra. Figyelem, ha a fejleszt\u0151 tov\u00e1bbi ellen\u0151rz\u00e9seket v\u00e9gzett a b\u0151v\u00edtm\u00e9nyhez tartoz\u00f3 \u00e9p\u00edt\u00e9si folyamat sor\u00e1n, tov\u00e1bbra is probl\u00e9m\u00e1kba \u00fctk\u00f6zhetsz az al\u00e1\u00edratlan b\u0151v\u00edtm\u00e9ny telep\u00edt\u00e9s\u00e9vel kapcsolatban.";
    t[8578] = "If you are running a standalone Tor instance locally, you may use it by configuring I2P to use: <i>Proxy type:</i> <code>SOCKS 5</code> <i>Host:</i> <code>127.0.0.1</code> <i>Port:</i> <code>9050</code>.";
    t[8579] = "Ha \u00f6n helyileg fut\u00f3, \u00f6n\u00e1ll\u00f3 Tor p\u00e9ld\u00e1nyt haszn\u00e1l, akkor felhaszn\u00e1lhatja a I2P konfigur\u00e1l\u00e1s\u00e1val: <i>Proxy t\u00edpusa:</i> <code>SOCKS 5</code> <i>Kiszolg\u00e1l\u00f3 neve:</i> <code>127.0.0.1</code> <i>Port:</i> <code>9050</code>.";
    t[8584] = "Select the language to be used for the router console and web applications (<a href=/webmail target=_blank rel=noreferrer>webmail</a>, <a href=/torrents target=_blank rel=noreferrer>torrents</a>, <a href=/i2ptunnelmgr target=_blank rel=noreferrer>tunnel manager</a> etc). If you wish to change the language in future, change the router console theme, or configure a password to access the console, you may do so on the <a href=/configui target=_blank rel=noreferrer>User Interface configuration page</a>.";
    t[8585] = "V\u00e1lassza ki a nyelvet, amelyet a hangos\u00edt\u00f3 konzol \u00e9s webes alkalmaz\u00e1sok (<a href=/webmail target=_blank rel=noreferrer>webmail</a>, <a href=/torrents target=_blank rel=noreferrer>torrentek</a>, <a href=/i2ptunnelmgr target=_blank rel=noreferrer>tunnelkezel\u0151</a> stb.) haszn\u00e1ljanak. Ha a j\u00f6v\u0151ben meg szeretn\u00e9 v\u00e1ltoztatni a nyelvet, a hangos\u00edt\u00f3 konzol t\u00e9m\u00e1j\u00e1t, vagy be\u00e1ll\u00edtani egy jelsz\u00f3t a konzolhoz val\u00f3 hozz\u00e1f\u00e9r\u00e9shez, megteheti a <a href=/configui target=_blank rel=noreferrer>Felhaszn\u00e1l\u00f3i fel\u00fclet be\u00e1ll\u00edt\u00e1sok oldalon</a>.";
    t[8592] = "Do not show legend on graphs";
    t[8593] = "Ne mutasson jelmagyar\u00e1zatot a grafikonokon";
    t[8598] = "Job Queue Stats";
    t[8599] = "Feladatsorok statisztik\u00e1i";
    t[8600] = "WebApp configuration saved.";
