    t[9052] = "Ready";
    t[9053] = "K\u00e9sz";
    t[9056] = "These are the local services provided by your router. They may be clients started through the <a href='/i2ptunnelmgr'>Tunnel Manager</a> or external programs connecting through SAM, BOB, or directly to I2CP. By default, most of your client services (mail, http proxy, IRC) will share the same set of tunnels and be listed as <i>Shared Clients</i> and <i>Shared Clients(DSA)</i>, which enhances anonymity by blending the traffic from all shared services, and reduces the overhead required to build and maintain tunnels. However, if you experience a tunnel failure, all your services will go offline at the same time, so in some scenarios you may wish to configure client services to use their own set of tunnels. This can be done by unchecking the <i>Share tunnels with other clients&hellip;</i> option listed under <i>Shared Clients</i> on the configuration page of the relevant client service in the Tunnel Manager, after which you will need to restart the client service from the <a href='/i2ptunnelmgr'>main Tunnel Manager page</a>.";
    t[9057] = "Ezek a helyi szolg\u00e1ltat\u00e1sokat biztos\u00edt\u00f3 \u00fatv\u00e1laszt\u00f3 \u00e1ltal ny\u00fajtott szolg\u00e1ltat\u00e1sok. Azok lehetnek \u00fcgyfelek, amelyeken kereszt\u00fcl haszn\u00e1lhat\u00f3 a <a href='/i2ptunnelmgr'>Tunnel Manager</a> vagy k\u00fcls\u0151 programok, amelyek a SAM, BOB vagy k\u00f6zvetlen\u00fcl az I2CP-n kereszt\u00fcl csatlakoznak. Alap\u00e9rtelmez\u00e9s szerint a legt\u00f6bb kliens szolg\u00e1ltat\u00e1s (lev\u00e9l, http proxy, IRC) ugyanazokat a tunnelhalmazokat \u00e9s <i>Shared Clients</i> \u00e9s <i>Shared Clients(DSA)</i> n\u00e9ven vannak felt\u00fcntetve, amelyek anonimit\u00e1st biztos\u00edtanak a forgalom \u00f6sszekever\u00e9s\u00e9vel az \u00f6sszes megosztott szolg\u00e1ltat\u00e1sb\u00f3l, valamint cs\u00f6kkenti a sz\u00fcks\u00e9ges overheadet a tunnel\u00e9p\u00edt\u00e9shez \u00e9s -fenntart\u00e1shoz. Azonban, ha tunnelhiba l\u00e9p fel, akkor az \u00f6sszes szolg\u00e1ltat\u00e1s egyszerre kiesik, ez\u00e9rt bizonyos helyzetekben be\u00e1ll\u00edthatja a kliens szolg\u00e1ltat\u00e1sokat \u00fagy, hogy saj\u00e1t tunnelhalmazt haszn\u00e1ljanak. Ezt megteheti a <i>Share tunnels with other clients&hellip;</i> opci\u00f3 kikapcsol\u00e1s\u00e1val, amely a relev\u00e1ns kliens szolg\u00e1ltat\u00e1s konfigur\u00e1ci\u00f3s oldal\u00e1n tal\u00e1lhat\u00f3, a <i>Shared Clients</i> alatt a Tunnel Managerben, amelyet k\u00f6vet\u0151en \u00fajra kell ind\u00edtania a kliens szolg\u00e1ltat\u00e1st a <a href='/i2ptunnelmgr'>f\u0151 Tunnel Manager oldal</a>.";
