    t[9203] = "Megjegyz\u00e9s: A legt\u00f6bb be\u00e1ll\u00edt\u00e1si lehet\u0151s\u00e9g a Tunnel Managerben tooltippekkel rendelkezik; gy\u0151z\u0151dj\u00f6n meg r\u00f3luk, miel\u0151tt olyan be\u00e1ll\u00edt\u00e1sokat v\u00e1ltoztat, amelyeket nem teljesen \u00e9rt!";
    t[9204] = "Events";
