    t[9218] = "Soft restart";
    t[9219] = "L\u00e1gy \u00fajraind\u00edt\u00e1s";
    t[9234] = "router information";
    t[9235] = "router inform\u00e1ci\u00f3";
    t[9238] = "UPnP SSDP UDP multicast listener";
    t[9239] = "UPnP SSDP UDP multicast hallgat\u00f3";
    t[9240] = "A simple CGI application that takes a hostname as a parameter and returns a 301 redirect to the proper URL with a <code>?i2paddresshelper=key</code> string appended. The HTTP proxy will interpret the appended string and use the key as the actual destination. In addition, the proxy will cache the key so the address helper is not necessary until restart, and offer the option to add the resolved address to the addressbook.";
    t[9241] = "Egy egyszer\u0171 CGI alkalmaz\u00e1s, amely egy hostnevet kap param\u00e9terk\u00e9nt \u00e9s visszat\u00e9r egy 301 \u00e1tir\u00e1ny\u00edt\u00e1ssal a megfelel\u0151 URL-c\u00edmmel, amelyhez egy <code>?i2paddresshelper= kulcs</code> karakterl\u00e1ncot f\u0171z hozz\u00e1. Az HTTP proxy a f\u0171z\u00f6tt karakterl\u00e1ncot \u00e9rtelmezni fogja \u00e9s a kulcsot val\u00f3s c\u00e9lpontk\u00e9nt haszn\u00e1lja. Ezenk\u00edv\u00fcl a proxy gyors\u00edt\u00f3t\u00e1razza a kulcsot, \u00edgy az el\u00e9r\u00e9si seg\u00e9dlet nem sz\u00fcks\u00e9ges a restart el\u0151tt, \u00e9s lehet\u0151s\u00e9get ny\u00fajt a feloldott c\u00edm hozz\u00e1ad\u00e1s\u00e1ra az addressbookhoz.";
    t[9244] = "Temporary ban expiring in {0}";
    t[9245] = "Ideiglenes kitilt\u00e1s lej\u00e1r a k\u00f6vetkez\u0151n bel\u00fcl: {0}";
