    t[9284] = "New override";
    t[9285] = "\u00daj fel\u00fclb\u00edr\u00e1lat";
    t[9292] = "This setting (in minutes) allows you to manually configure how long to wait after startup before RouterInfos in the NetDb are checked for validity, after which point only valid routers will be accepted for inclusion. When the validation occurs, expired RouterInfos and unresponsive peers only accessible via SSU will be removed from the NetDb. [Default is 60 minutes] Note: This setting has no bearing on older routers (older than 0.9.29 by default) which are removed from the NetDb and banned for the router session as soon as a NetDb store is attempted.";
    t[9293] = "Ez a be\u00e1ll\u00edt\u00e1s (percben) lehet\u0151v\u00e9 teszi, hogy k\u00e9zzel \u00e1ll\u00edtsa be, mennyi ideig kell v\u00e1rni a rendszerind\u00edt\u00e1s ut\u00e1n, miel\u0151tt a RouterInfo-kat a NetDb-ben ellen\u0151rizn\u00e9k. Ezt k\u00f6vet\u0151en csak \u00e9rv\u00e9nyes routerek lesznek elfogadva a felv\u00e9telre. Amikor a ellen\u0151rz\u00e9s megt\u00f6rt\u00e9nik, a lej\u00e1rt RouterInfo-k \u00e9s az SSU-n kereszt\u00fcl el\u00e9rhetetlen t\u00e1rsak elt\u00e1vol\u00edt\u00e1sra ker\u00fclnek a NetDb-b\u0151l. [Az alap\u00e9rtelmez\u00e9s 60 perc] Megjegyz\u00e9s: Ez a be\u00e1ll\u00edt\u00e1s nem \u00e9rinti a r\u00e9gebbi routereket (alap\u00e9rtelmezetten 0.9.29-n\u00e9l r\u00e9gebbiek), amelyek elt\u00e1vol\u00edt\u00e1sra ker\u00fclnek a NetDb-b\u0151l, \u00e9s az \u00fatv\u00e1laszt\u00f3i munkamenetet k\u00f6vet\u0151en tilt\u00e1sra ker\u00fclnek, amint egy NetDb t\u00e1rol\u00e1s megk\u00eds\u00e9relve lesz.";
