    t[9316] = "Please include your I2P version and running environment information in bug reports";
    t[9317] = "K\u00e9rj\u00fck, adja meg az I2P verzi\u00f3j\u00e1t \u00e9s a fut\u00f3k\u00f6rnyezet adatait a hibajelent\u00e9sekben";
