    t[9334] = "If the problem persists, verify that you have cookies enabled in your browser.";
    t[9335] = "Ha a probl\u00e9ma fenn\u00e1ll, ellen\u0151rizd, hogy a s\u00fctik enged\u00e9lyezve vannak-e a b\u00f6ng\u00e9sz\u0151dben.";
    t[9350] = "Good Lookups";
    t[9351] = "J\u00f3 keres\u00e9s";
    t[9354] = "Reseeding is the bootstrapping process used to find other routers when you first install I2P, or when your router has too few router references remaining. The default settings will work for most people. Change these only if HTTPS is blocked by a restrictive firewall and reseed has failed.";
    t[9355] = "Az \u00fajrat\u00e1pl\u00e1l\u00e1s a bootstrapping folyamatot jelenti, amelyet akkor haszn\u00e1lnak, amikor el\u0151sz\u00f6r telep\u00edti az I2P-t, vagy amikor a routernek t\u00fal kev\u00e9s maradt a router referenci\u00e1kb\u00f3l. Az alap\u00e9rtelmezett be\u00e1ll\u00edt\u00e1sok t\u00f6bbs\u00e9g\u00e9n\u00e9l m\u0171k\u00f6dni fognak. Ezeket csak akkor m\u00f3dos\u00edtsa, ha a HTTPS tiltja a korl\u00e1toz\u00f3 t\u0171zfal \u00e9s az \u00fajrat\u00e1pl\u00e1l\u00e1s sikertelen volt.";
    t[9362] = "This setting, when enabled, modifies the maximum additional random pong delay introduced for ping-enabled servers, if <code>i2p.streaming.enablePongDelay</code> is also enabled. Unless explicitly set, the default value of 50ms will be used.";
    t[9363] = "Ez a be\u00e1ll\u00edt\u00e1s akkor m\u00f3dos\u00edtja a maxim\u00e1lis tov\u00e1bbi v\u00e9letlenszer\u0171 \"pong\" k\u00e9sleltet\u00e9st, ha enged\u00e9lyezve van a ping-kapcsolat\u00fa szerverekre a be\u00e1ll\u00edt\u00e1s (i2p.streaming.enablePongDelay). Hacsak nincs kifejezetten be\u00e1ll\u00edtva, akkor az alap\u00e9rtelmezett \u00e9rt\u00e9ket, 50 ms-t veszi figyelembe.";
    t[9364] = "home";
    t[9365] = "tetej\u00e9re";
    t[9370] = "When in doubt, leave the settings at the defaults.";
    t[9371] = "Bizonytalans\u00e1g eset\u00e9n c\u00e9lszer\u0171 az alapbe\u00e1ll\u00edt\u00e1sokn\u00e1l maradni.";
    t[9374] = "World atlas including geography facts &amp; flags";
