    t[9388] = "If a firewall is blocking your connections to reseed hosts, you may have access to a proxy.";
    t[9389] = "Ha egy t\u0171zfal blokkolja a kapcsolatot a vissza\u00fcltet\u0151 gazdag\u00e9pekkel, akkor lehet, hogy hozz\u00e1f\u00e9r\u00e9se van egy proxyhoz.";
