    t[9446] = "Reseeding: fetching router info from seed URL ({0} successful, {1} errors).";
    t[9447] = "\u00dajrat\u00e1pl\u00e1l\u00e1s: router inf\u00f3 k\u00e9zbes\u00edt\u00e9se a t\u00e1pl\u00e1l\u00e1si URL-r\u0151l: ({0} sikeres, {1} hib\u00e1s).";
