    t[9455] = "Mi az eepsite?";
    t[9458] = "Limited display to the {0} tunnels with the highest usage";
    t[9459] = "Korl\u00e1tozott megjelen\u00edt\u00e9s a legnagyobb kihaszn\u00e1lts\u00e1g\u00fa {0} alag\u00fathoz";
    t[9466] = "This may be a transient error, if the other program is no longer using the port.";
    t[9467] = "Ez lehet \u00e1tmeneti hiba, ha a m\u00e1sik program m\u00e1r nem haszn\u00e1lja a portot.";
    t[9474] = "Your I2P+ router by default contributes to the network by routing internal, end-to-end encrypted traffic for other routers, known as <i>participation</i>. Bandwidth participation improves the anonymity level of all users on the network and maximizes your download speed.";
    t[9475] = "Az \u00d6n I2P+ \u00fatv\u00e1laszt\u00f3ja alap\u00e9rtelmez\u00e9s szerint \u00fagy j\u00e1rul hozz\u00e1 a h\u00e1l\u00f3zathoz, hogy bels\u0151, v\u00e9gpontok k\u00f6z\u00f6tti titkos\u00edtott forgalmat ir\u00e1ny\u00edt m\u00e1s \u00fatv\u00e1laszt\u00f3k sz\u00e1m\u00e1ra, ez az \u00fagynevezett <i>r\u00e9szv\u00e9tel</i>. A s\u00e1vsz\u00e9less\u00e9gben val\u00f3 r\u00e9szv\u00e9tel jav\u00edtja a h\u00e1l\u00f3zat \u00f6sszes felhaszn\u00e1l\u00f3j\u00e1nak anonimit\u00e1s\u00e1t, \u00e9s maximaliz\u00e1lja a let\u00f6lt\u00e9si sebess\u00e9get.";
    t[9476] = "This setting permits the configuration of alternative NTP servers required to ensure that your router maintains accurate clock time. [Default is 0.pool.ntp.org,1.pool.ntp.org,2.pool.ntp.org]";
    t[9477] = "Ez a be\u00e1ll\u00edt\u00e1s lehet\u0151v\u00e9 teszi alternat\u00edv NTP szerverek be\u00e1ll\u00edt\u00e1s\u00e1t, amelyek sz\u00fcks\u00e9gesek ahhoz, hogy a router pontos id\u0151tartamot tartsa. [Az alap\u00e9rtelmezett \u00e9rt\u00e9k: 0.pool.ntp.org,1.pool.ntp.org,2.pool.ntp.org]";
    t[9484] = "Optimize your images";
    t[9485] = "Optimaliz\u00e1lja a k\u00e9peket";
    t[9488] = "Note that the profiler relies on sustained client tunnel usage to accurately profile peers.";
    t[9489] = "Vegye figyelembe, hogy a profilk\u00e9sz\u00edt\u0151 a folyamatos \u00fcgyf\u00e9l-alag\u00fat-haszn\u00e1latra t\u00e1maszkodik a partnerek pontos profil\u00e1l\u00e1s\u00e1hoz.";
    t[9492] = "If you are in a hurry and can't wait a few hours, you can tell people to use a \"jump\" address helper redirection service. This will usually work within a few minutes of your registering your hostname on the same site. Test it yourself first by entering <code>http://stats.i2p/cgi-bin/jump.cgi?a=<i>yourchosenhostname.i2p</i></code> into your browser. Once it is working, you can tell others to use it.";
    t[9493] = "Ha siettetsz, \u00e9s nem tudsz p\u00e1r \u00f3r\u00e1t v\u00e1rni, akkor elmondhatod az embereknek, hogy haszn\u00e1lj\u00e1k az \u201eugr\u00e1s\u201d c\u00edmseg\u00edt\u0151 \u00e1tir\u00e1ny\u00edt\u00f3 szolg\u00e1ltat\u00e1st. Ez \u00e1ltal\u00e1ban n\u00e9h\u00e1ny percen bel\u00fcl m\u0171k\u00f6dni fog miut\u00e1n regisztr\u00e1ltad a hosztn\u00e9v\u00e9t ugyanazon az oldalon. El\u0151bb teszteld le magad a b\u00f6ng\u00e9sz\u0151dben ennek a be\u00edr\u00e1s\u00e1val: <code>http://stats.i2p/cgi-bin/jump.cgi?a=<i>a v\u00e1lasztott mened\u00e9kod.i2p</i></code>. Ha m\u0171k\u00f6dik, akkor m\u00e1soknak is elmondhatod, hogy haszn\u00e1lj\u00e1k.";
    t[9496] = "Customize the sidebar by adding or removing or repositioning elements";
    t[9497] = "Az oldals\u00e1v m\u00f3dos\u00edt\u00e1sa az elemek poz\u00edci\u00f3j\u00e1nak hozz\u00e1ad\u00e1s\u00e1val vagy megv\u00e1ltoztat\u00e1s\u00e1val";
