    t[9580] = "Note that the full path to the output files must be accessible before deploying the filter. If the target directory does not exist, the destinations will not be recorded and an error will appear in the router logs. The files will be created as required. The examples provided above are not recommendations; your configuration should be tuned according to the amount of content (number and size of files) your site is serving, the speed of the server, and the frequency with which the site is updated. Configuring recorders and monitoring the resulting files will help you fine tune the settings.";
    t[9581] = "Vegye figyelembe, hogy a kimeneti f\u00e1jlok teljes el\u00e9r\u00e9si \u00fatvonala hozz\u00e1f\u00e9rhet\u0151nek kell lennie m\u00e9g a sz\u0171r\u0151 telep\u00edt\u00e9se el\u0151tt. Ha a c\u00e9lmapp nem l\u00e9tezik, a c\u00e9lok nem fognak r\u00f6gz\u00edt\u00e9sre ker\u00fclni, \u00e9s hiba\u00fczenet jelenik meg a router napl\u00f3kban. A f\u00e1jlokat ig\u00e9ny szerint l\u00e9trehozz\u00e1k. Az itt fentebb megadott p\u00e9ld\u00e1k nem javaslatok; konfigur\u00e1ci\u00f3ja az \u00d6n oldal\u00e1n szolg\u00e1ltatott tartalom mennyis\u00e9g\u00e9hez (f\u00e1jlok sz\u00e1ma \u00e9s m\u00e9rete), a szerver sebess\u00e9g\u00e9hez \u00e9s a weboldal friss\u00edt\u00e9s\u00e9nek gyakoris\u00e1g\u00e1hoz kell igazodnia. A r\u00f6gz\u00edt\u0151k be\u00e1ll\u00edt\u00e1sa \u00e9s a l\u00e9trej\u00f6tt f\u00e1jlok monitoroz\u00e1sa seg\u00edt finomhangolni a be\u00e1ll\u00edt\u00e1sokat.";
    t[9588] = "In the Network Settings sub-section, hit the <i>Settings</i> button.";
    t[9589] = "A H\u00e1l\u00f3zati Be\u00e1ll\u00edt\u00e1sok r\u00e9szben kattints a <i>Be\u00e1ll\u00edt\u00e1sok</i> gombra.";
