    t[9621] = "Ismert gyors t\u00e1rsak";
    t[9630] = "Tunnels built by other routers through your router. This may vary widely depending on network demand, your shared bandwidth, and amount of locally-generated traffic. The recommended method for limiting participating tunnels is to change your share percentage on the <a  href='/config'>Bandwidth Configuration page</a>. You may also limit the total number by setting <code>router.maxParticipatingTunnels=nnn</code> on the <a href='/configadvanced'>Advanced configuration page</a>. <a href='/configstats#tunnel.participatingTunnels'>[Enable graphing]</a>.";
    t[9631] = "A t\u00f6bbi \u00fatv\u00e1laszt\u00f3n kereszt\u00fcl \u00e9p\u00edtett \u00e1tj\u00e1r\u00f3k az \u00fatv\u00e1laszt\u00f3j\u00e1n kereszt\u00fcl. Ez jelent\u0151sen elt\u00e9r\u0151 lehet a h\u00e1l\u00f3zat ig\u00e9ny\u00e9t\u0151l, megosztott s\u00e1vsz\u00e9less\u00e9g\u00e9t\u0151l \u00e9s a helyben keletkezett forgalom mennyis\u00e9g\u00e9t\u0151l. A r\u00e9sztvev\u0151 \u00e1tj\u00e1r\u00f3k korl\u00e1toz\u00e1s\u00e1nak javasolt m\u00f3dja, hogy megv\u00e1ltoztassa a r\u00e9szesed\u00e9si ar\u00e1ny\u00e1t a <a href='/config'>S\u00e1vsz\u00e9less\u00e9g be\u00e1ll\u00edt\u00e1sok oldalon</a>. A teljes sz\u00e1mot is korl\u00e1tozhatja a <code>router.maxParticipatingTunnels=nnn</code> be\u00e1ll\u00edt\u00e1s\u00e1val az<a href='/configadvanced'>Halad\u00f3 be\u00e1ll\u00edt\u00e1sok oldalon</a>. <a href='/configstats#tunnel.participatingTunnels'>[Grafikon enged\u00e9lyez\u00e9se]</a>.";
