    t[10036] = "minutes";
    t[10037] = "perc";
    t[10038] = "To configure an alternative webserver for use on I2P, you can either use the existing webserver tunnel and <a href=/configclients>disable the default webserver</a> from running, or create a new HTTP Server tunnel in the <a href=/i2ptunnelmgr>Tunnel Manager</a>. Ensure that the webserver's <i>listening port</i> is also configured in the Tunnel Manager settings. For example, if your webserver is listening by default on address 127.0.0.1 port 80, you'd also need to ensure that the <i>Target port</i> in the Tunnel Manager settings page for the service is also configured to port 80.";
    t[10039] = "Az I2P-n haszn\u00e1lhat\u00f3 alternat\u00edv webszerver be\u00e1ll\u00edt\u00e1sa \u00e9rdek\u00e9ben vagy haszn\u00e1lhatod a m\u00e1r l\u00e9tez\u0151 webszerver alagutat \u00e9s <a href=/configclients>letilthatod a helyi webszervert</a>, vagy l\u00e9trehozhatsz egy \u00faj HTTP kiszolg\u00e1l\u00f3 alagutat az <a href=/i2ptunnelmgr>Alag\u00fatkezel\u0151ben</a>. Gy\u0151z\u0151dj meg r\u00f3la, hogy a webszerver <i>hallgat\u00f3 portja</i> is be van \u00e1ll\u00edtva az Alag\u00fatkezel\u0151 be\u00e1ll\u00edt\u00e1saiban. P\u00e9ld\u00e1ul, ha a webszervered alap\u00e9rtelmezettk\u00e9nt a 127.0.0.1 c\u00edmen \u00e9s 80-as porton hallgat, akkor biztos\u00edtanod kell, hogy a szolg\u00e1ltat\u00e1s C\u00e9l portja is be van \u00e1ll\u00edtva 80-ra az Alag\u00fatkezel\u0151 be\u00e1ll\u00edt\u00e1sai oldalon.";
    t[10040] = "Torrents";
    t[10041] = "Torrent";
    t[10042] = "Data In";
    t[10043] = "Adatok a";
    t[10044] = "IRC proxy";
    t[10045] = "IRC proxy";
    t[10046] = "An I2P router usually only needs to be seeded once, to join the network for the first time. However, if the router is running for an extended period without network connectivity it may also need to be reseeded. Reseeding involves fetching multiple \"RouterInfo\" files (bundled into a signed zip-file) from at least two predefined server URLs picked from a volunteer-run group of clearnet HTTPS servers.";
    t[10047] = "\u00c1ltal\u00e1ban az I2P routernek csak egyszer kell \u00fajratelep\u00edteni, hogy csatlakozzon a h\u00e1l\u00f3zathoz els\u0151 alkalommal. Azonban, ha a router hosszabb ideig fut h\u00e1l\u00f3zati kapcsolat n\u00e9lk\u00fcl, akkor lehet, hogy \u00fajratelep\u00edt\u00e9sre is sz\u00fcks\u00e9g van. Az \u00fajratelep\u00edt\u00e9s tartalmazza a \u201eRouterInfo\u201d f\u00e1jlok (egy al\u00e1\u00edrt zip-f\u00e1jlba csomagolva) t\u00f6bb p\u00e9ld\u00e1ny\u00e1nak let\u00f6lt\u00e9s\u00e9t legal\u00e1bb k\u00e9t el\u0151re meghat\u00e1rozott kiszolg\u00e1l\u00f3 URL-r\u0151l, amelyeket \u00f6nk\u00e9ntesek m\u0171k\u00f6dtetnek a vil\u00e1gh\u00e1l\u00f3s HTTPS kiszolg\u00e1l\u00f3k csoportj\u00e1ban.";
    t[10050] = "Are you sure you want to delete {0}?";
    t[10051] = "Biztos, hogy t\u00f6r\u00f6lni akarod a k\u00f6vetkez\u0151t: {0} ?";
    t[10054] = "Review recent updates to I2P";
    t[10055] = "Tekintse \u00e1t az I2P legut\u00f3bbi friss\u00edt\u00e9seit";
    t[10062] = "This setting determines the delay between peer test jobs, configured in milliseconds. [Default is 5000]";
    t[10063] = "Ez a be\u00e1ll\u00edt\u00e1s meghat\u00e1rozza a k\u00f6zvet\u00edt\u0151 tesztfeladataink k\u00f6z\u00f6tti k\u00e9sleltet\u00e9st, milliszekundumban konfigur\u00e1lva. [Az alap\u00e9rt\u00e9k 5000]";
    t[10072] = "A guide to reseeding the router";
    t[10073] = "\u00datmutat\u00f3 az \u00fatv\u00e1laszt\u00f3 \u00fajrat\u00f6lt\u00e9s\u00e9hez";
    t[10076] = "A list of countries derived from the <a href=https://freedomhouse.org/report/countries-world-freedom-2019 class='sitelink external' target=_blank rel=noreferrer>World Freedom Report</a> with a poor civil liberties reputation. This list is used to place routers running in the specified countries in <i>Hidden Mode</i> to provide enhanced security for users. The following countries are designated as strict: Afghanistan, Azerbaijan, Bahrain, Belarus, Brunei, Burundi, Cameroon, Central African Republic, Chad, China, Cuba, Democratic Republic of the Congo, Egypt, Equatorial Guinea, Eritrea, Ethiopia, Iran, Kazakhstan, Laos, Libya, Myanmar, North Korea, Palestinian Territories, Rwanda, Saudi Arabia, Somalia, South Sudan, Sudan, Eswatini (Swaziland), Syria, Tajikistan, Thailand, Turkey, Turkmenistan, Venezuela, United Arab Emirates, Uzbekistan, Western Sahara, Yemen.";
    t[10077] = "Azoknak az orsz\u00e1goknak a list\u00e1ja, amelyeket a< a href = https://freedomhouse.org/report/countries-world-freedom-2019 class = 'sitelink external' target = _blank rel = noreferrer> Vil\u00e1g Szabads\u00e1g Jelent\u00e9s</a> alapj\u00e1n k\u00e9sz\u00edtettek, rossz civil szabads\u00e1ggal kapcsolatos h\u00edrnevet szerzett. Ezt a list\u00e1t arra haszn\u00e1lj\u00e1k, hogy/elhelyezkedjenek a megadott orsz\u00e1gokban a fut\u00f3 \u00fatv\u00e1laszt\u00f3k a <i>rejtett \u00fczemm\u00f3dban</i>, hogy fejlettebb biztons\u00e1got ny\u00fajtsanak a felhaszn\u00e1l\u00f3knak. Az al\u00e1bbi orsz\u00e1gokat szigor\u00fanak jel\u00f6lt\u00e9k ki: Afganiszt\u00e1n, Azerbajdzs\u00e1n, Bahrein, Feh\u00e9roroszorsz\u00e1g, Brunei, Burundi, Kamerun, K\u00f6z\u00e9p-Afrikai K\u00f6zt\u00e1rsas\u00e1g, Cs\u00e1d, K\u00edna, Kuba, Kong\u00f3i Demokratikus K\u00f6zt\u00e1rsas\u00e1g, Egyiptom, Egyenl\u00edt\u0151i-Guinea, Eritrea, Eti\u00f3pia, Ir\u00e1n, Kazahszt\u00e1n, Laosz, L\u00edbia, Mianmar, \u00c9szak-Korea, Palesztin Ter\u00fcletek, Ruanda, Sza\u00fad-Ar\u00e1bia, Szom\u00e1lia, D\u00e9l-Szud\u00e1n, Szud\u00e1n, Szv\u00e1zif\u00f6ld (Szv\u00e1zif\u00f6ld), Sz\u00edria, T\u00e1dzsikiszt\u00e1n, Thaif\u00f6ld, T\u00f6r\u00f6korsz\u00e1g, T\u00fcrkmeniszt\u00e1n, Venezuela, Egyes\u00fclt Arab Em\u00edrs\u00e9gek, \u00dczbegiszt\u00e1n, Nyugat-Szahara, Jemen.";
