    t[10294] = "A limited selection of stats is enabled by default, required for monitoring router performance. Only stats that have an optional graph are listed here; for a full list of enabled stats, view the <a href=\"/stats\">stats page</a>.";
    t[10295] = "Alap\u00e9rtelmezetten n\u00e9h\u00e1ny korl\u00e1tozott adatgy\u0171jt\u00e9s van enged\u00e9lyezve, amelyek sz\u00fcks\u00e9gesek a router teljes\u00edtm\u00e9ny\u00e9nek monitoroz\u00e1s\u00e1hoz. Csak azon statisztik\u00e1k szerepelnek itt, amelyekhez opcion\u00e1lis grafikon tartozik; az enged\u00e9lyezett \u00f6sszes statisztika list\u00e1j\u00e1hoz tekintse <a href=\"/stats\">a statisztika oldalt</a>.";
