    t[10318] = "Where possible, please ensure I2P+/Java is allowed bi-directional port access from the internet by configuring your modem/router/pc firewall accordingly. If you're behind a prohibitive firewall but have unrestricted outbound access, I2P+ can still function; you can turn off inbound access and rely on <a href=http://i2p-projekt.i2p/udp.html target=_blank rel=noreferrer class=sitelink>SSU IP Address Detection</a> (<a href=https://wikipedia.org/wiki/Hole_punching target=_blank rel=noreferrer class='sitelink external'>firewall hole punching</a>) to connect you to the network, and your network status in the side panel will indicate \"Status: Firewalled\". For optimal performance, please ensure I2P's <a href=/confignet#udpconfig>external port</a> is visible from the internet (see below for more information).";
    t[10319] = "Ahol lehets\u00e9ges, biztos\u00edtsa, hogy az I2P+/Java k\u00e9pes legyen a k\u00e9tir\u00e1ny\u00fa port hozz\u00e1f\u00e9r\u00e9sre az interneten kereszt\u00fcl, konfigur\u00e1lva a modem/router/pc t\u0171zfal\u00e1t ennek megfelel\u0151en. Ha egy letilt\u00f3 t\u0171zfal m\u00f6g\u00f6tt \u00e1ll, de korl\u00e1tlan k\u00fcldhet\u0151 adathozz\u00e1f\u00e9r\u00e9se van, az I2P+ tov\u00e1bbra is m\u0171k\u00f6dhet; kikapcsolhatja a bej\u00f6v\u0151 hozz\u00e1f\u00e9r\u00e9st \u00e9s t\u00e1maszkodhat az <a href=http://i2p-projekt.i2p/udp.html target=_blank rel=noreferrer class=sitelink>SSU IP c\u00edm-felder\u00edt\u00e9sre</a> (<a href=https://wikipedia.org/wiki/Hole_punching target=_blank rel=noreferrer class='sitelink external'>t\u0171zfal lyukaszt\u00e1s</a>) a h\u00e1l\u00f3zathoz val\u00f3 kapcsol\u00f3d\u00e1shoz, a h\u00e1l\u00f3zati \u00e1llapot\u00e1t oldals\u00e1v\u00e1n \"Sz\u00fcks\u00e9g eset\u00e9n tiltott\" m\u00f3don jelzi. Optim\u00e1lis teljes\u00edtm\u00e9ny \u00e9rdek\u00e9ben gy\u0151z\u0151dj\u00f6n meg r\u00f3la, hogy az I2P <a href=/confignet#udpconfig>k\u00fcls\u0151 portja</a> l\u00e1that\u00f3 az interneten (l\u00e1sd a r\u00e9szletek\u00e9rt lentebb).";
