    t[10650] = "Duplicate packets received from peer";
    t[10651] = "P\u00e1rost\u00f3l kapott duplik\u00e1lt csomagok";
    t[10660] = "Services may be hosted on multiple routers simultaneously, by sharing the same private key for the destination. Multihoming can further enhance the security and stability of a server by providing redundancy; if a server is multihomed, when a server in the pool goes offline, the provided service will remain available, making it more difficult to correlate server downtime with a router going offline.";
    t[10661] = "A szolg\u00e1ltat\u00e1sok egyszerre t\u00f6bb kiszolg\u00e1l\u00f3n is \u00fczemeltethet\u0151k, a c\u00e9lhelyhez ugyanazzal a priv\u00e1t kulccsal. A t\u00f6bblak\u00f3s m\u0171k\u00f6d\u00e9s fokozhatja egy szerver biztons\u00e1g\u00e1t \u00e9s stabilit\u00e1s\u00e1t a redundancia biztos\u00edt\u00e1s\u00e1val; ha egy szerver t\u00f6bblak\u00f3s, akkor ha a szerver egyik kiszolg\u00e1l\u00f3ja kiesik, a szolg\u00e1ltat\u00e1s el\u00e9rhet\u0151 marad, nehezebb lesz \u00f6sszef\u00fcgg\u00e9st tal\u00e1lni a kiszolg\u00e1l\u00f3 kies\u00e9s\u00e9nek \u00e9s a k\u00e9sz\u00fcl\u00e9k kies\u00e9s\u00e9nek k\u00f6z\u00f6tt.";
    t[10672] = "Client Configuration";
