    t[10706] = "They offered to introduce us";
    t[10707] = "Felaj\u00e1nlott\u00e1k, hogy bemutatnak minket";
    t[10708] = "Performing a soft restart";
    t[10709] = "L\u00e1gy \u00fajraind\u00edt\u00e1s v\u00e9grehajt\u00e1sa";
    t[10710] = "The process of acquiring router identities, normally via <i>clearnet</i> servers, to ensure your router can communicate and build tunnels with other routers on the network. When a router has no router identities for other peers (usually immediately after installation), the process of reseeding is also referred to as <i>bootstrapping</i>.";
    t[10711] = "Az \u00fatv\u00e1laszt\u00f3azonos\u00edt\u00f3k megszerz\u00e9se folyamata, \u00e1ltal\u00e1ban a <i> tiszta h\u00e1l\u00f3zati </ i> szervereken kereszt\u00fcl, hogy biztos\u00edtsa az \u00fatv\u00e1laszt\u00f3ja kommunik\u00e1ci\u00f3j\u00e1t \u00e9s alagutak kialak\u00edt\u00e1s\u00e1t m\u00e1s \u00fatv\u00e1laszt\u00f3kkal a h\u00e1l\u00f3zaton. Ha az \u00fatv\u00e1laszt\u00f3nak nincs m\u00e1s peerekre vonatkoz\u00f3 \u00fatv\u00e1laszt\u00f3azonos\u00edt\u00f3ja (\u00e1ltal\u00e1ban r\u00f6gt\u00f6n a telep\u00edt\u00e9st k\u00f6vet\u0151en), az \u00fajra\u00e9rtekeln\u00e9ssel j\u00e1r\u00f3 folyamatot <i> bootol\u00f3kk\u00e1 </i> is nevezik.";
