    t[10739] = "Az Atlanti-\u00f3ce\u00e1n";
    t[10740] = "Warning: could not set the I2P+ service to autostart";
    t[10741] = "Figyelmeztet\u00e9s: az I2P+ szolg\u00e1ltat\u00e1st nem siker\u00fclt automatikus ind\u00edt\u00e1sra \u00e1ll\u00edtani";
    t[10746] = "A tunnel used by the router for communicating with other routers to perform various \"housekeeping\" functions such as learning and publishing <i>leasesets</i>, testing client tunnels, and learning about and validating other routers in the network. These tunnels are normally low-bandwidth.";
    t[10747] = "Egy tunnel, amit a k\u00f6zvet\u00edt\u0151 haszn\u00e1l m\u00e1s k\u00f6zvet\u00edt\u0151kkel val\u00f3 kommunik\u00e1ci\u00f3ra, hogy v\u00e9gezzen k\u00fcl\u00f6nb\u00f6z\u0151 \"karbantart\u00e1si\" funkci\u00f3kat, mint p\u00e9ld\u00e1ul olyan \"leasesetek\" tanulm\u00e1nyoz\u00e1sa \u00e9s publik\u00e1l\u00e1sa, kliens tunnel-ek tesztel\u00e9se, \u00e9s m\u00e1s k\u00f6zvet\u00edt\u0151k megtanul\u00e1sa \u00e9s \u00e9rv\u00e9nyes\u00edt\u00e9se a h\u00e1l\u00f3zatban. Ezek a tunnel-ek \u00e1ltal\u00e1ban alacsony s\u00e1vsz\u00e9less\u00e9g\u0171ek.";
    t[10752] = "Debug";
    t[10753] = "Debug";
