    t[10766] = "An alternative implementation of an I2P router coded in C++. For more information, see <a href=https://i2pd.website/ class='sitelink external' target=_blank rel=noreferrer>https://i2pd.website/</a> Source code is available on <a href=https://github.com/PurpleI2P/i2pd class='sitelink external' target=_blank rel=noreferrer>github</a>.";
    t[10767] = "Az I2P \u00fatv\u00e1laszt\u00f3 alternat\u00edv megval\u00f3s\u00edt\u00e1sa C++ nyelven \u00edrva. Tov\u00e1bbi inform\u00e1ci\u00f3\u00e9rt l\u00e1sd a <a href=https://i2pd.website/ class='sitelink external' target=_blank rel=noreferrer>https://i2pd.website/</a> linket. A forr\u00e1sk\u00f3d el\u00e9rhet\u0151 a <a href=https://github.com/PurpleI2P/i2pd class='sitelink external' target=_blank rel=noreferrer>github</a> oldalon.";
