    t[11009] = "A meghat\u00e1rozott id\u0151szakban (m\u00e1sodpercben) v\u00e9grehajtott kapcsol\u00f3d\u00e1si k\u00eds\u00e9rletek sz\u00e1m\u00e1nak numerikus meghat\u00e1roz\u00e1sa, pl. <i class=example>15/5</i>, <i class=example>60/60</i> stb.";
    t[11018] = "32bit host OS running with less than 4 detected cores";
    t[11019] = "32 bites oper\u00e1ci\u00f3s rendszer kevesebb, mint 4 \u00e9szlelt maggal";
    t[11020] = "Cannot copy plugin to directory {0}";
    t[11021] = "Kieg\u00e9sz\u00edt\u0151 m\u00e1sol\u00e1sa sikertelen a k\u00f6vetkez\u0151 k\u00f6nyvt\u00e1rba: {0}";
    t[11024] = "By default, I2P will use the system configured default browser to launch at startup. If you wish to nominate an alternative browser, you will need to edit your router.config file (or the <a href=/configadvanced>Advanced Configuration page</a> if you have enabled advanced console mode) and add a new configuration line <code>routerconsole.browser=/path/to/browser</code> or <code>routerconsole.browser=\\path\\to\\browser.exe</code> if using Windows, replacing <code>\\path\\to\\browser</code> with the location of the browser you wish to use. Note: If the path to your chosen browser contains spaces, you may need to encase the path in quotes e.g. <code>routerconsole.browser=\"C:\\Program Files\\Mozilla\\Firefox.exe\"</code>";
    t[11025] = "Alap\u00e9rtelmez\u00e9s szerint az I2P az oper\u00e1ci\u00f3s rendszer konfigur\u00e1lt alap\u00e9rtelmezett b\u00f6ng\u00e9sz\u0151j\u00e9t haszn\u00e1lja a startup ind\u00edt\u00e1s\u00e1hoz. Ha szeretne egy m\u00e1sik b\u00f6ng\u00e9sz\u0151t jel\u00f6lni, szerkesztenie kell a router.config f\u00e1jlt (vagy az <a href=/configadvanced>Halad\u00f3 konfigur\u00e1ci\u00f3s oldal</a> eset\u00e9n, ha enged\u00e9lyezte a halad\u00f3 konzol \u00fczemm\u00f3dot), \u00e9s hozz\u00e1 kell adnia egy \u00faj konfigur\u00e1ci\u00f3s sort <code>routerconsole.browser=/path/to/browser</code> vagy <code>routerconsole.browser=\\path\\to\\browser.exe</code>, ha Windows-t haszn\u00e1l, \u00e9s helyettes\u00edtse <code>\\path\\to\\browser</code> az \u00e1ltaluk haszn\u00e1lni k\u00edv\u00e1nt b\u00f6ng\u00e9sz\u0151 hely\u00e9vel. Megjegyz\u00e9s: Ha a kiv\u00e1lasztott b\u00f6ng\u00e9sz\u0151 el\u00e9r\u00e9si \u00fatja tartalmaz sz\u00f3k\u00f6zt, lehet, hogy id\u00e9z\u0151jelek k\u00f6z\u00e9 kell helyeznie az utat, p\u00e9ld\u00e1ul <code>routerconsole.browser=\"C:\\Program Files\\Mozilla\\Firefox.exe\"</code>";
    t[11028] = "Update check failed for plugin {0}";
