    t[11093] = "\u00dajrak\u00fcld\u00f6tt csomagok";
    t[11106] = "This setting (in hours) allows you to manually configure how old a RouterInfo is in order for it to be checked by the Refresh Routers Job. By default, the age of a RouterInfo before a refresh is intitiated scales according to the size of the NetDb, increasing as the NetDb grows in size. A value of 0 will force the Router Refresh Job to check every router in the NetDb, regardless of age.";
    t[11107] = "Ez a be\u00e1ll\u00edt\u00e1s (\u00f3r\u00e1ban) lehet\u0151v\u00e9 teszi, hogy k\u00e9zzel konfigur\u00e1lja, hogy milyen r\u00e9gi legyen egy RouterInfo ellen\u0151rz\u00e9s\u00e9hez a Refresh Routers Job \u00e1ltal. Az alap\u00e9rtelmez\u00e9s szerint az id\u0151, amelyen bel\u00fcl egy RouterInfo \u00e9rt\u00e9kel\u0151dik \u00fajra, a NetDb m\u00e9ret\u00e9vel ar\u00e1nyosan n\u00f6vekszik, ahogy a NetDb nagyobb lesz. A 0 \u00e9rt\u00e9k arra k\u00e9nyszer\u00edti, hogy a Router Refresh Job minden routert ellen\u0151rizzen a NetDb-ben, f\u00fcggetlen\u00fcl az \u00e9letkort\u00f3l.";
    t[11112] = "Show all members of the {0} family in NetDb";
    t[11113] = "A {0} csal\u00e1d \u00f6sszes tagj\u00e1nak megjelen\u00edt\u00e9se a NetDb-ben";
    t[11120] = "Failed to install plugin in {0}";
    t[11121] = "Kieg\u00e9sz\u00edt\u0151 telep\u00edt\u00e9se sikertelen a k\u00f6vetkez\u0151ben: {0}";
    t[11124] = "Install from file failed";
    t[11125] = "Sikertelen telep\u00edt\u00e9s f\u00e1jlb\u00f3l";
    t[11128] = "An I2P web application that manages service destinations for the network, mapping B64 hashes to human-readable names. Destinations may be added manually, or via subscriptions to hosts.txt files. Also referred to as SusiDNS. For more information, see the <a href=https://geti2p.net/en/docs/naming class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[11129] = "Egy I2P webalkalmaz\u00e1s, amely a h\u00e1l\u00f3zathoz tartoz\u00f3 szolg\u00e1ltat\u00e1si c\u00e9l\u00e1llom\u00e1sokat kezeli, az ember \u00e1ltal olvashat\u00f3 neveket B64-hasnikhoz (B64 hash) rendel. A c\u00e9l\u00e1llom\u00e1sok k\u00e9zzel is hozz\u00e1adhat\u00f3k, vagy hozz\u00e1rendelhet\u0151k hosts.txt f\u00e1jlokra iratkoz\u00e1ssal. Ezt SusiDNS n\u00e9ven is emlegetik. Tov\u00e1bbi inform\u00e1ci\u00f3\u00e9rt l\u00e1sd az <a href=https://geti2p.net/en/docs/naming class='sitelink external' target=_blank rel=noreferrer>online dokument\u00e1ci\u00f3t</a>.";
