    t[11148] = "UDP Port In Use";
    t[11149] = "UDP port haszn\u00e1latban";
    t[11150] = "A tunnel to the main IRC server network within I2P, Irc2P, is created when I2P is installed (see the <a href=/i2ptunnelmgr>Tunnel Manager</a>), and is automatically started when the I2P router starts. To connect to it, tell your IRC client to connect to server: <code>127.0.0.1</code> port: <code>6668</code>.";
    t[11151] = "Az I2P telep\u00edt\u00e9sekor egy alag\u00fat l\u00e9trej\u00f6n a f\u0151 I2P IRC szerverh\u00e1l\u00f3zathoz, az Irc2P-hez (l\u00e1sd: a <a href=/i2ptunnelmgr>Alag\u00fat vez\u00e9rl\u0151t</a>), \u00e9s akkor automatikusan elindul, amikor az I2P \u00fatv\u00e1laszt\u00f3 elindul. A csatlakoz\u00e1shoz mondja az IRC kliensednek, hogy csatlakozzon a szerverhez: <code>127.0.0.1</code> port: <code>6668</code>.";
