    t[11230] = "Can be enabled in the <code>clients.config</code> file. Can also be configured to bind to a specific interface or all interfaces. If both http and https are enabled, automatic redirection to https is enabled by default. If you make the Router Console available over the network, you might wish to <a href=/configui#passwordheading>enforce an access password</a> to prevent unauthorized access.";
    t[11231] = "Enged\u00e9lyezhet\u0151 a <code>clients.config</code> f\u00e1jlban. Konfigur\u00e1lhat\u00f3, hogy egy adott fel\u00fcletre vagy \u00f6sszes fel\u00fcletre k\u00f6t\u0151dj\u00f6n. Ha mind a http, mind az https enged\u00e9lyezve van, az automatikus ir\u00e1ny\u00edt\u00e1s az https-re alap\u00e9rtelmez\u00e9s szerint be van kapcsolva. Ha a Router konzolt h\u00e1l\u00f3zaton kereszt\u00fcl hozz\u00e1f\u00e9rhet\u0151v\u00e9 teszi, akkor a hozz\u00e1f\u00e9r\u00e9si jelsz\u00f3t meg kell adni az enged\u00e9ly n\u00e9lk\u00fcli hozz\u00e1f\u00e9r\u00e9s megakad\u00e1lyoz\u00e1s\u00e1hoz.";
    t[11236] = "Tunnel identity";
