    t[11280] = "To determine peer latency, this setting allocates the maximum time a peer test should take before being considered a failure, configured in milliseconds. In the event that the timeout is configured lower than the average successful test, the average successful test value will be used. [Default is 1000]";
    t[11281] = "A peer lass\u00fas\u00e1g\u00e1nak meghat\u00e1roz\u00e1sa \u00e9rdek\u00e9ben ez a be\u00e1ll\u00edt\u00e1s a maxim\u00e1lis id\u0151t sz\u00e1nja, amit egy peer tesztnek vegyen ig\u00e9nybe a kudarcnak val\u00f3 tekintet n\u00e9lk\u00fcl, milliszekundumban bem\u00e9rve. Amennyiben a v\u00e1laszid\u0151 a sikeres tesztek \u00e1tlag\u00e1n\u00e1l kisebbre van konfigur\u00e1lva, haszn\u00e1latba veszi az \u00e1tlag sikeres teszt \u00e9rt\u00e9k\u00e9t. [Az alap\u00e9rt\u00e9k 1000]";
