    t[11384] = "Click the <i>Start</i> button for your webserver tunnel on the <a href=/i2ptunnelmgr/>main Tunnel Manager page</a>. You should now see it listed under <i>Service Tunnels</i> on the <a href=/>Router Console</a> sidebar. A green star displayed next to the tunnel name (<i>I2P Webserver</i> by default) indicates that your website is active on the I2P network.";
    t[11385] = "Kattintson a <i>Start</i> gombra a webszerver alag\u00fatj\u00e1hoz az <a href=/i2ptunnelmgr/>f\u0151 Alag\u00fatkezel\u0151 oldalon</a>. Most l\u00e1tnia kell, hogy szerepel a <i>Szolg\u00e1ltat\u00e1si Alag\u00fat</i> alatt a <a href=/>Router Console</a> oldals\u00e1von. Egy z\u00f6ld csillag, amely megjelenik az alag\u00fat nev\u00e9n\u00e9l (<i>I2P Webserver</i> alap\u00e9rtelmez\u00e9s szerint), azt jelzi, hogy a webhelye akt\u00edv az I2P h\u00e1l\u00f3zaton.";
