    t[11516] = "In order to use a single set of tunnels for multiple client services, clients can be configured from the <i>Tunnel Manager</i> to operate in <i>Shared Client</i> mode. This mode conserves resources and blends the traffic from multiple clients into a single set of tunnels, making traffic analysis harder. Clients configured as Shared Clients share the same tunnel options.";
    t[11517] = "Annak \u00e9rdek\u00e9ben, hogy egyetlen alag\u00fat k\u00e9szletet haszn\u00e1ljon t\u00f6bb \u00fcgyf\u00e9l szolg\u00e1ltat\u00e1shoz, a kliensek be\u00e1ll\u00edthat\u00f3k az <i>Alag\u00fat kezel\u0151 </i>k\u00e9pes m\u0171k\u00f6dni a <i>megosztott \u00fcgyf\u00e9l </i>m\u00f3dban. Ez a m\u00f3d meg\u00f3vja az er\u0151forr\u00e1sokat \u00e9s \u00f6sszekeveri t\u00f6bb \u00fcgyf\u00e9l forgalm\u00e1t az alag\u00fatk\u00e9szlet egyetlen r\u00e9sz\u00e9ben, ami megnehez\u00edti a forgalomelemz\u00e9st. A Megosztott \u00fcgyfelek\u00e9nt be\u00e1ll\u00edtott kliensek ugyanazokat az alag\u00fat be\u00e1ll\u00edt\u00e1sokat haszn\u00e1lj\u00e1k.";
