    t[11658] = "Your modem or router may support <a href=https://wikipedia.org/wiki/Universal_Plug_and_Play target=_blank rel=noreferrer>Universal Plug &amp; Play</a> (UPnP), which permits automatic port forwarding. Ensure UPnP support for I2P+ is enabled on the <a href=/confignet>config page</a>, then try to activate UPnP on your modem/router and possibly your computer also. Now try restarting the <a href=/>I2P+ router</a>. If successful, I2P+ should report \"Status: OK\" in the side panel once the I2P+ router completes initial connectivity tests.";
    t[11659] = "Lehet, hogy a modem vagy a router t\u00e1mogatja a <a href=https://wikipedia.org/wiki/Universal_Plug_and_Play target=_blank rel=noreferrer>Universal Plug &amp; Play</a> (UPnP) funkci\u00f3t, amely lehet\u0151v\u00e9 teszi az automatikus port \u00e1tir\u00e1ny\u00edt\u00e1st. Gy\u0151z\u0151dj\u00f6n meg r\u00f3la, hogy az I2P+ UPnP t\u00e1mogat\u00e1sa enged\u00e9lyezve van a <a href=/confignet>konzololdali be\u00e1ll\u00edt\u00e1sokn\u00e1l</a>, majd pr\u00f3b\u00e1ld meg aktiv\u00e1lni az UPnP-t a modem/routeren \u00e9s esetleg a sz\u00e1m\u00edt\u00f3g\u00e9pen is. Pr\u00f3b\u00e1ld \u00fajraind\u00edtani az <a href=/>I2P+ routert</a>. Ha sikeres, az I2P+ elv\u00e9gzi az inicializ\u00e1l\u00e1si kapcsolattesztet \u00e9s az oldals\u00e1von \"St\u00e1tusz: OK\"-t jelent ki.";
