    t[11965] = "Helyi kapcsolat a burkol\u00f3 vez\u00e9rl\u0151csatorn\u00e1j\u00e1hoz";
    t[11982] = "If your TCP port is firewalled with inbound TCP enabled, routers will not be able to contact you via TCP, which will hurt the network.";
    t[11983] = "Ha a TCP portod t\u0171zfalazva van azzal egy\u00fctt, hogy a bej\u00f6v\u0151 TCP enged\u00e9lyezve van, a routerek nem tudnak hozz\u00e1d csatlakozni TCP-n kereszt\u00fcl \u00e9s ez k\u00e1ros\u00edtja a h\u00e1l\u00f3zatot.";
    t[11984] = "Local Identity";
    t[11985] = "Helyi azonos\u00edt\u00f3";
    t[11994] = "While I2P will work fine behind most firewalls, your speeds and network integration will generally improve if the I2P port is forwarded for both UDP and TCP.";
    t[11995] = "Az I2P megfelel\u0151en m\u0171k\u00f6dik, a legt\u00f6bb t\u0171zfal m\u00f6g\u00f6tt, a sebess\u00e9ged \u00e9s a h\u00e1l\u00f3zati integr\u00e1ci\u00f3d \u00e1ltal\u00e1nosan javul, ha mind az UDP, mind a TCP I2P port tov\u00e1bb\u00edtva van (port forwarding).";
