    t[12018] = "Permanently banned";
    t[12019] = "V\u00e9glegesen kitiltva";
    t[12020] = "Tunnels longer than 3 hops (for example 2 hops + 0-2 hops, 3 hops + 0-1 hops, 3 hops + 0-2 hops), or a high quantity + backup quantity, may severely reduce performance or reliability.";
    t[12021] = "A 3 ugr\u00e1s\u00fan\u00e1l hosszabb alagutak (p\u00e9ld\u00e1ul 2 ugr\u00e1s\u00fa + 0-2 ugr\u00e1s\u00fa, 3 ugr\u00e1s\u00fa + 0-1 ugr\u00e1s\u00fa, 3 ugr\u00e1s\u00fa + 0-2 ugr\u00e1s\u00fa), vagy nagy mennyis\u00e9g + ment\u00e9si mennyis\u00e9g jelent\u0151sen cs\u00f6kkenthetik a teljes\u00edtm\u00e9nyt vagy a megb\u00edzhat\u00f3s\u00e1got.";
