    t[12028] = "If you hover over the <i>Router Info</i> heading, your truncated router identity will be shown (the first four characters (24 bits) of your 44-character (256-bit) Base64 router hash). The full hash is shown on your <a href='netdb?r=.'>Network Database entry</a>. Never reveal this to anyone, as your router identity is uniquely linked to your IP address in the network database.";
    t[12029] = "Amennyiben a kurzor f\u00f6l\u00e9 h\u00fazza az eg\u00e9rmutat\u00f3t a <i>Kapcsolati adatok</i> c\u00edmsor felett, az \u00d6n ler\u00f6vid\u00edtett \u00fatv\u00e1laszt\u00f3 azonos\u00edt\u00f3ja jelenik meg (az els\u0151 n\u00e9gy karakter (24 bit) az \u00d6n 44 karakteres (256 bites) Base64 \u00fatv\u00e1laszt\u00f3 hash \u00e9rt\u00e9k\u00e9b\u0151l). A teljes hash \u00e9rt\u00e9k jelenik meg a <a href='netdb?r=.'>H\u00e1l\u00f3zati adatb\u00e1zis bejegyz\u00e9s\u00e9n</a>. Soha senkinek ne fedje fel ezt az adatot, mert az \u00fatv\u00e1laszt\u00f3 azonos\u00edt\u00f3ja egyedi m\u00f3don kapcsol\u00f3dik az IP-c\u00edm\u00e9hez a h\u00e1l\u00f3zati adatb\u00e1zisban.";
    t[12030] = "Previous";
    t[12031] = "El\u0151z\u0151";
