    t[12033] = "Le\u00e1ll\u00edtott router";
    t[12038] = "Directory listings (sometimes referred to as virtual directories) are enabled by default, so you can host files from a sub-directory of <code>docroot</code> without providing a page with links to the files. You can also serve content that exists outside of <code>docroot</code> by using a <a href=https://en.wikipedia.org/wiki/Symbolic_link target=_blank rel=noreferrer class='sitelink external'>symbolic link</a> to the desired directory.";
    t[12039] = "A k\u00f6nyvt\u00e1rlist\u00e1z\u00e1s (n\u00e9ha virtu\u00e1lis k\u00f6nyvt\u00e1rk\u00e9nt hivatkoznak r\u00e1) alap\u00e9rtelmezetten enged\u00e9lyezve van, \u00edgy a f\u00e1jlokat egy <code>docroot</code> al-k\u00f6nyvt\u00e1rb\u00f3l is tudja szolg\u00e1ltatni an\u00e9lk\u00fcl, hogy azokhoz egy oldalt adna azokhoz vezet\u0151 linkekkel. Tartalom szolg\u00e1ltathat\u00f3 azonban, ami k\u00edv\u00fcl van a <code>docroot</code>-on, haszn\u00e1lva egy <a href=https://en.wikipedia.org/wiki/Symbolic_link target=_blank rel=noreferrer class='sitelink external'>szimbolikus linket</a> a k\u00edv\u00e1nt k\u00f6nyvt\u00e1rhoz.";
    t[12044] = "You have configured I2P to share only {0} KBps.";
    t[12045] = "Az I2P-t \u00fagy \u00e1ll\u00edtottad be, hogy csak {0} KB-t osszon meg m\u00e1sodpercenk\u00e9nt.";
