    t[12059] = "A v\u00e1ltoztat\u00e1sok \u00e9rv\u00e9nybe l\u00e9p\u00e9s\u00e9hez \u00fajraind\u00edt\u00e1s sz\u00fcks\u00e9ges";
    t[12062] = "Using the <i class=example>explicit</i> directive, a threshold can be applied to a remote destination listed in the definition itself, with the option to specify custom thresholds for multiple destinations. Remote destinations can also be excluded from the default threshold using the <i class=example>allow</i> keyword, or permanently blocked using the <i class=example>deny</i> keyword:";
    t[12063] = "Az <i class=example>explicit</i> direkt\u00edv\u00e1val egy k\u00fcls\u0151 c\u00e9lpontra \u00e9rv\u00e9nyes\u00edthet\u0151 egy hat\u00e1r\u00e9rt\u00e9k, amelyet a t\u00e9nyleges meghat\u00e1roz\u00e1sban felsorolt c\u00e9lpontokra alkalmaznak, annak lehet\u0151s\u00e9g\u00e9vel, hogy testreszabott hat\u00e1r\u00e9rt\u00e9keket adjanak meg t\u00f6bb c\u00e9lpont eset\u00e9n. A t\u00e1voli c\u00e9lpontok ki is z\u00e1rhat\u00f3k az alap\u00e9rtelmezett hat\u00e1rok k\u00f6z\u00fcl az <i class=example>allow</i> kulcssz\u00f3val, vagy v\u00e9glegesen letilthat\u00f3k a <i class=example>deny</i> kulcssz\u00f3val:";
