    t[12152] = "Note: Many of the labels and options in the console have tooltips that indicate purpose or explain the meaning. Hover over the label or option to activate the tooltip.";
    t[12153] = "Megjegyz\u00e9s: A konzolon sok c\u00edmke \u00e9s be\u00e1ll\u00edt\u00e1s van, amelyeknek vannak tolltippjeik, amelyek bemutatj\u00e1k a c\u00e9ljukat vagy elmagyar\u00e1zz\u00e1k az \u00e9rtelm\u00fcket. H\u00fazza az eg\u00e9rmutat\u00f3t a c\u00edmke vagy opci\u00f3 f\u00f6l\u00e9 a tolltipp aktiv\u00e1l\u00e1s\u00e1hoz.";
    t[12154] = "The plugins listed below are started by the webConsole client.";
