    t[12182] = "Reason";
    t[12183] = "Ok";
    t[12184] = "This setting determines the number of NetDb DHT buckets the Peer Exploration Job will reference when run. By default, the number of buckets to explore will vary depending on whether the router has been running for over an hour, if the router is hidden or in the 'K' bandwidth tier, and the number of known routers.";
    t[12185] = "Ez a be\u00e1ll\u00edt\u00e1s meghat\u00e1rozza, hogy h\u00e1ny NetDb DHT v\u00f6dr\u00f6t fog hivatkozni a Peer Exploration Job fut\u00e1sakor. Alap\u00e9rtelmez\u00e9s szerint a vizsg\u00e1land\u00f3 v\u00f6dr\u00f6k sz\u00e1ma att\u00f3l f\u00fcgg, hogy a router t\u00f6bb mint egy \u00f3r\u00e1ja fut-e, a router el van-e rejtve vagy az \u201eK\u201d s\u00e1vsz\u00e9less\u00e9gi kateg\u00f3ri\u00e1ban van-e, valamint az ismert routerek sz\u00e1m\u00e1t\u00f3l.";
    t[12186] = "threat points";
    t[12187] = "fenyeget\u00e9si pontok";
    t[12194] = "Failed to stop systray";
    t[12195] = "Nem siker\u00fclt le\u00e1ll\u00edtani a rendszert";
    t[12196] = "Update failed";
    t[12197] = "A friss\u00edt\u00e9s nem siker\u00fclt";
    t[12198] = "Hostname Registration";
    t[12199] = "Gazdan\u00e9v Regisztr\u00e1ci\u00f3";
    t[12200] = "If the number of known peers drops below 50, I2P will attempt to reseed automatically. If the reseed attempt fails, a notification will appear in the sidebar with an option to manually reseed. A failed reseed attempt can occur if your local firewall limits outbound traffic, you are experiencing network connectivity issues, or if the reseed request is blocked entirely.";
    t[12201] = "Ha a ismert partnerek sz\u00e1ma 50 al\u00e1 esik, az I2P megpr\u00f3b\u00e1lja az automatikus \u00fajratelep\u00edt\u00e9st. Ha az \u00fajratelep\u00edt\u00e9si k\u00eds\u00e9rlet sikertelen, egy \u00e9rtes\u00edt\u00e9s jelenik meg az oldals\u00e1von a k\u00e9zi \u00fajratelep\u00edt\u00e9s lehet\u0151s\u00e9ggel. Az \u00fajratelep\u00edt\u00e9si k\u00eds\u00e9rlet sikertelens\u00e9ge el\u0151fordulhat, ha helyi t\u0171zfal korl\u00e1tozza a kimen\u0151 forgalmat, h\u00e1l\u00f3zati kapcsolattal kapcsolatos probl\u00e9m\u00e1kba \u00fctk\u00f6z\u00f6l, vagy ha az \u00fajratelep\u00edt\u00e9si k\u00e9r\u00e9s teljes m\u00e9rt\u00e9kben letilt\u00e1sra ker\u00fclt.";
    t[12202] = "Alternative privacy-focused front-end for Reddit";
    t[12203] = "Alternat\u00edv adatv\u00e9delemre \u00f6sszpontos\u00edt\u00f3 el\u0151t\u00e9r a Reddithez";
    t[12224] = "Toggle Tunnels";
    t[12225] = "Alagutak v\u00e1lt\u00e1sa";
    t[12228] = "Can be disabled in the <code>clients.config</code> file. Can also be configured to bind to a specific interface or all interfaces in the <code>jetty.xml</code> file.";
    t[12229] = "Letilthat\u00f3 a <code>clients.config</code> f\u00e1jlban. Ak\u00e1r egy specifikus fel\u00fcletre ak\u00e1r az \u00f6sszes fel\u00fcletre is k\u00f6thet\u0151 a <code>jetty.xml</code> fileban.";
    t[12230] = "You can determine which services automatically start when the router starts, manage tunnel allocation to optimize for high usage services or to minimize the the cpu and memory overhead, add server and client tunnels to host or access services on the network, set rate limiting or tunnel filtering for your server tunnels and more.";
    t[12231] = "Meghat\u00e1rozhatja, hogy mely szolg\u00e1ltat\u00e1sok indulnak el automatikusan a router ind\u00edt\u00e1sakor, fejlesztheti az \u00e1tj\u00e1r\u00f3k kioszt\u00e1s\u00e1t annak \u00e9rdek\u00e9ben, hogy optimaliz\u00e1lja a magas fogyaszt\u00e1s\u00fa k\u00e9pess\u00e9gek haszn\u00e1lat\u00e1t vagy minimaliz\u00e1lja a CPU \u00e9s a mem\u00f3ria fejfesz\u00fclts\u00e9get, be\u00e1ll\u00edthat szerver \u00e9s kliens alagutakat a h\u00e1l\u00f3zaton val\u00f3 szolg\u00e1ltat\u00e1sokhoz vagy el\u00e9r\u00e9s\u00e9hez, be\u00e1ll\u00edthat sebess\u00e9gkorl\u00e1toz\u00e1st vagy alag\u00fat sz\u0171r\u00e9st a szervertunneljeihez \u00e9s m\u00e9g sok m\u00e1s m\u00e1st.";
    t[12232] = "Binds to the LAN address. Can be changed with advanced config <code>i2np.upnp.HTTPPort=nnnn</code>. Can be disabled on the <a href=/confignet>Network Configuration page</a>.";
    t[12233] = "A LAN c\u00edmhez k\u00f6ti. Megv\u00e1ltoztathat\u00f3 a kiterjesztett konfigur\u00e1ci\u00f3val <code>i2np.upnp.HTTPPort=nnnn</code>. Letilthat\u00f3 a <a href=/confignet>H\u00e1l\u00f3zati Konfigur\u00e1ci\u00f3s oldalon</a>.";
    t[12234] = "Data transferred";
    t[12235] = "Adat\u00e1tvitel";
    t[12244] = "In the box marked <i>No Proxy for</i> add the line <code>127.0.0.1,localhost</code> to ensure the I2P console and other locally hosted websites are still available.";
    t[12245] = "A <i>No Proxy for</i> opci\u00f3 melletti mez\u0151be add hozz\u00e1 a <code>127.0.0.1,localhost</code> sort, hogy biztos\u00edtsd az I2P konzol \u00e9s m\u00e1s lok\u00e1lisan hostolt webhelyek rendelkez\u00e9sre \u00e1ll\u00e1s\u00e1t.";
