    t[12348] = "The unique cryptographic identity of the inbound endpoint of a tunnel providing access to a service on the I2P network, represented as a Base32 or Base64 hash of the public key. Equivalent to an IP address and port.";
    t[12349] = "Az I2P h\u00e1l\u00f3zaton szolg\u00e1ltat\u00e1st biztos\u00edt\u00f3 alag\u00fat bej\u00f6v\u0151 cs\u00facspontj\u00e1nak egyed\u00fcl\u00e1ll\u00f3 kriptogr\u00e1fiai azonos\u00edt\u00f3ja, amit a nyilv\u00e1nos kulcs Base32 vagy Base64 hash-e k\u00e9pvisel. Egyen\u00e9rt\u00e9k\u0171 az egy IP c\u00edmmel \u00e9s porttal.";
